INSERT INTO `imdbinfo` (`id`, `movie_id`, `imdb_code`, `title_long`, `slug`, `year`, `movie_runtime`, `description_full`, `language`, `date_uploaded`) VALUES
(1, 13879, 'tt8168966', 'Trauma Therapy (2019)', 'trauma-therapy-2019', 2019, 79, 'A group of broken souls attend a self-help seminar at a remote wooded retreat with a famous guru. In search of better lives, they must confront their deepest demons in the midst of their fellow wayward strangers. As they get pushed further and further by the program, they begin to confront their personal problems. But as their group therapy sessions become increasingly volatile - including lie detectors, fire arms, and experimental drugs - they begin to question the methods in spite of the results. What is their guru\'s real goal, and will his reckless pursuit of life change moments end up saving them...or destroying them?', 'English', '2019-10-08 04:03:15'),
(2, 13877, 'tt9356952', 'The Death of Dick Long (2019)', 'the-death-of-dick-long-2019', 2019, 100, 'Dick died last night, and Zeke and Earl don\'t want anybody finding out how. That\'s too bad though, cause news travels fast in small-town Alabama.', 'English', '2019-10-08 01:43:53'),
(3, 13876, 'tt7831358', 'Harpoon (2019)', 'harpoon-2019', 2019, 83, 'Rivalries, dark secrets, and sexual tension emerge when three best friends find themselves stranded on a yacht in the middle of the ocean desperate for survival.', 'English', '2019-10-08 07:58:01'),
(4, 13875, 'tt7083208', 'Barren Trees (2018)', 'barren-trees-2018', 2018, 99, 'A man in the witness protection program struggles with his crumbling home life, while two hitmen from his old neighborhood hunt him down.', 'English', '2019-10-07 21:48:09'),
(5, 13874, 'tt7304196', 'Wake. (2018)', 'wake-2018', 2018, 96, 'A widowed mortician, struggling with agoraphobia, is given a birthday gift from her mother and daughter as a joke. The gift, a life-size male doll named Pedro, goes from funny to fantastical, complicating her ties with her family as well as a budding relationship with a documentary Filmmaker.', 'English', '2019-10-08 05:01:33'),
(6, 13873, 'tt6702308', 'The Riot Act (2018)', 'the-riot-act-2018', 2018, 101, 'This period film from Director Devon Parks weaves an intersecting web of characters, all having witnessed a murder from three different vantage points. The dark past of this turn of the century town begins to uncover itself as an elaborate plot for revenge is constructed around the origins of a real life ghost story.', 'English', '2019-10-08 02:08:34'),
(7, 13872, 'tt7339248', 'The Art of Self-Defense (2019)', 'the-art-of-self-defense-2019', 2019, 104, 'After he\'s attacked on the street at night by a roving motorcycle gang, timid bookkeeper Casey (Jesse Eisenberg) joins a neighborhood karate studio to learn how to protect himself. Under the watchful eye of a charismatic instructor, Sensei (Alessandro Nivola), and hardcore brown belt Anna (Imogen Poots), Casey gains a newfound sense of confidence for the first time in his life. But when he attends Sensei\'s mysterious night classes, he discovers a sinister world of fraternity, brutality and hyper-masculinity, presenting a journey that places him squarely in the sights of his enigmatic new mentor.', 'English', '2019-10-07 22:57:34'),
(8, 13871, 'tt5273284', 'Meme (2018)', 'meme-2018', 2018, 87, 'Jennifer, an independent designer disappointed in her stalled relationship and career, discovers a surreal mashup videotape, labeled \"Meme,\" among a friend\'s VHS collection. She goes in search of Meme\'s creator, tracking down people who appear on the tape to gain greater insight into what it is and why it exists. As she pursues the creator of the tape she takes greater control of other aspects of her life including her relationship, difficult clients, and a drinking problem that increasingly interferes with her life.', 'English', '2019-10-07 19:37:58'),
(9, 13870, 'tt4412528', 'Two Lovers and a Bear (2016)', 'two-lovers-and-a-bear-2016', 2016, 96, 'Set in a small town near the North Pole where roads lead to nowhere, the story follows Roman (DeHaan) and Lucy (Maslany), two burning souls who come together to make a leap for life and inner peace.', 'English', '2019-10-07 19:56:54'),
(10, 13869, 'tt0066808', 'Bananas (1971)', 'bananas-1971', 1971, 82, 'Fielding Mellish (a consumer products tester) becomes infatuated with Nancy (a political activist). He attends demonstrations and tries in other ways to convince her that he is worthy of her love, but Nancy wants someone with greater leadership potential. Fielding runs off to San Marcos where he joins the rebels and eventually becomes President of the country. While on a trip to the states, he meets Nancy again and she falls for him now that he is a political leader.', 'English', '2019-10-07 16:59:57'),
(11, 13868, 'tt7689950', 'White Rabbit (2018)', 'white-rabbit-2018', 2018, 71, 'A dramatic comedy following a Korean-American performance artist who struggles to be authentically heard and seen through her multiple identities in modern Los Angeles.', 'English', '2019-10-07 14:47:14'),
(12, 13867, 'tt1617620', 'A Horrible Way to Die (2010)', 'a-horrible-way-to-die-2010', 2010, 87, 'An escaped murderer is in pursuit of his ex-girlfriend, who has fled to start a new life in a small town.', 'English', '2019-10-07 13:48:08'),
(13, 13866, 'tt0073880', 'Walking Tall Part II (1975)', 'walking-tall-part-ii-1975', 1975, 109, 'Sheriff Buford Pusser continues his one-man war against moonshiners and a ruthless crime syndicate after the murder of his wife in late 1960\'s Tennessee.', 'English', '2019-10-07 10:53:21'),
(14, 13865, 'tt0084083', 'The Brazilwood Man (1982)', 'the-brazilwood-man-1982', 1982, 106, 'Fantasy comedy about Brazilian writer Oswald de Andrade, one of the most important icons of Modernism in Brazil. In the film, Oswald is played by two actors: Ãtala Nandi, as his feminine anima, and FlÃ¡vio GalvÃ£o, as the masculine half.', 'English', '2019-10-07 12:02:55'),
(15, 13864, 'tt5628902', 'Rabid (2019)', 'rabid-2019', 2019, 107, 'What happens when you realize that to achieve your dreams you have to live a nightmare? Rose is a quiet, demure, unassuming woman in her looks and actions. Her dream is to become a famous designer in the fashion world, but a terrible accident leaves Rose scarred beyond recognition. She seeks out a radical untested stem cell treatment. The treatment is nothing short of a miracle and wallflower Rose turns into the belle of the ball. It all seems to good to be true. She is now everything she wanted to be. But everything in life comes at a price and this new found perfect life is no exception.', 'English', '2019-10-07 07:43:58'),
(16, 13863, 'tt4242100', 'My Father Die (2016)', 'my-father-die-2016', 2016, 102, 'Deaf since having his hearing knocked out at the age of 12, Asher has been training for almost two decades to avenge himself on Ivan, the man that killed his older brother, 21 years ago. And now that his nemesis is out of prison, he gets his chance. But Asher\'s target also happens to be his father.', 'English', '2019-10-07 05:08:35'),
(17, 13862, 'tt0875140', 'Portrait of a Young Man in Three Movements (1931)', 'portrait-of-a-young-man-in-three-movements-1931', 1931, 0, 'Without sound, in three movements. Title cards declare that what a person likes and his manner of liking them reveals character. There are long looks at forms and rhythms. The film begins and ends with the sea: the tide coming in, small breakers running up on a beach. In the first movement, rocks appear, light and dark play on water. From time to time, machines turn. The light makes dappled patterns. In the second movement, a leafy tree branch gives way to water then shots of the sky and clouds. The third movement returns to the shore, with long takes looking out far, past the beach to outcroppings under the horizon. Small breakers interrupt the patterns of light on water.', 'English', '2019-10-07 03:29:25'),
(18, 13861, 'tt0046816', 'The Caine Mutiny (1954)', 'the-caine-mutiny-1954', 1954, 124, 'During the World War II, the crew of a small insignificant ship in the U.S. Pacific Fleet experience an event unlike any event ever experienced by the United States Navy. A Ship\'s Captain is removed from command by his Executive Officer in an apparent outright act of mutiny. As the trial of the mutineers unfold, it is learned that the Captain of the ship was mentally unstable, perhaps even insane. The Navy must decide if the Caine Mutiny was a criminal act, or an act of courage to save a ship from destruction at the hands of her Captain?', 'English', '2019-10-07 06:36:08'),
(19, 13860, 'tt0362511', 'Dorm Daze (2003)', 'dorm-daze-2003', 2003, 96, 'Dorm Daze unfolds during a crazy afternoon at a university co-ed dormitory in the days before Christmas break when one of the students, Styles McFee, hires a prostitute named Dominique for his unwitting brother, Booker, to lose his virginity. But Booker prefers to lose his virginity to his long-term sweetheart Rachel just down the hall. Meanwhile, another student, named Wang, awaits the arrival of a French foreign exchange student, who speaks little English, also named Dominique. Farcical wackiness ensues as a series of mistaken identities and mishaps escalate into monumental proportions starting when Wang leaves for work, Dominique the Student arrives and is mistaken for the prostitute by Styles, while Dominique the Hooker is mistaken for the student by others including the two dorm gossip queens Lynne and Marla. Other characters involve Adrienne, who is targeted by the dorm geek, Newmar, with whom they had a drunken fling the night before. Adrienne tries to find a missing handbag ...', 'English', '2019-10-07 03:46:12'),
(20, 13859, 'tt0040257', 'Cry of the City (1948)', 'cry-of-the-city-1948', 1948, 95, 'Petty crook and cop-killer Martin Rome, in bad shape from wounds in the hospital prison ward, still refuses to help slimy lawyer Niles clear his client by confessing to another crime. Police Lt. Candella must check Niles\' allegation; a friend of the Rome family, he walks a tightrope between sentiment and cynicism. When Martin fears Candella will implicate his girlfriend Teena, he\'ll do anything to protect her. How many others will he drag down to disaster with him?', 'English', '2019-10-07 01:10:50'),
(21, 13858, 'tt5710042', 'Mercy (2016)', 'mercy-2016', 2016, 90, 'When four estranged brothers return home to say their last goodbye to their dying mother, Grace, hidden motivations reveal themselves. The family\'s already tenuous bonds are tested when secrets from Grace\'s past resurface, causing a restless night to go terribly awry as the brothers are thrust into a fight for their own survival.', 'English', '2019-10-07 01:39:34'),
(22, 13857, 'tt3003996', 'The Way We Dance (2013)', 'the-way-we-dance-2013', 2013, 110, 'The rise, fall, and rise again of a Hong Kong street dance crew.', 'English', '2019-10-06 23:18:00'),
(23, 13856, 'tt0034428', 'Across the Pacific (1942)', 'across-the-pacific-1942', 1942, 97, 'Rick Leland makes no secret of the fact he has no loyalty to his home country after he is court-martialed, kicked out of the Army, and boards a Japanese ship for the Orient in late 1941. But has Leland really been booted out, or is there some other motive for his getting close to fellow passenger Doctor Lorenz? Any motive for getting close to attractive traveler Alberta Marlow would however seem pretty obvious.', 'English', '2019-10-06 20:54:26'),
(24, 13855, 'tt3756788', 'Our Little Sister (2015)', 'our-little-sister-2015', 2015, 127, 'Three sisters live together in their late grandmother\'s house in the city of Kamakura. They have lived together since their dad left home for another woman and their mum imitated her husband by running off with another man. Sachi, 29, the oldest Koda sister, a nurse at the local hospital, acts as a substitute mother to Yoshino, 22, and Chika, 19. One day, the threesome learns of the death of their \"traitor\" father and it is only halfheartedly that they go to his funeral. But in Yamagata something unexpected happens: they meet their half-sister Suzu, 13, there and immediately fall for the spell of this exquisite young creature. Sensing that Yoko, her father\'s widow, will not be a fit guardian, Sachi invites Suzu to move in with them.', 'English', '2019-10-06 17:30:32'),
(25, 13854, 'tt0081404', 'The Rebel Intruders (1980)', 'the-rebel-intruders-1980', 1980, 99, 'Three refugees become sworn brothers during a war. One (Kuo Chui/Philip Kwok) works in a whore house, one (Chiang Sheng) in a gambling house, and the other (Lo Mang) in a martial arts school. They become embroiled in the war and are betrayed by one\'s mentor.', 'English', '2019-10-06 16:28:51'),
(26, 13853, 'tt0059512', 'Ninety Degrees in the Shade (1965)', 'ninety-degrees-in-the-shade-1965', 1965, 90, 'In a Prague shop, an assistant has been carrying on an affair with the dishonest, married manager. An emotionally repressed auditor with domestic problems of his own uncovers serious stock discrepancies. A test of loyalties and a questioning of values concludes in tragedy.', 'English', '2019-10-06 07:36:46'),
(27, 13852, 'tt1646973', 'The Silent House (2010)', 'the-silent-house-2010', 2010, 86, 'The plot is based on a true story that happened in the late \'40s in a small village in Uruguay. The film focuses on Laura, who, second by second, intends to leave a house, which hides an obscure secret, unharmed. Laura and her father Wilson settle down in a cottage they have to renew since its owner will soon put the house up for sale. They will spend the night there and repair the following morning. Everything seems to go smoothly until Laura hears a sound that comes from outside and gets louder and louder on the upper floor of the house. Wilson goes up to see what is going on while she remains downstairs on her own, waiting for her father to come down.', 'English', '2019-10-06 13:30:01'),
(28, 13851, 'tt3204632', 'Like Me (2017)', 'like-me-2017', 2017, 80, 'A young woman sets out on a crime spree that she broadcasts on social media.', 'English', '2019-10-06 04:31:38'),
(29, 13850, 'tt0078054', 'Beauty and the Beast (1978)', 'beauty-and-the-beast-1978', 1978, 83, 'A more horrific and gloomy version of The Beauty and the Beast. Julie is a bankrupt merchant\'s daughter who as the only one of the three daughters chooses to save her father\'s life by going to the Haunted Wood\'s Castle where she meets Netvor. He wants to kill her, but her beauty prevents him from that. Although she is forbidden to see him she starts to love him and the love rescues him from his curse.', 'English', '2019-10-06 10:27:42'),
(30, 13849, 'tt0042513', 'Gone to Earth (1950)', 'gone-to-earth-1950', 1950, 0, '', 'English', '2019-10-06 01:55:17'),
(31, 13848, 'tt0089679', 'The New Kids (1985)', 'the-new-kids-1985', 1985, 86, 'Abby McWilliams and her brother Loren are particularly normal teenagers. Their parents Mac and Mary Beth are killed in an accident. It\'s decided that Abby and Loren live in Glenby, Florida with their Aunt Fay and Uncle Charlie who own a gas station and an amusement park. Loren and Abby don\'t have much trouble making friends at their new high school. Loren starts dating Karen, the local sheriff\'s daughter while Abby starts dating Mark. Loren feels uncomfortable when he sees a blond-haired guy harassing Abby in the lunchroom. Mark tells Loren and Abby that the blond-haired guy is Eddie Dutra, a teenage drug addict who is the leader of a gang of redneck thugs. Loren helps Abby keep Dutra at a distance. Dutra\'s retaliations keep getting more vicious until Dutra forces a showdown at the amusement park by kidnapping Abby.', 'English', '2019-10-06 07:21:45'),
(32, 13847, 'tt0045328', 'The Wild Heart (1952)', 'the-wild-heart-1952', 1952, 82, 'A re-editing of Gone to Earth (1950) after a disagreement and court case between director Michael Powell and producer David O. Selznick. Selznick\'s changes are mainly:- (1) Adding a prologue. (2) Adding scenes explaining things, often by putting labels or inscriptions on them. (3) Adding more close-ups of Jennifer Jones (Selznick\'s wife). He also deleted a few scenes that he felt weren\'t dramatic enough. Sadly some of these were major plot points so the story doesn\'t make as much sense as the original. In his autobiographies, Powell claimed that Selznick only left about 35 mins of the original film. In fact there\'s a lot more than that. About 2/3 of the original remains.', 'English', '2019-10-05 23:38:50'),
(33, 13846, 'tt0026667', 'Magnificent Obsession (1935)', 'magnificent-obsession-1935', 1935, 112, 'The life of spoiled rich Robert Merrick is saved through the use of a hospital\'s only resuscitator, but because the medical device cannot be in two places at once, it results in the death of Dr. Hudson, a selfless, brilliant surgeon and generous philanthropist. Merrick falls for Hudson\'s widow, Helen, though she holds him responsible for her husband\'s demise. One day, he insists on driving her home and makes a pass at her. She gets out of the car and is struck by another car, she then goes blind. Merrick then talks to a friend of Dr. Hudson who tells him that her husband had a philosophy-to help people, but never let it be known that you are the one helping them. Only then, he believed, could there be true reward in life. Merrick watches over Helen, and visits her during her recuperation, concealing his identity and calling himself Dr. Robert. When he finds out that she is nearly penniless, he secretly pays for specialists to try to restore her vision. Finally, she travels to Paris ...', 'English', '2019-10-06 04:01:17'),
(34, 13845, 'tt6487050', 'May It Last: A Portrait of the Avett Brothers (2017)', 'may-it-last-a-portrait-of-the-avett-brothers-2017', 2017, 104, 'An intimate documentary following acclaimed North Carolina band the Avett Brothers, as they create their 2016 hit album \"True Sadness.\"', 'English', '2019-10-06 00:26:51'),
(35, 13844, 'tt0065571', 'The Conformist (1970)', 'the-conformist-1970', 1970, 113, 'This story opens in 1938 in Rome, where Marcello has just taken a job working for Mussollini and is courting a beautiful young woman who will make him even more of a conformist. Marcello is going to Paris on his honeymoon and his bosses have an assignment for him there. Look up an old professor who fled Italy when the fascists came into power. At the border of Italy and France, where Marcello and his bride have to change trains, his bosses give him a gun with a silencer. In a flashback to 1917, we learn why sex and violence are linked in Marcello\'s mind.', 'English', '2019-10-05 20:44:43'),
(36, 13843, 'tt0091251', 'Come and See (1985)', 'come-and-see-1985', 1985, 142, 'The feature film directed by Elem Klimov, shot in the genre of military drama. The action takes place on the territory of Belarus in 1943. In the center of the story is a Belarusian boy, who witnesses the horrors of the Nazi punitive action, turning from a cheerful teenager into a gray-haired old man for two days.', 'English', '2019-10-05 22:29:11'),
(37, 13842, 'tt0092978', 'Escape from Sobibor (1987)', 'escape-from-sobibor-1987', 1987, 143, 'During WWII, the death camp at Treblinka had an escape, causing the Commandant at a similar camp in Sobibor to vow that his camp would never experience the same thing. But those who were its captives, the Jewish laborers who had been spared from the ovens, knew they were on borrowed time. That their only hope was to escape..the only question; how to do it. The film\'s based on a factual account of what then happened at Sobibor.', 'English', '2019-10-05 17:12:42'),
(38, 13841, 'tt0094924', 'A Cry in the Dark (1988)', 'a-cry-in-the-dark-1988', 1988, 120, 'Based on the true story of Lindy Chamberlain. During a camping trip to Ayers Rock in outback Australia, she claimed that she witnessed a dingo stealing her baby daughter, Azaria, from the family tent. Azaria\'s body was never found. Police noted some apparent inconsistencies in her story, and she was charged with murder. The case attracted a lot of attention, turning an investigation into a media circus, with the public divided in their opinions.', 'English', '2019-10-05 19:40:38'),
(39, 13839, 'tt8639316', 'Handy Dandy (2019)', 'handy-dandy-2019', 2019, 0, 'A shuttered TV studio in Detroit is haunted by a magician/ventriloquist from a 1960\'s children\'s show, and he\'s looking for a new live (or DEAD) studio audience.', 'English', '2019-10-05 04:34:57'),
(40, 13838, 'tt8134742', '3 from Hell (2019)', '3-from-hell-2019', 2019, 111, 'After being imprisoned for 10 years, the \"Devil\'s Rejects\" are back at it again. Otis (Bill Moseley) escapes prison, meets Winslow (Richard Brake), and devises a plan to get his sister Baby (Sheri Moon Zombie) out too. The Rejects make their way down the road and into Mexico, killing countless people on their way. They find a place to stay, but are soon bombarded with a large group of killers- killers who are after these Three From Hell. Only one group can come out alive, and with the experience these three have, it\'ll just have to be one great killing joyride.', 'English', '2019-10-05 01:34:26'),
(41, 13837, 'tt8752498', 'Wonder Woman: Bloodlines (2019)', 'wonder-woman-bloodlines-2019', 2019, 83, 'The plot is unknown. This is the first DC animated film to feature the character in a starring role since Wonder Woman (2009).', 'English', '2019-10-04 23:03:49'),
(42, 13836, 'tt0057490', 'The Servant (1963)', 'the-servant-1963', 1963, 116, 'The aristocratic Tony (James Fox) moves to London and hires the servant Hugo Barrett (Sir Dirk Bogarde) for all services at home. Barrett seems to be a loyal and competent employee, but Tony\'s girlfriend Susan (Wendy Craig) does not like him, and asks Tony to send him away. When Barrett brings his sister Vera (Sarah Miles) to work and live in the house, Tony has a brief hidden affair with her. After travelling with Susan and spending a couple of days in a friend\'s house outside London, the couple unexpectedly returns and finds Barrett and Vera, who are actually lovers, in Tony\'s room. They are fired and Susan breaks with Tony. Later, Tony meets Barrett alone in a pub and hires him back, and Barrett imposes his real dark intentions in the house, turning the table and switching position with his master.', 'English', '2019-10-05 15:34:58'),
(43, 13835, 'tt7042838', 'Semper Fi (2019)', 'semper-fi-2019', 2019, 99, 'The story sees Courtney as Cal, a by-the-book police officer who makes ends meet as a Marine Corps reservist along with his rowdy and inseparable group of childhood friends. When Cal\'s younger, reckless half-brother Oyster (Wolff) accidentally kills a guy in a bar fight and tries to flee, Cal forces him to face the music. After an unfair sentence, Oyster fights for survival in a dangerous Pennsylvania prison system while Cal and his friends are deployed to fight the lethal insurgency in Iraq. Overseas, Cal\'s world is shaken, and after he barely makes it home alive, he resolves to break Oyster out of prison - no matter the cost.', 'English', '2019-10-05 12:06:59'),
(44, 13834, 'tt4385944', 'My Soul to Keep (2019)', 'my-soul-to-keep-2019', 2019, 90, 'Like many 9-year-old boys, Eli Braverman believes something menacing lives in his basement. When his older sister leaves him home alone one night, Eli discovers if this evil is real or all in his head. What Eli confronts may end up being far more terrifying than even his worst nightmare.', 'English', '2019-10-05 09:41:12'),
(45, 13833, 'tt0067388', 'Man in the Wilderness (1971)', 'man-in-the-wilderness-1971', 1971, 104, 'In the early 1800\'s, a group of fur trappers and Indian traders are returning with their goods to civilisation and are making a desperate attempt to beat the oncoming winter. When guide Zachary Bass is injured in a bear attack, they decide he\'s a goner and leave him behind to die. When he recovers instead, he swears revenge on them and tracks them and their paranoiac expedition leader down.', 'English', '2019-10-05 06:38:08'),
(46, 13832, 'tt7169514', 'Dilili in Paris (2018)', 'dilili-in-paris-2018', 2018, 0, 'In Belle Ã‰poque Paris, accompanied by a young scooter deliveryman, little Kanak Dilili investigates mysterious kidnappings of girls. She meets extraordinary men and women who give her clues. She discovered underground very particular villains, male masters. The two friends will fight with enthusiasm for an active life in the light and living together.', 'English', '2019-10-05 03:57:15'),
(47, 13831, 'tt3689590', 'Blood in the Water (2016)', 'blood-in-the-water-2016', 2016, 91, 'Percy (Alex Russell) and Veronica (Willa Holland) have been housesitting at a palatial modern spread in the Hollywood Hills for the summer, but the real world of New York, jobs and young professional struggles are merely days away. Nonetheless they are in a hurry to leave this paradise, because the tranquility was broken by an unwanted visit by former college classmate Freedgood (Miguel Gomez). His time since their liberal arts\' years has been marked by imprisonment, shady business associations, and drug dealing. And as we learn quickly, this has lead to the man\'s demise, an interested LAPD detective, and a longing for the everyday strife that seems so much more desirable than staying in their false Eden.', 'English', '2019-10-05 01:43:44'),
(48, 13830, 'tt4687108', 'In the Tall Grass (2019)', 'in-the-tall-grass-2019', 2019, 101, 'When siblings Becky and Cal hear the cries of a young boy lost within a field of tall grass, they venture in to rescue him, only to become ensnared themselves by a sinister force that quickly disorients and separates them. Cut off from the world and unable to escape the field\'s tightening grip, they soon discover that the only thing worse than getting lost is being found.', 'English', '2019-10-04 23:08:30'),
(49, 13829, 'tt1754316', 'Art of Deception (2018)', 'art-of-deception-2018', 2018, 0, 'A fight for Love, Fight and World Dominance', 'English', '2019-10-04 20:20:33'),
(50, 13828, 'tt0061584', 'Doctor Dolittle (1967)', 'doctor-dolittle-1967', 1967, 152, 'Dr. John Dolittle lives in a small English village where he specializes in caring for and verbally communicating with animals. When Dr. Dolittle is unjustly sent to an insane asylum for freeing a lovesick seal from captivity, his animals and two closest human friends, Matthew Mugg and Tommy Stubbins, liberate him. Afterward, they join Emma Fairfax and set out by boat to find a famed and elusive creature: the Great Pink Sea Snail.', 'English', '2019-10-04 16:40:07'),
(51, 13827, 'tt0046791', 'Black Widow (1954)', 'black-widow-1954', 1954, 95, 'A married Broadway producer is taken with an innocent young woman who wants to be a writer and make it on Broadway. He decides to take her under his wing, but it\'s not long before the young lady is found dead in his apartment. At first thought to be a suicide, it is later discovered that she has been murdered, and suspicion immediately falls on the producer. He begins his own investigation in order to clear his name, and one of the first things he finds out is that the young woman wasn\'t quite as naive and innocent as she appeared to be.', 'English', '2019-10-04 13:25:57'),
(52, 13826, 'tt8195518', 'Cuck (2019)', 'cuck-2019', 2019, 115, 'CUCK is a gripping fly-on-the wall character study and psychosexual thriller tracking an isolated and lonely young man as he is indoctrinated into the online echo chambers of Alt-Right ideology and hate. Touching on several topical nerves, CUCK gives a raw, unforgiving glimpse into a dark world that hides in plain sight.', 'English', '0000-00-00 00:00:00'),
(53, 13825, 'tt6201302', 'Santa Fake (2019)', 'santa-fake-2019', 2019, 0, 'The Christmas-themed family film will follow Pat Keeley, a young man from Ireland who has emigrated to the United States and finds himself caught up in an escalating whirlwind of shenanigans that takes him from New York to Santa Fe.', 'English', '2019-10-04 17:58:41'),
(54, 13824, 'tt5266668', 'Rogue Warfare (2019)', 'rogue-warfare-2019', 2019, 103, 'A group of military elite from the U.S., Russia, UK, China and France join forces to fight an elite underground terrorist network.', 'English', '2019-10-04 15:37:06'),
(55, 13823, 'tt4827922', 'The Parts You Lose (2019)', 'the-parts-you-lose-2019', 2019, 93, 'A young boy in a small North Dakota town befriends a potentially dangerous fugitive.', 'English', '2019-10-04 13:21:23'),
(56, 13822, 'tt3160336', 'The Birdcatcher (2019)', 'the-birdcatcher-2019', 2019, 100, 'On her attempt to flee the Nazi round-up in Norway, Esther finds herself alone, on an occupied farm forced to conceal her identity; leading to a series of choices and consequences which shift the paths of those around her. This story uncovers a hidden slice of history that grips at the heart and inspires us all at the deepest level.', 'English', '2019-10-03 23:34:01'),
(57, 13821, 'tt4729754', 'Batman Unlimited: Monster Mayhem (2015)', 'batman-unlimited-monster-mayhem-2015', 2015, 81, 'The Joker is aided in his Halloween quest to render modern technology useless and take over Gotham City by Solomon Grundy, Silver Banshee, Clayface and Scarecrow.', 'English', '2019-10-03 21:14:22'),
(58, 13820, 'tt0327679', 'Ella Enchanted (2004)', 'ella-enchanted-2004', 2004, 96, 'Based on Gail Carson Levine\'s award winning novel, this is the story of Ella, a young woman who was given a \"gift\" of obedience by a fairy named Lucinda. She must obey anything anyone tells her to do. When her mother passes away, she is cared for by her thoughtless and greedy father who remarries a loathsome woman with two treacherous daughters. This modern-day, fantasy Cinderella story features fairies, ogres and elves...as well as a hero in the guise of Prince Charmont, whom Ella falls in love with. Unlike Cinderella though, she must depend on herself and her intelligence to get her through her troubles and find Lucinda in order for her \"curse\" to be broken!', 'English', '2019-10-04 08:39:22'),
(59, 13819, 'tt0050281', 'The Cyclops (1957)', 'the-cyclops-1957', 1957, 66, 'Susan Winter undertakes an expedition to a remote area of Mexico, hoping to find her fiance, Bruce Barton, whos plane-crashed there some time ago. The area is suspected to have a good supply of uranium, so Susan has promoted this to wealthy Martin Melville to get money for her expenses. In addition to Melville, she is accompanied by guide Russ Bradford and pilot Lee Brand in his small-engine craft. But the plane crashes, stranding the four in an isolated valley, which they soon discover is highly radioactive and inhabited by mutated life forms - giant insects, enormous lizards, and a 25-foot-tall human male with a deformed face, just one eye, and only brute animal instincts to feed and protect its turf...', 'English', '0000-00-00 00:00:00'),
(60, 13818, 'tt4372390', 'Detour (2016)', 'detour-2016', 2016, 97, 'Law student and all round good guy, Harper, suspects that his scheming step-father, Vincent, is responsible for the car crash that sent his mother into a coma. Drowning his sorrows one evening in a seedy L.A whiskey bar, Harper is interrupted by a tough looking redneck called Johnny Ray who offers to \'take care\' of his step-dad for the cool sum of US$20,000. Angry, intent on revenge and fuelled by alcohol, Harper agrees to the deal and spends the rest of his evening downing shots with Johnny Ray. The next morning, Harper awakes to the mother of all hangovers with hazy memory of the previous night\'s events. Answering a knock at the front door, he is surprised to find Johnny Ray and his beautiful but distant girlfriend, Cherry, ready and waiting to drive to Vegas to kill Vincent. Harper\'s claims that he was drunk and didn\'t know what he was doing mean nothing to Johnny Ray who is more threatening than ever in the cold light of day. Harper quickly realises that there is no easy way out; ...', 'English', '2019-10-04 04:10:55'),
(61, 13817, 'tt0039224', 'Brute Force (1947)', 'brute-force-1947', 1947, 98, 'At overcrowded Westgate Penitentiary, where violence and fear are the norm and the warden has less power than guards and leading prisoners, the least contented prisoner is tough, single-minded Joe Collins. Most of all, Joe hates chief guard Captain Munsey, a petty dictator who glories in absolute power. After one infraction too many, Joe and his cell-mates are put on the dreaded drain pipe detail; prompting an escape scheme that has every chance of turning into a bloodbath.', 'English', '2019-10-04 01:43:02'),
(62, 13816, 'tt2933544', '5 Flights Up (2014)', '5-flights-up-2014', 2014, 88, 'A long-time married couple who\'ve spent their lives together in the same New York apartment become overwhelmed by personal and real estate-related issues when they plan to move away.', 'English', '2019-10-03 23:08:09'),
(63, 13815, 'tt0095740', 'Nightmare Beach (1989)', 'nightmare-beach-1989', 1989, 90, 'After a criminal motorcycle rider is put to death, he comes back from the dead to seek murderous revenge against the residents of a Florida town.', 'English', '2019-10-03 17:56:11'),
(64, 13814, 'tt8879946', 'Maiden (2018)', 'maiden-2018', 2018, 97, 'The story of Tracy Edwards, a 24-year-old cook on charter boats, who became the skipper of the first ever all-female crew to enter the Whitbread Round the World Race in 1989.', 'English', '2019-10-03 14:32:11'),
(65, 13813, 'tt0025710', 'The Return of Bulldog Drummond (1934)', 'the-return-of-bulldog-drummond-1934', 1934, 73, 'Drummond leads a black-shirted platoon of men from his former unit against foreign interlopers trying to pull England into dangerous overseas entanglements.', 'English', '2019-10-03 13:28:57'),
(66, 13812, 'tt6801218', 'Nighthawks (2019)', 'nighthawks-2019', 2019, 0, 'Wide-eyed Midwest transplant Stan (Chace Crawford) agrees to play wingman to his calculating and privileged roommate Chad (Kevin Zegers) as they embark upon an exploration of glittering New York nightlife, whose darkest secrets are held captive by an elite band of millennials known as Nighthawks.', 'English', '2019-10-03 12:10:13'),
(67, 13811, 'tt3405236', 'Raees (2017)', 'raees-2017', 2017, 143, 'The film is set in the early 80\'s and 90\'s in Gujarat. The fictitious story of a man who builds an empire in the state of Gujarat, the only state that still follows prohibition. It\'s a story about his rise and his relationships, which help him become the single most powerful man in the state.', 'English', '2019-10-03 09:58:00'),
(68, 13810, 'tt0053740', 'The Concrete Jungle (1960)', 'the-concrete-jungle-1960', 1960, 97, 'An ex-con who\'s taken part in the robbery of a racetrack is caught and sent back to prison, but he won\'t tell his fellow gang members where he\'s stashed the loot. The gang kidnaps his girlfriend and has him tortured in prison in an effort to find out where the money is.', 'English', '2019-10-03 09:41:41'),
(69, 13809, 'tt0048250', 'A Kid for Two Farthings (1955)', 'a-kid-for-two-farthings-1955', 1955, 96, 'In a lower-class London community of small shops, open-air vendors and flea-marketers, Joe, a small boy, lives with his mother, Joanne, who works in and rooms above the Kandinsky tailor shop. Joe is innocently and earnestly determined to help realize the wishes of his poor, hard-working neighbours. Hearing from Mr. Kandinsky the tale that a captured unicorn will grant any wish, Joe uses his accumulated pocket change to buy a kid with an emerging horn, believing it to be a unicorn. His subsequent efforts to make dreams come true exemplify the power of hope and will amidst hardship.', 'English', '2019-10-03 07:09:41'),
(70, 13808, 'tt0079376', 'Jue dai shuang jiao (1979)', 'jue-dai-shuang-jiao-1979', 1979, 112, 'This tale of hidden treasure and a young wushu warrior in the Valley of Villains is considered among the best from director Chu Yuan and celebrated author Ku Lung. Making the production even more special is the presence of international favorite Alexander Fu Sheng.', 'English', '2019-10-03 04:41:04'),
(71, 13807, 'tt3700392', 'Heidi (2015)', 'heidi-2015', 2015, 111, 'A story of a young girl who lives in the Swiss Alps with her goat herding Grandfather.', 'English', '2019-10-03 02:13:13'),
(72, 13806, 'tt3584496', 'Mermaid Down (2019)', 'mermaid-down-2019', 2019, 91, 'A mermaid is ripped from the Pacific, her tail is chopped off and she\'s thrown into a mental home where no one believes she is a mermaid.', 'English', '2019-10-03 00:01:57'),
(73, 13805, 'tt6426028', 'Knife+Heart (2018)', 'knifeheart-2018', 2018, 102, 'Anne produces third-rate gay porn. After her editor and lover Lois leaves her, she tries to win her back by shooting her most ambitious film yet with her trusted, flamboyant sidekick Archibald. But one of her actors is brutally murdered and Anne gets caught up in a strange investigation that turns her life upside down.', 'English', '2019-10-02 21:50:24'),
(74, 13804, 'tt8242340', 'AÃ¯lo: Une odyssÃ©e en Laponie (2018)', 'ailo-une-odyssee-en-laponie-2018', 2018, 86, 'AÃ¯lo: an odyssey in Lapland tells the fight for the survival of a small wild reindeer, frail and vulnerable to the challenges that punctuate his first year. Its awakening to the wild world is a real tale in the heart of the grandiose landscapes of Lapland.', 'English', '2019-10-02 21:01:17'),
(75, 13803, 'tt1754650', 'Last Prince of Atlantis (2018)', 'last-prince-of-atlantis-2018', 2018, 84, 'The Last Prince of Atlantis is a beautiful fairy tale about love, an animated family movie. The dynamic intrigue, a bright and multidimensional shows keeps the audiences captivated. An old pearl-fisher Bltazar is forced to sell his boat to wealthy man Don Vincenzo. But this is not the worst part. Now Vincenzo wants to take his beautiful daughter Adrianna! The girl is against that, but for how much longer can she resist? Police and gangsters serve Vincenzo... But money and power are nothing when the real love comes around. The Last Prince Of Atlantis appears from the bottom of the sea, where he spent thousands of years in a stone sarcophagus. One day he sees Adrianna in the sea, strikes up looking for her and finds her...', 'English', '2019-10-03 05:26:26'),
(76, 13801, 'tt0005077', 'A Burlesque on Carmen (1915)', 'a-burlesque-on-carmen-1915', 1915, 44, 'This is a parody of two \"Carmen\"s, Bizet\'s opera and a movie (1915) starring Geraldine Farrar. Smugglers come ashore. Their leader sends the gypsy Carmen to lure Don Jose (called Darn Hosiery) away so they can get the contraband to town. There are grand swordfights, deaths, returns to life.', 'English', '2019-10-02 14:28:39'),
(77, 13800, 'tt7078922', 'Backpedal (2017)', 'backpedal-2017', 2017, 66, 'An urban documentary illuminating the struggles pedestrians, bike and skateboard commuters in Charleston, SC experience on a daily basis.', 'English', '2019-10-02 13:09:41'),
(78, 13799, 'tt1104354', 'The Death and Return of Superman (2019)', 'the-death-and-return-of-superman-2019', 2019, 166, 'The Death of Superman (2018) and Reign of the Supermen (2019) now presented as an over two-hour unabridged and seamless animated feature. Witness the no-holds-barred battle between the Justice League and an unstoppable alien force known only as Doomsday, a battle that only Superman can finish and will forever change the face of Metropolis.', 'English', '2019-10-03 01:29:10'),
(79, 13798, 'tt1054894', 'Teen Titans Go! Vs. Teen Titans (2019)', 'teen-titans-go-vs-teen-titans-2019', 2019, 77, 'The comedic modern-day quintet takes on their 2003 counterparts when villains from each of their worlds join forces to pit the two Titan teams against each other. They\'ll need to set aside their differences and work together to combat Trigon, Hexagon, Santa Claus and time itself in order to save the universe.', 'English', '2019-10-02 22:29:16'),
(80, 13797, 'tt3895908', 'Seeds (2018)', 'seeds-2018', 2018, 90, 'When his increasingly depraved behavior spirals out of control, Marcus retreats to his family home along the New England coast. But instead of finding solace, Marcus is haunted by his darkest fears and deepest desires. Is he losing his mind or has something terrible burrowed deep within him? Incubating. Waiting until the climate is right. Marcus must fight to save his crumbling sanity and protect Lily, his beloved niece from a monster that lies in wait.', 'English', '2019-10-02 20:07:57'),
(81, 13796, 'tt0446750', 'Nightwatching (2007)', 'nightwatching-2007', 2007, 134, 'The year 1642 marks the turning point in the life of the famous Dutch painter, Rembrandt, turning him from a wealthy respected celebrity into a discredited pauper. At the insistence of his pregnant wife Saskia, Rembrandt has reluctantly agreed to paint the Amsterdam Musketeer Militia in a group portrait that will later become to be known as The Nightwatch. He soon discovers that there is a conspiracy afoot with the Amsterdam merchants playing at soldiers maneuvering for financial advantage and personal power in, that time, the richest city in the Western World. Rembrandt stumbles on a foul murder. Confident in the birth of a longed-for son and heir, Rembrandt is determined to expose the conspiring murderers and builds his accusation meticulously in the form of the commissioned painting, uncovering the seamy and hypocritical side to Dutch Society in the Golden Age. Rembrandt\'s great good fortune turns. Saskia dies. Rembrandt reveals the accusation of murder in the painting and the ...', 'English', '2019-10-02 17:03:24'),
(82, 13795, 'tt7434324', 'Low Tide (2019)', 'low-tide-2019', 2019, 84, 'Alan, Red, and Smitty spend high summer on the Jersey Shore roving the boardwalk and getting into trouble. But the discovery of good old fashioned treasure sets the friends on an escalating course of suspicion and violence in this atmospheric thriller.', 'English', '2019-10-02 14:29:28'),
(83, 13794, 'tt6840554', '7 Days to Vegas (2019)', '7-days-to-vegas-2019', 2019, 92, 'Inspired by a true story about Hollywood big shots who will bet on anything.', 'English', '2019-10-02 12:13:18'),
(84, 13793, 'tt6736198', 'Ready to Mingle (2019)', 'ready-to-mingle-2019', 2019, 95, 'A wannabe bride seeks professional help to find a husband and, in the process, finds herself.', 'English', '2019-10-02 11:22:32'),
(85, 13792, 'tt8553606', 'Aurora (2019)', 'aurora-2019', 2019, 106, 'Aurora, a commitment-phobic party animal, meets Iranian Darian one night at a hot-dog stand in Lapland. Darian is running from death and Aurora is running from love. They need each other in order to finally stop running.', 'English', '2019-10-02 05:31:21'),
(86, 13791, 'tt7491968', '51 Nevada (2018)', '51-nevada-2018', 2018, 76, 'After witnessing a strange event, a young couple departs on a camping trip outside Area 51 hoping to find answers.', 'English', '2019-10-02 03:24:53'),
(87, 13790, 'tt0058335', 'Marriage Italian Style (1964)', 'marriage-italian-style-1964', 1964, 102, 'Domenico, a successfull businessman, with an eye for the girls, begins an affair with Filumena when she is 17 years old. She becomes a prostitute, but also becomes the mistress of Domenico. He eventually sets her up in an apartment, and she works for him in his various businesses. She secretly bears three children, who are raised by nannys. Domenico starts planning to marry a young employee. Filumena tricks him into marriage by pretending to be dying. Domenico annuls the marriage. Filumena then tells him of the three children. She says that one of the children belongs to Domenico, but will not say which one is his. You start to believe that all of the children could be his, and Domenico then marries Filumena again, this time willingly.', 'English', '2019-10-02 00:39:37'),
(88, 13788, 'tt9469842', 'Devil\'s Revenge (2019)', 'devils-revenge-2019', 2019, 0, '', 'English', '2019-10-02 02:33:27'),
(89, 13787, 'tt8176462', 'Be Happy! (2019)', 'be-happy-2019', 2019, 105, 'The MGMC presents a great show in London. Between the audience: Peter, a freudian psychiatrist married to a Finnish actor, Mika, David, a young British gay living in Banyoles, addicted to Grinder, and Coco Lamour, a Parisian French actress. Peter is a friend of Maria, also a Freudian psychiatrist, and Betsy, David\'s mother, living in CadaquÃ©s. Maria prepares a trip to spend some days with Betsy. David works at a computer company in Girona directed by a very talented young Indian, Usha. David has a great crisis with his partner, Daniel, a Mallorcan living in Barcelona. Albert is a famous British writer retired in Begur passing the mourning for the loss of his partner. Gilda, a great actress, half Scotish half German, lives in Mallorca and is very close to Joan LaÃ­nez and MGMC. At her house every day there\'s a great party. Everyone is worried about the ending of the love story of David and Daniel, the young guys. But, as Shakespeare says \"All\'s well that ends well\" on a trip of the ...', 'English', '2019-10-01 23:45:29'),
(90, 13784, 'tt6466058', 'Ask for Jane (2018)', 'ask-for-jane-2018', 2018, 108, 'BASED ON A TRUE STORY Chicago, 1969 - Imagine a world where abortion is punishable by prison, and getting birth control is nearly impossible. As a result, women die every day from taking matters into their own hands. When a pregnant student at the University of Chicago attempts to take her own life, Rose (Cait Cortelyou) and Janice (Cody Horn) find a doctor willing to perform the procedure in secret to save the woman\'s life. Sparked by this experience, Rose and Janice form the Jane Collective: a secret organization to help other women obtain safe and illegal abortions. Operating like a spy network, complete with blindfolds and code names, the Janes help thousands of women - but they can\'t hide from the police forever.', 'English', '2019-10-01 20:34:16'),
(91, 13785, 'tt8236848', 'Altered Skin (2018)', 'altered-skin-2018', 2018, 80, 'This is the story of Craig Evans, an American expat living in Karachi, Pakistan. Craig is married to Insiya Zia, a Pakistani doctor. During a routine hospital round, contracts a virus called the MN-2. A devastating pathogen, the virus causes uncontrollable outbursts of violent rage. With no cure in sight, the doctors have no choice but put Insiya in a state of induced coma. Meanwhile, the virus continues to spread through the country. People infected by it are referred to as \'carriers\'. The only relief is a drug called Sedare. It is manufactured by Ingenec - a local pharmaceutical company - and sold as an adhesive patch. It is so ubiquitous that in the market it is simply called the \'patch\'. However, it\'s not a cure. All it does is calm the symptoms for a few hours. The patch is also useless in advanced stages of the disease. As Insiya\'s condition continues to deteriorate, it appears Craig has accepted her impending death. But when the dead body of an investigative reporter turns up ...', 'English', '2019-10-01 22:26:08'),
(92, 13783, 'tt0233600', 'Tokyo Raiders (2000)', 'tokyo-raiders-2000', 2000, 0, 'Is anyone who he says he is in this caper that moves from Hong Kong and Las Vegas to Tokyo? Ken doesn\'t show up in Vegas for his wedding; his disconsolate bride, Macy, heads home for Hong Kong and finds John, an interior decorator, waiving a check of Ken\'s that has bounced. She leaves immediately for Tokyo to find her businessman boyfriend, and John tags along. Ken\'s flat is teeming with members of the Ito gang, who are also looking for Ken. John and Macy escape, with the help of a crew of look-alike cuties who work for Lin, who claims to be a private investigator. He too is looking for Ken. Where is Ken, why has he disappeared, and who will find him first?', 'English', '2019-10-01 19:44:29'),
(93, 13782, 'tt9204408', 'Kung Fu League (2018)', 'kung-fu-league-2018', 2018, 102, 'Fei Ying Xiong, an indigent comic book artist, is romantically interested in Bao\'er, but the head manager of their company, who also has a interest in Bao\'er, prevents that from happening. So, he summons four legendary Kung Fu masters to learn the highest level of martial arts and help him get his girl.', 'English', '2019-10-01 14:24:00'),
(94, 13781, 'tt7734218', 'Stuber (2019)', 'stuber-2019', 2019, 93, 'A mild-mannered Uber driver named Stu picks up a grizzled detective who is hot on the trail of a sadistic, bloodthirsty terrorist and finds himself thrust into a harrowing ordeal where he has to keep his wits, himself unharmed, and work with his passenger while maintaining his high-class rating.', 'English', '2019-10-01 11:54:44'),
(95, 13780, 'tt6863222', 'The True Don Quixote (2019)', 'the-true-don-quixote-2019', 2019, 84, 'Tim Blake Nelson (The Ballad of Buster Scruggs) is a man who\'s safe and comfortable and bored to death with his life. In his state of despair, he looks to classic stories for inspiration. Awakened by the tales of yore, he anoints himself as Don Quixote to find adventure, fame and glory that will make his life worthwhile - all while never leaving his one-mile square neighborhood.', 'English', '2019-10-01 10:04:01'),
(96, 13779, 'tt6112524', 'The Young Cannibals (2019)', 'the-young-cannibals-2019', 2019, 0, 'Seven friends summon a monster when they are tricked into eating burgers made of human flesh.', 'English', '2019-10-01 07:55:12');
INSERT INTO `imdbinfo` (`id`, `movie_id`, `imdb_code`, `title_long`, `slug`, `year`, `movie_runtime`, `description_full`, `language`, `date_uploaded`) VALUES
(97, 13778, 'tt8031130', 'Shadow Wolves (2019)', 'shadow-wolves-2019', 2019, 95, 'Colonel Branson (Thomas Gibson), head of a secret and covert division of the NSA, keeps the Shadow Wolves operating albeit now independent and rogue. His anger after his daughter was killed in Afghanistan training civilians drives him to defend \"his\" America and her borders by all means legal or otherwise. When ISIS terrorists begin to sneak across the US Border into Arizona, Branson alerts the Shadow Wolves to track and stop them. Branson sends Eric Shaw (Cody Walker), his most deadly and effective agent, to join up with the Shadow Wolves. The Wolves are led by Nabahe (Graham Greene), a Navajo honored military veteran, and an old colleague of Branson\'s. At the same time in London Lady Milton-Simon (Louise Lombard), head of an MI6 anti-terrorist division, sends out her elite agent, Major McLaren (Tom Hutch), to track a terrorist named Khan (Solomon Shiv) who has a personal vendetta against the US and the Shadow Wolves. Lady Milton and McLaren learn Khan is heading to Mexico to be ...', 'English', '2019-10-01 05:22:28'),
(98, 13777, 'tt8456696', 'Sister Aimee (2019)', 'sister-aimee-2019', 2019, 87, 'In 1926 America\'s most famous evangelist is a woman. And she\'s looking for a way out. Fed up with her own success, she gets swept up in her lover\'s daydreams about Mexico and finds herself on a wild road trip towards the border. Based on true events. Mostly made up.', 'English', '2019-10-01 02:57:49'),
(99, 13776, 'tt4699534', 'We Need to Talk (2016)', 'we-need-to-talk-2016', 2016, 91, 'Nuria is a young girl with a good life, a boyfriend to marry him and a parents who love her, but a problem: she still is married with Jorge. Former CEO, Jorge lives almost in the ruin together his ex boss and friend Lucas. After two years separated, Jorge doesn\'t forget her, but Nuria tries to ask him files for divorce when she wrongly discovers that Jorge has tried to commit suicide jumping by a window. Feeling responsible by it, Nuria talks with her parents Miguel and Patricia, according cheat Jorge for that he beliefs that they aren\'t divorced and Miguel didn\'t lose his company due to the Jorge\'s bad business inversions that ruined his parents-in-law, in order to get the divorce without pain for anybody. The real problem is what when the lies accumulate, the situation is each time more dangerously out of control.', 'English', '2019-10-01 00:53:26'),
(100, 13775, 'tt0189584', 'The Big Kahuna (1999)', 'the-big-kahuna-1999', 1999, 90, 'On the last evening of a convention two seen-it-all industrial lubricant salesmen and a youngster from the research department gather in the hotel\'s hospitality suite to host a delegates party. The main aim is to get the business of one particular big fish. When it becomes apparent that it is the lad who has developed a direct line to the guy, his strong religious beliefs bring him into sharp conflict with his older and more cynical colleagues.', 'English', '2019-10-01 02:43:07'),
(101, 13774, 'tt2998406', 'No Stranger Than Love (2015)', 'no-stranger-than-love-2015', 2015, 89, 'A young, pretty art teacher, Lucy (adored by every male in her small home town), attempts to embark on an affair with her co-worker, married high-school football coach, Clint. Before it can eventuate he is sucked into a bottomless, zero-gravity hole in her living room floor. One by one all town members come to inspect, theorize about and try to remove Clint from the hole, and in doing so learn about his disloyalty to his wife. The movie is a bit like Being John Malkovich in its metaphysical satire.', 'English', '2019-09-30 20:13:22'),
(102, 13773, 'tt7358936', 'My Perfect Romance (2018)', 'my-perfect-romance-2018', 2018, 91, 'Newly appointed CEO of Robinson Tech, Wes Robinson, is looking for new ideas to boost the company\'s sales. Vivian Blair, a program developer, shares a dating algorithm she has been working on called My Perfect Match. Wes sees potential and an opportunity to turn the company around and launches the service. When the pair is challenged to use My Perfect Match themselves to find love, this algorithm shows some interesting results.', 'English', '2019-10-01 00:02:38'),
(103, 13772, 'tt4459890', '100 Bullets (2016)', '100-bullets-2016', 2016, 80, 'Five years ago Frank Phoenix robbed The Firm. Betrayed by his own crew and murdered, the stolen gold was never found. Now someone is planning revenge.', 'English', '2019-09-30 21:40:37'),
(104, 13771, 'tt4644822', 'Electra Woman and Dyna Girl (2016)', 'electra-woman-and-dyna-girl-2016', 2016, 81, 'A reboot of the 1976 TV series with two of the most popular YouTube stars of today.', 'English', '2019-09-30 18:28:28'),
(105, 13770, 'tt5149490', 'Gwen (2018)', 'gwen-2018', 2018, 84, 'In the stark beauty of 19th Century Snowdonia a young girl tries desperately to hold her home together. Struggling with her mother\'s mysterious illness, her father\'s absence and a ruthless mining company encroaching on their land. A growing darkness begins to take grip of her home, and the suspicious local community turns on Gwen and her family.', 'English', '2019-09-30 16:20:00'),
(106, 13769, 'tt2847438', 'Der Bunker (2015)', 'der-bunker-2015', 2015, 85, 'A young student seeks quiet and solitude to focus on an important work but ends up as the teacher of a peculiar boy who is home-schooled by his parents in an isolated bunker mansion. THE BUNKER is a dark, twisted, and funny tale about childhood, growing up and education.', 'English', '2019-09-30 14:23:08'),
(107, 13768, 'tt0080539', 'City of Women (1980)', 'city-of-women-1980', 1980, 139, 'Marcello is in the compartment of an Italian train, facing forward when the mineral water of the woman seated across from him starts to fall toward him. He catches the bottle and makes eye contact and follows her when she leaves the compartment. For a few moments she finds him attractive too. Then suddenly she gets off the train and starts walking through a field. Marcello follows her, loses her, finds himself in a large hotel surrounded by women. A feminist conference is taking place and he tries to escape.', 'English', '2019-09-30 14:04:20'),
(108, 13767, 'tt2912120', 'The Young Kieslowski (2014)', 'the-young-kieslowski-2014', 2014, 94, 'Two nerdy Caltech students hook up and end up on a journey throughout California after they find out one is pregnant with the other\'s twins.', 'English', '2019-09-30 06:49:33'),
(109, 13766, 'tt4064912', 'Shine (2017)', 'shine-2017', 2017, 95, 'Two Puerto Rican brothers from New York\'s Spanish Harlem and the street\'s best Salsa dancers, are separated after a tragedy only to reunite years later on opposing sides of gentrification.', 'English', '2019-09-30 04:01:16'),
(110, 13765, 'tt1925421', 'Elena (2011)', 'elena-2011', 2011, 109, 'Elena and Vladimir are an older couple, they come from different backgrounds. Vladimir is a wealthy and cold man, Elena comes from a modest milieu and is a docile wife. They have met late in life and each one has children from previous marriages. Elena\'s son is unemployed, unable to support his own family and he is constantly asking Elena for money. Vladimir\'s daughter is a careless young woman who has a distant relationship with her father. A heart attack puts Vladimir in hospital, where he realizes that his remaining time is limited. A brief but somehow tender reunion with his daughter leads him to make an important decision: she will be the only heiress of his wealth. Back home he announces it to Elena. Her hopes to financially help her son suddenly vanish. The shy and submissive housewife then comes up with a plan to give her son and grandchildren a real chance in life.', 'English', '2019-09-30 01:04:09'),
(111, 13764, 'tt6268222', 'Making Noise Quietly (2019)', 'making-noise-quietly-2019', 2019, 95, 'MAKING NOISE QUIETLY is a delicate, witty and poetic triptych of stories that paint a human picture of the subtly devastating effects of war.', 'English', '2019-09-29 22:50:47'),
(112, 13763, 'tt0051790', 'Ivan the Terrible, Part II (1958)', 'ivan-the-terrible-part-ii-1958', 1958, 88, 'His wife dead from poisoning and his chief warrior, Kurbsky, defected to the Poles, Ivan is lonely as he pursues a unified Russia with no foreign occupiers. Needing friendship, he brings to court Kolychev, now Philip the monk, and makes him metropolitan bishop of Moscow. Philip, however, takes his cues from the boyars and tries to bend Ivan to the will of the church. Ivan faces down Philip and lets loose his private force, the Oprichniks, on the boyars. Led by the Tsar\'s aunt, Euphrosyne, the boyers plot to assassinate Ivan and enthrone her son, Vladimir. At a banquet, Ivan mockingly crowns Vladimir and sends him in royal robes into the cathedral where the assassin awaits.', 'English', '2019-09-29 23:34:38'),
(113, 13762, 'tt0037824', 'Ivan the Terrible, Part I (1944)', 'ivan-the-terrible-part-i-1944', 1944, 103, 'In 1547, Ivan IV (1530-1584), archduke of Moscow, crowns himself Tsar of Russia and sets about reclaiming lost Russian territory. In scenes of his coronation, his wedding to Anastasia, his campaign against the Tartars in Kazan, his illness when all think he will die, recovery, campaigns in the Baltic and Crimea, self-imposed exile in Alexandrov, and the petition of Muscovites that he return, his enemies among the boyars threaten his success. Chief among them are his aunt, who wants to advance the fortunes of her son, a simpleton, and Kurbsky, a warrior prince who wants both power and the hand of Anastasia. Ivan deftly plays to the people to consolidate his power.', 'English', '2019-09-29 21:05:43'),
(114, 13761, 'tt1032846', '4 Months, 3 Weeks and 2 Days (2007)', '4-months-3-weeks-and-2-days-2007', 2007, 113, 'Romania, 1987, the brutal Ceausescu communist regime is in place; birth control is illegal and abortion is a crime punishable by death. Gabita (Laura Vasliu) is almost five months into an unwanted pregnancy and in meek desperation turns to her friend and roommate, Otilia (Anamaria Marinca) for help in organizing an illegal termination. Unfortunate circumstances force the two women to use an unwanted male abortionist, Bebe (Vlad Ivanov). The bleakness of the storyline expresses a dark socio-political critique in the twilight years of a repressive dictatorship.', 'English', '2019-09-29 20:28:42'),
(115, 13760, 'tt0049259', 'Gervaise (1956)', 'gervaise-1956', 1956, 112, 'Gervaise Macquart, a young lame laundress, is left by her lover Auguste Lantier with two boys... She manages to make it, and a few years later she marries Coupeau, a roofer. After working very hard a few more years, she succeeds in buying her own laundry (her dream)... But Coupeau starts to drink after having fallen from a roof, and Lantier shows up... A faithful adaptation of Emile Zola\'s novel \"L\'Assomoir\", depicting the fatal degeneration of a family of workers, mainly because of alcohol.', 'English', '2019-09-29 17:53:58'),
(116, 13759, 'tt0140888', 'Central Station (1998)', 'central-station-1998', 1998, 113, 'Dora, a dour old woman, works at a Rio de Janeiro central station, writing letters for customers and mailing them. She hates customers and calls them \'trash\'. Josue is a 9-year-old boy who never met his father. His mother is sending letters to his father through Dora. When she dies in a car accident, Dora takes Josue and takes a trip with him to find his father.', 'English', '2019-09-29 16:35:17'),
(117, 13758, 'tt8725958', 'Hotel by the River (2018)', 'hotel-by-the-river-2018', 2018, 96, 'It is the dead of winter and a poet invites his sons to join him at a hotel for a reunion. The hotel also hosts a newly single woman who has a friend keep her company and with whom she shares a room, strolls and conversations. The poet is drawn to the beautiful girls and cannot resist the temptation to discover more. Their lives intersect, connect and disconnect and potentially become a metaphor for modern life.', 'English', '2019-09-29 14:55:22'),
(118, 13757, 'tt0106748', 'Donato and Daughter (1993)', 'donato-and-daughter-1993', 1993, 90, 'Two cops, a father and daughter who have had a frosty relationship for a long time, must team up to stop a brutal sexual predator/serial killer who targets nuns.', 'English', '2019-09-29 08:30:59'),
(119, 13756, 'tt0465670', 'Wilderness (2006)', 'wilderness-2006', 2006, 93, 'In a juvenile detention center, inmate Dave commits suicide after being abused with his friend Lindsay by sociopaths Steve and Lewis under the indifference of the other cellmates. The governor sends them to an uninhabited island to improve their relationships and characters under the command of tough monitor Jed. They meet a camp of female delinquents under the command of veteran soldier Louise and they camp in another area. However, when they are attacked by a pack of dogs and a mysterious man with a crossbow wearing camouflage, they join forces fighting to survive, under the leadership of Callum.', 'English', '2019-09-29 05:51:20'),
(120, 13755, 'tt0036872', 'Going My Way (1944)', 'going-my-way-1944', 1944, 126, 'Youthful Father Chuck O\'Malley led a colorful life of sports, song, and romance before joining the Roman Catholic clergy, but his level gaze and twinkling eyes make it clear that he knows he made the right choice. After joining a parish, O\'Malley\'s worldly knowledge helps him connect with a gang of kids looking for direction and handle the business details of the church-building fund, winning over his aging, conventional superior, Father Fitzgibbon.', 'English', '2019-09-29 02:45:55'),
(121, 13754, 'tt4902904', 'The Resurrection of Gavin Stone (2016)', 'the-resurrection-of-gavin-stone-2016', 2016, 91, 'A washed-up former child star, forced to do community service at a local megachurch, pretends to be a Christian to land the part of Jesus in their annual Passion Play, only to discover that the most important role of his life is far from Hollywood.', 'English', '2019-09-28 21:41:54'),
(122, 13753, 'tt0434139', 'The Last Kiss (2006)', 'the-last-kiss-2006', 2006, 115, 'Michael and Jenna, having been a couple for three years, want to get married and start a family. These plans seem to be well on their way when Jenna announces that she\'s pregnant. But Michael is worried that his life and his youth will be over for good. At a wedding of a friend, he meets a free-spirited college co-ed, Kim, who opens his eyes and leads him on a dangerous path away from Jenna. Meanwhile, none of the relationships of the people surrounding Michael and Jenna are happy and stable. Michael\'s friend Izzy is unwilling to let go of his childhood sweetheart Arianna; Kenny is a handsome stud who fears commitment to his latest conquest Danielle; and Chris is a co-worker who is dominated by his neurotic and overbearing wife over raising their newborn son. Even Jenna\'s parents, Stephen and Anna, are experiencing problems in their long-suffering marriage.', 'English', '2019-09-29 07:47:32'),
(123, 13752, 'tt0396032', 'Getting Played (2006)', 'getting-played-2006', 2006, 84, 'Three beautiful women (Electra, Dash, and Fox) who have had their share of men trouble enter into a game of fun in which they choose a random guy and film each other seducing him so as to use the footage later to humiliate him. But problems arise when the random man is in on the joke.', 'English', '2019-09-29 05:01:22'),
(124, 13751, 'tt2368749', 'After Lucia (2012)', 'after-lucia-2012', 2012, 103, 'With the loss of a beloved mother and wife still fresh and raw in their memory, the dejected Roberto and his teenage daughter, Alejandra, flee the coastal Puerto Vallarta to start anew in bustling Mexico City. But, there--even though Roberto has already a job as a chef lined up for him, and Alejandra seems to have no trouble fitting in at her new school--unforeseen problems lead both to a tense situation which will, inevitably, spiral out of control. In the end, life is full of fresh beginnings; however, on the other hand, making a life change can be very intimidating, especially when you have lost everything.', 'English', '2019-09-29 02:10:36'),
(125, 13750, 'tt4847454', 'The Curse of Buckout Road (2017)', 'the-curse-of-buckout-road-2017', 2017, 97, 'Aaron Powell returns home from the Naval Postgraduate School to his grandfather, a brilliant psychiatrist Lawrence. Dr. Powell and his colleague detective Roy Harris are investigating a recent suicide of a college professor Stephanie Hancock, who suffered of nightmares involved the infamous urban legends of Buckout Road. While they think she was mentally unstable, Mrs. Hancock\'s student Cleo Harris starts to show the same symptoms as she was working on an assignment about Buckout Road urban myth. Cleo and Aaron realizes that they have to solve the mystery of how to stop the evil before it takes their souls as well.', 'English', '2019-09-28 23:34:57'),
(126, 13749, 'tt9465588', 'Father\'s Day (2019)', 'fathers-day-2019', 2019, 70, 'Father\'s Day is approaching and sea creatures everywhere are competing for the top prize in the annual Deep Sea Burp Contest. Navigating their way through an awesome ocean adventure, they discover that love is the best prize of all!', 'English', '2019-09-28 17:52:06'),
(127, 13748, 'tt0084783', 'Tex (1982)', 'tex-1982', 1982, 103, 'After their mother dies and their father leaves them, teenage brothers Tex and Mason McCormick struggle to make it on their own.', 'English', '2019-09-28 10:03:49'),
(128, 13747, 'tt1790834', 'Simon Killer (2012)', 'simon-killer-2012', 2012, 101, 'Recently heartbroken, Simon travels to Paris to clear his head. After several days of wandering aimlessly, Simon finds himself drawn into a sex parlor and has a sexual encounter with an exotic prostitute, Victoria. The chemistry builds between the two until they find themselves in a serious relationship, one that leads to blackmail, betrayal and the ultimate revelation of Simon\'s true nature.', 'English', '2019-09-28 07:21:05'),
(129, 13746, 'tt0112438', 'The Babysitter (1995)', 'the-babysitter-1995', 1995, 90, 'A teenage girl babysits two young kids while the parents go out to a party. Her boyfriend is coerced (with the help of alcohol) by an old \'friend\' into going to the house. Both boys are obsessed with the babysitter, as is the father of the two children. The story basically shows the effects drink has on different people.', 'English', '2019-09-28 04:31:05'),
(130, 13745, 'tt5335682', 'Rum 213 (2017)', 'rum-213-2017', 2017, 80, 'When twelve-year-old Elvira goes to summer camp strange things start to happen in her room. Things that can not be explained - unless you believe in ghosts.', 'English', '2019-09-28 04:37:44'),
(131, 13744, 'tt6523440', 'Mixed Doubles (2017)', 'mixed-doubles-2017', 2017, 120, 'Tamiko used to be a very good ping pong player as a child, but she is now twenty-eight years old and left the sport behind. Her mother Hanako had taught her how to play imposing discipline and regimen, but following the former\'s death the daughter had felt free by quitting the sport and instead leading an ordinary life. One of her co-workers Akihiko asks her to go steady one day, but soon sleeps with a pretty co-worker called Airi. Having lost her chance with this man she quits her job and returns to her hometown. Here her mother once owned a ping pong club. At the same time, the man she lost has joined the company\'s ping pong club prompting her to want to beat him. She begins to practice again.', 'English', '2019-09-28 01:19:28'),
(132, 13743, 'tt8858420', 'Women of Mafia 2 (2019)', 'women-of-mafia-2-2019', 2019, 138, 'After taking control of the capital, Nanny\'s gang prepares for the biggest smuggling action in the history of Poland.', 'English', '2019-09-27 21:25:44'),
(133, 13742, 'tt2118775', 'Special ID (2013)', 'special-id-2013', 2013, 99, 'Chan Chi-Lung has been an infiltrator in Cheung Mo-Hung\'s Hong Kong triad gang for many years. After a failure of a recent negotiation by Lung with the other three local triad gangs on behalf of Hung makes the latter suspicious of Lung\'s identity. Hung sets to wipe out every undercover cop in his gang and as a result many cops are caught and wiped out. Sensing the danger, Lung requests to put an end to his undercover career from his captain, Cheung. However, Cheung sends Lung to Mainland China to infiltrate a business of \"Special Identity\" trading instead. The business is run by Hung\'s best protÃ©gÃ©, Sunny, who was Lung\'s previous buddy in the gang. Cheung promises to reinstate Lung\'s police identity in conclusion of the mission once Sunny\'s business breaks down. Lung agrees, and joining him are local police officer Fang Jing and her chief Lei Peng from the Mainland Chinese police force. But before they can get to Sunny, the latter suddenly vanishes leaving Lung exposed and in great ...', 'English', '2019-09-27 18:09:11'),
(134, 13741, 'tt0077530', 'Eyes of Laura Mars (1978)', 'eyes-of-laura-mars-1978', 1978, 104, 'Suddenly Laura Mars can see through the eyes of a serial killer as he commits his crimes. She contacts the police and with the aid of a police detective, tries to stop the killer. But first, they have to figure out who it is.', 'English', '2019-09-27 12:43:51'),
(135, 13740, 'tt0116277', 'The Fan (1996)', 'the-fan-1996', 1996, 116, 'Three-times MVP baseball player Bobby Rayburn joins the San Francisco Giants, and obsessive fan, whose profession is selling hunting knives, Gil Renard is excited over that. But Rayburn plays the worst season of his career and Renard tries to do everything to help him, but goes too far.', 'English', '2019-09-27 14:43:02'),
(136, 13739, 'tt8255490', 'Surviving Christmas with the Relatives (2018)', 'surviving-christmas-with-the-relatives-2018', 2018, 101, 'Two sisters and their families come together in their recently deceased parents\' falling down country house, with chaotic consequences. Miranda (Gemma Whelan) and Dan (Julian Ovenden) are refugees from city life trying to set up a small holding with their kids in tow, and Lyla (Joely Richardson) is a fading Hollywood star married to her alcoholic agent, Trent (Michael Landes). Ancient sibling rivalries flare up again to sabotage the hope for a season of good will.', 'English', '2019-09-27 11:23:50'),
(137, 13738, 'tt7078658', 'The Day Shall Come (2019)', 'the-day-shall-come-2019', 2019, 87, 'An impoverished preacher who brings hope to the Miami projects is offered cash to save his family from eviction. He has no idea his sponsor works for the FBI who plan to turn him into a criminal by fueling his madcap revolutionary dreams.', 'English', '2019-09-27 06:55:25'),
(138, 13737, 'tt8110640', 'In the Shadow of the Moon (2019)', 'in-the-shadow-of-the-moon-2019', 2019, 115, 'In 1988, Philadelphia police officer Thomas Lockhart (Boyd Holbrook), hungry to become a detective, begins tracking a serial killer who mysteriously resurfaces every nine years. But when the killer\'s crimes begin to defy all scientific explanation, Locke\'s obsession with finding the truth threatens to destroy his career, his family, and possibly his sanity.', 'English', '2019-09-27 09:51:53'),
(139, 13736, 'tt9026524', 'Bliss (2019)', 'bliss-2019', 2019, 80, 'A brilliant painter facing the worst creative block of her life turns to anything she can to complete her masterpiece, spiraling into a hallucinatory hellscape of drugs, sex, and murder in the sleazy underbelly of Los Angeles.', 'English', '2019-09-27 04:25:58'),
(140, 13735, 'tt6023242', 'Obsession (2019)', 'obsession-2019', 2019, 90, 'Before meeting George Good (Brad Dourif), Sonny Jordan (Mekhi Pfeiffer) was just a lost drifter with a troubled past floating from town to town, looking for work. As fate would have it, Sonny ends up saving George\'s life from a murderous back-alley mugger. As thanks, George gives Sonny a home and a job as a mechanic on his farm in the lonely Louisiana Bayou. Sonny quickly settles in and makes himself useful around the place but then Sonny meets Larissa, (Elika Portnoy) George\'s alluring wife. She has a mysterious past and the two are irresistibly drawn to each other. The two begin a passionate affair leading them to construct a twisted plot to take George\'s life in cold blood in order to be together. As their despicable plan unravels, they learn how far they are willing to go to cover their misdeed.', 'English', '2019-09-27 07:32:46'),
(141, 13734, 'tt8809652', '10 Minutes Gone (2019)', '10-minutes-gone-2019', 2019, 89, 'A crime thriller that centers on a man whose memory has been lost due to a bank heist gone wrong. The character will need to piece together the missing 10 minutes from his memory in order to determine who sabotaged him.', 'English', '2019-09-27 05:05:18'),
(142, 13733, 'tt0070217', 'The Illumination (1973)', 'the-illumination-1973', 1973, 91, 'Tabloid life of a physicist; his work, his love life and his quest for the meaning beyond.', 'English', '2019-09-27 02:21:37'),
(143, 13732, 'tt5699928', 'Prey (2019)', 'prey-2019', 2019, 85, 'Toby (Logan Miller) must survive an island retreat while a sinister force hunts him, leaving bodies in its wake.', 'English', '2019-09-27 02:06:38'),
(144, 13731, 'tt6063024', 'Meatball Machine Kodoku (2017)', 'meatball-machine-kodoku-2017', 2017, 100, 'A long-awaited sequel to the internationally acclaimed full-throttle splatter sci-fi action horror \"Meatball Machine\".', 'English', '2019-09-26 22:06:31'),
(145, 13730, 'tt5269396', 'Sword Master (2016)', 'sword-master-2016', 2016, 108, 'Hong Kong cinema giants Derek Yee (TRIPLE TAP) and Tsui Hark (YOUNG DETECTIVE DEE) join forces in this spellbinding martial arts epic about an elite swordsman who is haunted by his deadly skills, and the challenger who aims to take his place at any cost.', 'English', '2019-09-26 19:25:18'),
(146, 13729, 'tt6806448', 'Fast & Furious Presents: Hobbs & Shaw (2019)', 'fast-furious-presents-hobbs-shaw-2019', 2019, 137, 'Lawman Luke Hobbs and outcast Deckard Shaw form an unlikely alliance when a cyber-genetically enhanced villain threatens the future of humanity.', 'English', '2019-09-26 19:10:15'),
(147, 13728, 'tt0076929', 'Wizards (1977)', 'wizards-1977', 1977, 0, 'In a post apocalyptic future that appears as a blend of World War II Europe and J.R.R. Tolkien\'s Middle-earth, a pint-size wizard named Avatar must save the world from a band of fascist mutants controlled by his evil twin brother, Blackwolf, who likes to confuse enemy armies by projecting films of Adolf Hitler speeches during attacks. Painted live-action footage of advancing Nazi armies contrasts with Saturday-morning-cartoon-style animation of fairies and elves as Avatar travels through various magical and radioactive realms on his quest. Aiding him are the beautiful Fairy princess Elinore, hot-blooded warrior elf Weehawk, and Peace, a misunderstood robot rebelling against his Blackwolf-controlled programming. A bizarre and psychedelic meditation on magic vs. technology, this ultimate futuristic fantastic epic cult film still finds an audience on college campuses and will prove quite rewarding to viewers in the right frame of mind.', 'English', '2019-09-26 13:39:21'),
(148, 13727, 'tt6964076', 'Pavarotti (2019)', 'pavarotti-2019', 2019, 114, 'A look at the life and work of opera legend, Luciano Pavarotti.', 'English', '2019-09-26 10:37:35'),
(149, 13726, 'tt0084370', 'My Favorite Year (1982)', 'my-favorite-year-1982', 1982, 92, 'Benjy Stone is the junior writer on the top rated variety/comedy show, in the mid 50s (the early years). Its a new medium and the rules were not fully established. Alan Swann, an Erol Flynn type actor with a drinking problem is to be that weeks guest star. When King Kaiser, the headliner wants to throw Swann off the show, Benjy makes a pitch to save his childhood hero, and is made Swann\'s babysitter. On top of this, a union boss doesn\'t care for Kaiser\'s parody of him and has plans to stop the show.', 'English', '2019-09-26 07:29:30'),
(150, 13725, 'tt1979376', 'Toy Story 4 (2019)', 'toy-story-4-2019', 2019, 100, 'Woody, Buzz Lightyear and the rest of the gang embark on a road trip with Bonnie and a new toy named Forky. The adventurous journey turns into an unexpected reunion as Woody\'s slight detour leads him to his long-lost friend Bo Peep. As Woody and Bo discuss the old days, they soon start to realize that they\'re two worlds apart when it comes to what they want from life as a toy.', 'English', '2019-09-26 04:39:33'),
(151, 13724, 'tt4442130', 'Wild Horses (2015)', 'wild-horses-2015', 2015, 100, 'A detective opens up a fifteen-year-old missing persons case, and begins to suspect that the missing boy was murdered, and that a local rancher was involved.', 'English', '2019-09-26 04:35:54'),
(152, 13723, 'tt0086192', 'Revenge of the Ninja (1983)', 'revenge-of-the-ninja-1983', 1983, 90, 'After his family is killed in Japan by ninjas, Cho and his son Kane come to America to start a new life. He opens a doll shop but is unwittingly importing heroin in the dolls. When he finds out that his friend has betrayed him, Cho must prepare for the ultimate battle he has ever been involved in.', 'English', '2019-09-25 23:20:56'),
(153, 13722, 'tt0055152', 'Master of the World (1961)', 'master-of-the-world-1961', 1961, 102, 'The world in the late 19th century: A scientist and his team are held as \"guests\" of Robur on his airship, that he want to use to ensure peace on earth. Peace with all, even if he has to bombard military targets all over the world. Can the scientist stop him ?', 'English', '2019-09-25 22:20:33'),
(154, 13721, 'tt2978576', 'Bill (2015)', 'bill-2015', 2015, 94, 'A down on his luck William \"Bill\" Shakespeare decides to pursue his latest dream: to be an aspiring writer. His adventure soon becomes dangerous when he is caught between a act of murder.', 'English', '2019-09-25 20:37:54'),
(155, 13720, 'tt0048640', 'Soldier of Fortune (1955)', 'soldier-of-fortune-1955', 1955, 0, '', 'English', '2019-09-25 19:48:29'),
(156, 13719, 'tt7790894', 'Dark, Almost Night (2019)', 'dark-almost-night-2019', 2019, 0, 'Reporter Alicja Tabor returns to Walbrzych, the city of her childhood. There she will go back to all her hardcore family secret dramas, and start investigating a sinister case related to the disappearance of children.', 'English', '2019-09-25 11:41:19'),
(157, 13718, 'tt0235751', 'Seeds (1968)', 'seeds-1968', 1968, 84, 'Claris Manning is an alcoholic invalid who tyrannizes her children when her youngest daughter, Carol, invites her family to spend a Christmas week together. They include Matthew, a crackpot clergyman; Michael, a misogynist businessman whom is sexually attracted to Carol, but abusive to his wife Susan; Margaret, the eldest daughter, whom is currently dating a local tough named Jonathan; and Buster, the youngest son from a military school whom brings over his gay lover Drew. Meanwhile, the two live-in servants, Peter and Jessica, plot to kill Mrs. Manning to gain her money for themselves. But an unseen killer soon begins killing off all the characters present for their debauched lifestyles they have led to since leaving the household.', 'English', '2019-09-25 17:36:01'),
(158, 13717, 'tt6980962', 'An Audience of Chairs (2018)', 'an-audience-of-chairs-2018', 2018, 93, 'AN AUDIENCE OF CHAIRS Maura Mackenzie (Carolina Bartczak) believes the world is hers to conquer. With her career as a concert pianist gaining momentum, it seems her beauty and talent will be strong enough to mask the demons that threaten to engulf her. But with an absent husband (Chris Jacot) and two young daughters at home, her precarious sanity begins to unravel until one summer day, burning with manic energy, she makes a terrible mistake - a mistake that will change her life forever. The consequences for Maura are catastrophic: her ambitious husband runs for his life, taking the children with him, leaving Maura to lapse into a full-scale breakdown. Life as she knew it is now over. With the help of her father, Ian (Peter MacNeill), Maura works to reclaim her life and waits for a miracle to bring her daughters home. But when the fates align, can the past be forgiven? Directed by award-winning filmmaker Deanne Foley (Relative Happiness), this universal story of the redemptive power of...', 'English', '2019-09-25 06:08:37'),
(159, 13716, 'tt0269856', 'Ritual (2000)', 'ritual-2000', 2000, 128, 'A disillusioned filmmaker has an encounter with a young girl who has a ritual of repeating \"Tomorrow is my birthday\" everyday. He tries to communicate with her through his video camera', 'English', '2019-09-25 03:03:35'),
(160, 13715, 'tt0110939', 'Radioland Murders (1994)', 'radioland-murders-1994', 1994, 108, 'In 1939, WBN, a fourth radio network, is about to take to America\'s airwaves. As if the confusion of the premiere night wasn\'t enough, Penny Henderson, the owner\'s secretary, must deal with an unhappy sponsor, an overbearing boss and a soon-to-be ex-husband who desperately wants her back. As the broadcast begins, a mysterious voice breaks the broadcast and suddenly members of the cast turn up dead. It\'s up to her husband Roger, to find out whodunit as the police chase him through the halls of WBN.', 'English', '2019-09-25 15:15:09'),
(161, 13714, 'tt0118117', 'The War at Home (1996)', 'the-war-at-home-1996', 1996, 123, 'Jeremy Collier is a Vietnam veteran who has returned home and is struggling to cope with the war experiences that haunt him. He is also at odds with his family, who cannot begin to understand what he has been through. Jeremy\'s battles with his family finally spiral out of control on Thanksgiving Day, when a bitter secret is revealed.', 'English', '2019-09-25 12:17:01'),
(162, 13713, 'tt7987702', '3 Bears Christmas (2019)', '3-bears-christmas-2019', 2019, 84, 'Baby Bear sneaks out on Christmas morning to find the perfect gift for his parents Mama and Papa Bear only to cross paths with a wicked witch who transforms him into a human.', 'English', '2019-09-25 09:58:55'),
(163, 13712, 'tt8772262', 'Midsommar (2019)', 'midsommar-2019', 2019, 147, 'Dani (Florence Pugh) and Christian (Jack Reynor) are a young American couple with a relationship on the brink of falling apart. But after a family tragedy keeps them together, a grieving Dani invites herself to join Christian and his friends on a trip to a once-in-a-lifetime midsummer festival in a remote Swedish village. What begins as a carefree summer holiday in a land of eternal sunlight takes a sinister turn when the insular villagers invite their guests to partake in festivities that render the pastoral paradise increasingly unnerving and viscerally disturbing.', 'English', '2019-09-25 07:04:03'),
(164, 13711, 'tt8364368', 'Crawl (2019)', 'crawl-2019', 2019, 87, 'Against all logic, the competitive swimmer, Haley, drives into the mouth of a furiously destructive Category 5 hurricane on a collision course with her hometown of Florida, to check in on her estranged father, Dave. There, in their weather-beaten house amid a rapidly sinking and alligator-infested town, Haley and her father find themselves trapped in the labyrinthine mess of their flooded crawl space, where a merciless pair of six-metre predators is silently stalking them. Now--as Haley and Dave are gasping for air in the claustrophobic basement--only their will to survive can help them stand a chance against the scaly adversaries\' powerful jaws. Can they escape without getting eaten alive?', 'English', '2019-09-25 04:30:09'),
(165, 13710, 'tt8418126', 'Lie Low (2019)', 'lie-low-2019', 2019, 98, 'Lie Low follows a young man who, after witnessing a stabbing, escapes to the French countryside with his family. Whilst confronting demons of the past, demons of the present threaten to catch up to his family with tragic consequences.', 'English', '2019-09-25 02:10:07'),
(166, 13709, 'tt6827388', 'The Field (2019)', 'the-field-2019', 2019, 92, 'A long-empty farmstead holds secret worlds, accidentally unlocked by an amateur photographer and his wife.', 'English', '2019-09-25 00:24:46'),
(167, 13708, 'tt8328716', 'Doom: Annihilation (2019)', 'doom-annihilation-2019', 2019, 96, 'Follows a group of UAC Marines as they respond to a distress call from a top secret scientific base on Phobos, a Martian moon, only to discover it\'s been overrun by demons who threaten to create Hell on Earth.', 'English', '2019-09-23 23:25:44'),
(168, 13707, 'tt0035019', 'The Major and the Minor (1942)', 'the-major-and-the-minor-1942', 1942, 100, 'New York working girl Susan Applegate is desperate to go home to Iowa but does not have the railway fare so she disguises herself as a child to ride half fare. Enroute she meets Philip Kirby, an Army major teaching at a military school.', 'English', '2019-09-24 23:36:12'),
(169, 13706, 'tt0099939', 'King of New York (1990)', 'king-of-new-york-1990', 1990, 103, 'After completing a lengthy prison sentence, one-time drug kingpin Frank White returns to New York intent on reestablishing his empire and making things as they were before he left. Others of course have taken over the business during his absence but that clearly isn\'t going to stop White. While he is gunning down the opposition, he decides he\'s going to give away the money he\'ll make to modernize the hospital in his old neighborhood. Drug dealers aren\'t the only thing he has to worry about however: a group of rogue cops decide they are going to take him down.', 'English', '2019-09-24 21:07:50'),
(170, 13705, 'tt0997152', 'The Experiment (2010)', 'the-experiment-2010', 2010, 96, '26 men are chosen to participate in the roles of guards and prisoners in a psychological study that ultimately spirals out of control.', 'English', '2019-09-24 17:14:56'),
(171, 13704, 'tt4019346', 'Brutal (2018)', 'brutal-2018', 2018, 67, 'Following a rampage of extreme prejudice, a savage killer targets women as he tries to find a compatible one to engage his fantasies of torture and murder in. With the body count mounting and no one being able to stop him, he grows bolder and goes to more extreme measures to carry out his rampage, eventually catching the eye of a female serial killer who\'s just as sadistic as he is, forcing them into a deadly and dangerous showdown.', 'English', '2019-09-24 14:40:35'),
(172, 13703, 'tt0081975', 'Absolution (1978)', 'absolution-1978', 1978, 95, 'At a Catholic public school, Benjamin Stanfield is tired of being the teacher\'s pet and decides to play a practical joke on his form master Father Goddard. In confession, Stanfield tells Goddard that he has accidentally murdered his friend Blakey and buried him in the forest. When Goddard investigates the matter, he finds a buried scarecrow. Goddard is outraged, but, due to the seal of confession, he knows he cannot expel Stanfield. Shortly after, Stanfield once again enters the confession booth, telling Goddard that what before was a practical joke, he has now made happen. In disbelief, Goddard once again goes to the forest to investigate the matter. This time, he discovers Blakey\'s dead body. The plot soon thickens as Stanfield\'s fellow student Arthur Dyson mysteriously disappears...', 'English', '2019-09-24 11:56:32'),
(173, 13702, 'tt0032701', 'The Letter (1940)', 'the-letter-1940', 1940, 95, 'The wife of a rubber plantation administrator shoots a man to death and claims it was self-defense. Her poise, graciousness and stoicism impress nearly everyone who meets her. Her husband is certainly without doubt; so is the district officer; while her lawyer\'s doubts may be a natural skepticism. But this is Singapore and the resentful natives will have no compunction about undermining this accused murderess. A letter in her hand turns up and may prove her undoing.', 'English', '2019-09-24 18:26:40'),
(174, 13701, 'tt3901256', 'KILD TV (2016)', 'kild-tv-2016', 2016, 87, 'The crew of a local horror movie showcase is use to broadcasting creepy stories of heinous killers, but tonight they are the story, trapped with a real killer among them.', 'English', '2019-09-24 15:58:42'),
(175, 13700, 'tt0067500', 'Tombs of the Blind Dead (1972)', 'tombs-of-the-blind-dead-1972', 1972, 101, 'In the 13th century there existed a legion of evil knights known as the Templars, who quested for eternal life by drinking human blood and committing sacrifices. Executed for their unholy deeds, the Templars bodies were left out for the crows to peck out their eyes. Now, in modern day Portugal, a group of people stumble on the Templars abandoned monastery, reviving their rotting corpses to terrorize the land.', 'English', '2019-09-24 13:15:57'),
(176, 13698, 'tt6185026', 'The Baylock Residence (2019)', 'the-baylock-residence-2019', 2019, 90, 'Patricia Woodhouse has been estranged from her sister for quite a few years due to a family feud. Suddenly she receives a letter detailing the sudden death of her sister Susanna Baylock, Patricia returns to pay her respect where she meets Annabel Blair (Susanna\'s help). Annabel informs Patricia that she has now inherited the Baylock residence, but something isn\'t right with this house it\'s harbouring a very old secret, one which Patricia needs to learn before it\'s too late.', 'English', '2019-09-24 10:37:37'),
(177, 13697, 'tt0444672', 'Moving McAllister (2007)', 'moving-mcallister-2007', 2007, 0, 'Rick Robinson is a ladder-climbing law intern from Miami with four days until the Bar Exam. Desperate to score points with his boss (McAllister), he commits to a favor he can\'t afford. He ends up in a rundown truck headed to L.A. with his boss\'s possessions, his Hollywood-bound niece, and her pet pig. Amidst hitch-hikers, breakdowns, and assorted local yokels, Rick finds love, life and maybe himself in this trans-American road trip from hell.', 'English', '2019-09-24 08:10:17'),
(178, 13696, 'tt6184194', 'Monky (2017)', 'monky-2017', 2017, 86, 'A little monkey with a big secret.', 'English', '2019-09-24 05:39:06'),
(179, 13695, 'tt1436045', '13 Assassins (2010)', '13-assassins-2010', 2010, 141, 'In 1844, the peace of Feudal Japan is threatened by cruel Lord Naritsugu Matsudaira, who is politically rising and getting closer to his half-brother, the shogun. After the harakiri of the Namiya clan leader, samurai Shinzaemon Shimada is summoned by the shogun\'s advisor Sir Doi of the Akashi Clan to listen to the tragedy of Makino Uneme, whose son and daughter-in-law have been murdered by Naritsugu. Then Sir Doi shows a woman with arms, legs and tongue severed by Naritsugu and she writes with her forearm a request to Shinza to slaughter Naritsugu and his samurai. Shinza promises to kill Naritsugu and he gathers eleven other samurais and plots a plan to attack Naritsugu in his trip back to the Akashi land. But the cunning samurai Hanbei Kitou that is responsible for the security of his master foresees Shinza\'s intent. Shinza decides to go with his samurai through the mountain, where they find the hunter Koyata that guides them off the mountain and joins the group. Now the thirteen men...', 'English', '2019-09-24 02:28:25'),
(180, 13694, 'tt0059530', 'Hands of a Gunfighter (1965)', 'hands-of-a-gunfighter-1965', 1965, 88, 'A reformed gunman returns to his earlier life seeking justice when the Castle brothers shoot his friends.', 'English', '2019-09-23 21:15:09'),
(181, 13693, 'tt0094739', 'Big Business (1988)', 'big-business-1988', 1988, 97, 'In the 1940s in the small town of Jupiter Hollow, two sets of identical twins are born in the same hospital on the same night. One set to a poor local family and the other to a rich family just passing through. The dizzy nurse on duty accidentally mixes the twins unbeknown to the parents. Our story flashes forward to the 1980s where the mismatched sets of twins are about to cross paths following a big business deal to closedown the Jupiter Hollow factory.', 'English', '2019-09-23 18:46:29'),
(182, 13692, 'tt0063465', 'Project X (1968)', 'project-x-1968', 1968, 97, 'A spy is brought back from cryogenic suspension after being almost killed in a plane crash returning from a mission to learn about a deadly new weapon being developed in the East. But the vital memories are being suppressed, so the authorities use ultra-advanced technologies to try to uncover the secret.', 'English', '2019-09-24 00:59:02'),
(183, 13691, 'tt7331424', 'Bare Knuckle Brawler (2019)', 'bare-knuckle-brawler-2019', 2019, 93, 'When cop Steve returns home in the midst of his brother Joey\'s investigation into the murder of two bare knuckle fighters, the case becomes personal when Joey is found brutally murdered. With a sense of justice and revenge Steve knows what he has to do. Enter the underground world of Bare Knuckle Brawling; run by the brutal Mereta Crime family where there is only one rule. There are no rules!', 'English', '2019-09-23 21:46:47'),
(184, 13690, 'tt0168972', 'Love & Pop (1998)', 'love-pop-1998', 1998, 110, 'It is the \'90s and the tradition of \'compensated dating\' is well underway in Japan. Four high school girls are engaged in enjo kosai in order to satisfy their desire for different things. You can usually find them in Shibuya district of Tokyo where they will give you their time, and sometimes more, in exchange for money that buys pretty things.', 'English', '2019-09-23 16:52:57'),
(185, 13689, 'tt6489160', 'Harvie and the Magic Museum (2017)', 'harvie-and-the-magic-museum-2017', 2017, 86, 'Harvie is a smart but a bit too lively boy with one ambition, to finish the last level of his computer game. Once in the Gamers Hall of Fame, his absent-minded father, would finally be proud of him. But finishing the game turns out to be only the start of a real adventure that takes Harvie, his dog Jerry, and his friend Monica deep into the forgotten realms of the city\'s old puppet museum.', 'English', '2019-09-23 14:06:40'),
(186, 13688, 'tt5342950', 'The Wolf Hour (2019)', 'the-wolf-hour-2019', 2019, 99, 'June was once a known counter-culture figure, but that was a decade ago. She now lives alone in her South Bronx apartment, having all but cut herself off from the outside world. It\'s the notorious \"Summer of Sam\" and June only has to look out of her window to see the violence escalating with the brutal summer heat. The city is on a knife\'s edge, a pressure-cooker about to explode into the incendiary 1977 New York blackout riots.', 'English', '2019-09-23 11:48:30'),
(187, 13687, 'tt0075164', 'Satan\'s Slave (1976)', 'satans-slave-1976', 1976, 86, 'A young girl is caught up in a devil cult run by her evil uncle and cousin. She can trust no one and even people she thought were dead comes back to haunt her.', 'English', '2019-09-23 12:52:55'),
(188, 13686, 'tt0110631', 'Nightwatch (1994)', 'nightwatch-1994', 1994, 107, 'In order to finance his law studies, Martin starts as a night watchman in a mortuary. When the victims of a serial killer of prostitutes are deposited there, scary things begin to happen. Therefore and because of a strange bet with his fellow student Jens, the police begins to think he is the murderer. Police detective Wormer wants to help him but Martin is more and more suspected.', 'English', '2019-09-23 09:27:36'),
(189, 13685, 'tt6138688', 'Once Upon A Time (2017)', 'once-upon-a-time-2017', 2017, 109, 'Three hundred years ago, the her that stood on the Zhu Xian Terrace, turned around and jumped off without regret. Caused the him that stood by the bronze mirror to witness with his own eyes her death. Three hundred years later, in the East Sea Dragon Palace, her and him meet unexpectedly. Another lifetime another world, once again facing this person that had betrayed her, she is indifferent as wind.', 'English', '2019-09-23 06:17:08'),
(190, 13684, 'tt7520286', 'Bisbee \'17 (2018)', 'bisbee-17-2018', 2018, 112, 'An old mining town on the Arizona-Mexico border finally reckons with its darkest day: the deportation of 1200 immigrant miners exactly 100 years ago. Locals collaborate to stage recreations of their controversial past.', 'English', '2019-09-23 09:14:50'),
(191, 13683, 'tt0078212', 'The Swissmakers (1978)', 'the-swissmakers-1978', 1978, 107, 'Foreigners who apply to become Swiss citizens have no easy task - especially when the police lets Bodmer loose to check upon their background, their integration in the society, and the possible danger they represent to the orderliness and cleanliness of the country. Bodmer gets a new assistant to help him corner unsuitable applicants. Very soon, a couple of conformist German physicians, a pretty Eastern European dancer, and the inevitable (and politically troublesome) Italian immigrant and his family start shooting themselves in the foot in their attempts to get the red passport with a white cross.', 'English', '2019-09-23 03:01:52'),
(192, 13682, 'tt0429715', 'The Business (2005)', 'the-business-2005', 2005, 97, 'Frankie decides he\'s had enough with his life as a street thug living on a South London estate, and jets off to spain where he meets big time businessman Charlie, who\'s currently running the hottest bars in the land and also a South London bank robber and drug kingpin. From here on in Frankie signs up to a lifetime of crime, women and drugs and works his way from the bottom to the top of the Spanish cocaine empire with Charlie and Fellow bank robber and drug kingpin Sammy who does not give Frankie the best reception.', 'English', '2019-09-23 06:56:37'),
(193, 13681, 'tt0015014', 'The Inhuman Woman (1924)', 'the-inhuman-woman-1924', 1924, 135, 'Claire Lescot is a famous prima donna. All men want to be loved by her. Among them is the young scientist Einar Norsen. When she mocks at him, he leaves her house with the declared intention to kill himself... But the story is much less important than the scenery : this movie intended to be a manifesto of the modern decorative arts.', 'English', '2019-09-22 23:52:44');
INSERT INTO `imdbinfo` (`id`, `movie_id`, `imdb_code`, `title_long`, `slug`, `year`, `movie_runtime`, `description_full`, `language`, `date_uploaded`) VALUES
(194, 13680, 'tt1403047', 'Aurora (2010)', 'aurora-2010', 2010, 181, 'An apartment kitchen: a man and a woman discuss Little Red Riding Hood, their voices hushed, mindful of waking the little girl sleeping next room. Waste land on the city outskirts: behind a line of abandoned trailers, the man silently watches what seems to be a family. The same city, the same man: driving through traffic with two hand-made firing pins for a hunting rifle. The man is 42 years old, his name - Viorel. Troubled by obscure thoughts, he drives across the city to a destination known only to him.', 'English', '2019-09-23 02:52:51'),
(195, 13679, 'tt4466490', 'Sieranevada (2016)', 'sieranevada-2016', 2016, 173, 'Three days after the terrorist attack on the offices of Parisian weekly Charlie Hebdo and forty days after the death of his father, Lary, a doctor in his forties is about to spend the Saturday at a family gathering to commemorate the deceased. But the occasion does not go according to expectations. Forced to confront his fears and his past, to rethink the place he holds within the family, Lary finds himself constraint to tell his version of the truth.', 'English', '2019-09-22 19:16:32'),
(196, 13678, 'tt6358156', 'Brecht (2019)', 'brecht-2019', 2019, 187, 'Bertolt Brecht, a theatre revolutionary, poet of the state, outsider, looks back on his life in 1956, the year of his death, in East Berlin: from provocations in the Augsburg of the First World War, to the early poetic and amorous height flights in Munich and Berlin in the 1920s, his escape from Hitler and US exile, followed by his later years caught in a dilemma between timeless classic and a failing GDR class fighter, an inflexible free man and a compromised Artist.', 'English', '2019-09-22 23:25:39'),
(197, 13677, 'tt0180748', 'In China They Eat Dogs (1999)', 'in-china-they-eat-dogs-1999', 1999, 91, 'Arvid is a regular bank clerk, whose life changes radically when he knocks out the bank robber Franz with his squash racket. A few days later Franz\'s wife visits him lamenting that she needed the swag for an IVF. To obtain the money Arvid and his criminal brother Harald plan a thievery, which ends bloodily and drags them into real trouble.', 'English', '2019-09-22 20:38:52'),
(198, 13676, 'tt0080931', 'Nightmare City (1980)', 'nightmare-city-1980', 1980, 92, 'In a nameless European city, a local reporter and his doctor wife try to escape from hordes of blood thirsty zombies, undead people exposed to nuclear radioactivity, while the military leaders fight a losing war of attrition against the relentless atomic zombies.', 'English', '2019-09-22 18:00:16'),
(199, 13675, 'tt0311648', 'Pieces of April (2003)', 'pieces-of-april-2003', 2003, 80, 'In a very poor zone of New York, April Burns and her boyfriend, the Afro-American Bobby, are preparing to receive April\'s family for thanksgiving dinner. While Bobby tries to borrow a suit for himself, April realizes that her stove is broken. She tries desperately to find a neighbor that can let her cook the turkey, since she does not want to fail (again) with her family. Meanwhile, in a suburb of Pennsylvania, her dysfunctional family is preparing to travel to New York. While driving, the relationship between the Burns and their black-sheep April is disclosed through the conversations between her father Jim, her resented mother Joy, her brother, her sister and her grandmother.', 'English', '2019-09-22 15:41:54'),
(200, 13674, 'tt3398436', 'German Angst (2015)', 'german-angst-2015', 2015, 112, 'Acclaimed writers and directors JÃ¶rg Buttgereit, Andreas Marschall, Michal Kosakowski are back behind the camera with a supreme feature film, controversial, mystical and disturbing. With a \"fil rouge\" of old images of Berlin scariest architecture, the film is built around three tales. The first episode, tells the story of a young girl who lives alone with her guinea pig in a dirty apartment in Berlin... is she alone? In the bedroom lies a man, bound and gagged... The second episode tells about a powerful \"if-only\" scenario in which a young deaf-mute couple is attacked by a group of hooligans. However, they are in possession of a mysterious talisman that could help them... In the last episode, a man stumbles upon a secret sex club that promises the ultimate sexual experience by using a drug made from the roots of the legendary Mandragora plant. The ecstatic experiences have horrific side effects...', 'English', '2019-09-22 15:26:34'),
(201, 13673, 'tt0035462', 'Tower of Terror (1941)', 'tower-of-terror-1941', 1941, 78, 'A British secret agent in Germany takes a job as the assistant to an elderly lighthouse keeper, planning to make his escape with some valuable documents when a British boat arrives to pick them up.', 'English', '2019-09-22 13:16:09'),
(202, 13672, 'tt2852406', 'Omar (2013)', 'omar-2013', 2013, 98, 'A young Palestinian freedom fighter agrees to work as an informant after he\'s tricked into an admission of guilt by association in the wake of an Israeli soldier\'s killing.', 'English', '2019-09-22 13:09:15'),
(203, 13671, 'tt0063595', 'She-Devils on Wheels (1968)', 'she-devils-on-wheels-1968', 1968, 82, 'A female motorcycle gang busies itself creating a ruckus. They regularly have bike races to determine who gets their pick of men for the night. When a rival male gang encroaches on their territory, it\'s a battle to the finish.', 'English', '2019-09-22 02:11:59'),
(204, 13670, 'tt0052929', 'Invisible Invaders (1959)', 'invisible-invaders-1959', 1959, 67, 'Aliens, contacting scientist Adam Penner, inform him that they have been on the moon for twenty thousand years, undetected due to their invisibility, and have now decided to annihilate humanity unless all the nations of earth surrender immediately. Sequestered in an impregnable laboratory trying to find the aliens\' weakness, Penner, his daughter, a no-nonsense army major and a squeamish scientist are attacked from outside by the aliens, who have occupied the bodies of the recently deceased.', 'English', '2019-09-22 01:45:32'),
(205, 13669, 'tt8749922', 'Grand-Daddy Day Care (2019)', 'grand-daddy-day-care-2019', 2019, 96, 'A family man turns his house into a \'day care\' center for senior citizens.', 'English', '2019-09-21 23:22:32'),
(206, 13668, 'tt0409860', 'Cutie Honey: Live Action (2004)', 'cutie-honey-live-action-2004', 2004, 0, 'The adventure of Cutie Honey, a super heroine who can transform into anything using her necklace to switch on and say \"Honey Flash!\".', 'English', '2019-09-21 23:20:28'),
(207, 13667, 'tt0066498', 'The Ear (1970)', 'the-ear-1970', 1970, 94, 'Husband (senior ministry official) and wife find their house is riddled with listening devices put there by his own ministry. A harrowing night follows (reminiscent of \'Who\'s Afraid Of Virginia Woolf\'), and the resolution is _worse_ than being carted off to jail...', 'English', '2019-09-21 20:46:58'),
(208, 13666, 'tt7553766', 'Trauma Is a Time Machine (2018)', 'trauma-is-a-time-machine-2018', 2018, 82, 'The film explores a woman\'s self destruction & healing from the traumatic after effects of rape within her relationship.', 'English', '2019-09-21 20:57:12'),
(209, 13665, 'tt0107478', 'Made in America (1993)', 'made-in-america-1993', 1993, 111, 'In the Bay Area, widowed Sarah Mathews and her high school senior daughter Zora Mathews are intellectuals who embrace their African roots, Sarah who owns and operates a store all things African called African Queen. Despite often fighting, they truly do love each other. That love is why Sarah would rather Zora attend Berkeley for her freshman year than science prodigy Zora\'s first choice of M.I.T. on the other side of the country. Caught in a lie, Sarah is forced to admit to Zora that her husband Charlie, who died before Zora was born and who was the love of her life, is not Zora\'s biological father as Zora has always believed, but that she was conceived via artificial insemination using anonymous sperm from a sperm bank. Determined to have a man in her life she can truly call a \"Dad\" all her own, Zora, with the help of her longtime best friend Tea Cake Walton, is able to break into the sperm bank\'s computerized records to find the donor\'s information, including his name: Hal Jackson....', 'English', '2019-09-21 12:39:12'),
(210, 13664, 'tt0084690', 'Six Pack (1982)', 'six-pack-1982', 1982, 108, 'Stopping briefly in a small Texas town, an itinerant race car driver finds that his stock car, on a trailer behind his motor home, has just been quickly and expertly stripped. He chases down the miscreants, who turn out to be six orphan children. He has no recourse to the law, for the corrupt local Sheriff takes most of the proceeds of their thievery in exchange for not putting them in an orphanage. They are charming rogues, who are in turn charmed by him. Disliking their arrangement with the Sheriff, they stow away with him, and he finds himself becoming a reluctant father figure. Thanks to their enthusiasm and incredible mechanical know-how, he begins to make a name for himself on the racing circuit. But the Sheriff doesn\'t take kindly to losing his extra income.', 'English', '2019-09-21 08:39:57'),
(211, 13663, 'tt4630550', 'The Unknown Girl (2016)', 'the-unknown-girl-2016', 2016, 113, 'The efficient Dr. Jenny Davin works hard and has been chosen to replace Dr. Habran, who has just retired, at the Kennedy Hospital. One night, someone rings the bell of her office after-hours and Dr. Davin asks her trainee Julien to not open the door since does not to seem an emergency. On the next morning, Police Inspectors Ben Mahmoud and Bercaro require her surveillance tape since a teenager was found dead on the other side of the road and they are investigating what happened. Jenny feels guilty for not opening the door and becomes obsessed to find the teenager\'s identity. Her investigation affects her relationship with patients that might know something about the unknown girl.', 'English', '2019-09-20 23:32:32'),
(212, 13662, 'tt0095513', 'The Legend of the Holy Drinker (1988)', 'the-legend-of-the-holy-drinker-1988', 1988, 128, 'An alcoholic homeless man is given two hundred francs by a stranger, who requests that when he can he will return the money to Saint Therese in the cathedral.', 'English', '2019-09-20 20:06:01'),
(213, 13661, 'tt5792656', 'Running with the Devil (2019)', 'running-with-the-devil-2019', 2019, 100, 'The CEO of an International conglomerate sends two of his most regarded executives to investigate why shipments of cocaine are being hijacked and over cut somewhere on the supply chain.', 'English', '2019-09-20 17:24:55'),
(214, 13660, 'tt1712192', 'Message from the King (2016)', 'message-from-the-king-2016', 2016, 102, 'After suddenly losing all contact with his younger sister, Jacob King arrives in Los Angeles determined to track her down. Trying to piece together her last known movements, King finds unsettling evidence of a life gone off the rails - drugs, sex and secrets in the sleazy underbelly of the City of Angels. Undeterred by warnings to go home, King proves to be more than a match for the violence he is confronted with as he relentlessly pursues the truth about what happened to his sister.', 'English', '2019-09-20 14:49:01'),
(215, 13659, 'tt8883524', 'Bloodline (2018)', 'bloodline-2018', 2018, 95, 'In this crime horror thriller inspired by the style of 70s horror films from directors like Brian De Palma and Dario Argento, an introverted husband and father named Evan, who works as a high school guidance counselor, becomes a brutal vigilante serial killer who targets all those who abuse the children who confide in him, especially if the abusers are their parents.', 'English', '2019-09-20 12:14:51'),
(216, 13658, 'tt0151785', 'The Night Is My Kingdom (1951)', 'the-night-is-my-kingdom-1951', 1951, 110, 'After an accident Raymond has gone blind. His family treats him like a child. But fortunately, a nun comes to his rescue. She works in a center where blind people learn to read with the Braille alphabet. The sister tells him they can learn any job they like: cabinet-makers, mechanics, cooks, etc . And there\'s another light that shines on Raymond: in the center, there\'s a blind schoolteacher, Louise, he falls in love with. But her fiancÃ© gets jealous.', 'English', '2019-09-21 05:23:09'),
(217, 13657, 'tt0069336', 'Sweet Sugar (1972)', 'sweet-sugar-1972', 1972, 90, 'Prostitute Sugar is set up by a corrupt politician. She is convinced of the futility of appealing her case in the courts and signs on to a chain gang run by the notorious Dr. John who performs cruel medical experiments on the people who work for him.', 'English', '2019-09-21 02:13:55'),
(218, 13656, 'tt0079261', 'Hair (1979)', 'hair-1979', 1979, 121, 'This movie, based on the cult Broadway musical of the 60s, tells a story about Claude, a young man from Oklahoma who comes to New York City. There he strikes up a friendship with a group of hippies, led by Berger, and falls in love with Sheila, a girl from a rich family. However, their happiness is short because Claude must go to the Vietnam war.', 'English', '2019-09-20 22:05:58'),
(219, 13655, 'tt8239736', 'Flight 666 (2018)', 'flight-666-2018', 2018, 89, 'Passengers and crew on an international flight are attacked by unseen forces that threaten all aboard and on the ground below them. As they fight to stay alive, they start to realize that these are actually the spirits of murdered girls determined to stop their killer on board who will do anything to remain free.', 'English', '2019-09-20 18:12:56'),
(220, 13654, 'tt9398640', 'Between Two Ferns: The Movie (2019)', 'between-two-ferns-the-movie-2019', 2019, 82, 'Zach Galifianakis dreamed of becoming a star. But when Will Ferrell discovered his public access TV show \"Between Two Ferns\" and uploaded it to Funny or Die, Zach became a viral laughing stock. Now Zach and his crew are taking a road trip to complete a series of high-profile celebrity interviews and restore his reputation. Directed by Scott Aukerman, BETWEEN TWO FERNS: THE MOVIE is a laugh-out-loud comedy that gives new insight into the curmudgeonly, beloved outsider Zach Galifianakis has created over the years.', 'English', '2019-09-20 15:33:17'),
(221, 13653, 'tt6769326', 'American Dreamer (2018)', 'american-dreamer-2018', 2018, 92, 'A down on his luck HAIL driver who makes extra cash chauffeuring a low level drug dealer around town, finds himself in a serious financial bind and decides to kidnap the dealer\'s child.', 'English', '2019-09-20 09:54:24'),
(222, 13652, 'tt5603620', 'Ambition (2019)', 'ambition-2019', 2019, 87, 'A young aspiring musician preparing for a competition, is incredibly confidant and gets herself involved in a frightening trap that she has to find her way out of. It raises the question: If an insane person is telling a story, is it real?', 'English', '2019-09-20 07:49:55'),
(223, 13651, 'tt8366502', 'Corporate Animals (2019)', 'corporate-animals-2019', 2019, 86, 'Lucy (Demi Moore) is the egotistical megalomaniac CEO of Incredible Edibles, America\'s premier provider of edible cutlery. In her infinite wisdom, Lucy leads her staff including her long-suffering assistants, Freddie (Karan Soni) and Jess (Jessica Williams), on a corporate team-building caving weekend to New Mexico. When disaster strikes, not even their useless guide, Brandon (Ed Helms), can save them. Trapped underground by a cave-in, this mismatched and disgruntled group must pull together in order to survive.', 'English', '2019-09-20 05:51:07'),
(224, 13650, 'tt0049672', 'The Revolt of Mamie Stover (1956)', 'the-revolt-of-mamie-stover-1956', 1956, 92, 'Set in the early \'40s, a San Francisco prostitute is run out of town just as the second World War has begun to intensify. Mamie settles down in Hawaii, hoping to start a new life. Though her prospects look good when she falls in love with a science-fiction writer who treats her with the respect she deserves, the dawning war and the fallacies of her previous lifestyle complicate their budding romance. Mamie cannot fully remove herself from her former profession, and provides some of her old services to the sailors stationed in town. Searching for another means of financial security, Mamie invests in several pieces of real estate and becomes quite wealthy, though her bad reputation has not been forgotten by the locals.', 'English', '2019-09-20 03:44:12'),
(225, 13649, 'tt8367184', 'The Wedding Year (2019)', 'the-wedding-year-2019', 2019, 90, 'A commitment-phobic 27 year old\'s relationship is put to the test when she and her new boyfriend go to 7 weddings in the same year.', 'English', '2019-09-20 13:13:59'),
(226, 13648, 'tt7596220', 'Auggie (2019)', 'auggie-2019', 2019, 81, 'Forced into early retirement, Felix Greystone falls in love with an augmented reality companion, to the detriment of his relationship with his wife and daughter.', 'English', '2019-09-20 07:32:14'),
(227, 13647, 'tt0089606', 'My Life as a Dog (1985)', 'my-life-as-a-dog-1985', 1985, 101, 'Ingemar lives with his brother and his terminally ill mother. He may have a rough time, but not as bad as Laika - the russian dog sent into space... He gets sent away to stay with relations for the summer. While there, he meets various strange characters, giving him experiences that will affect him for the rest of his life.', 'English', '2019-09-20 04:19:46'),
(228, 13646, 'tt2205762', 'Model Home (2018)', 'model-home-2018', 2018, 82, 'A single mother entertains a dangerous fantasy after she\'s recruited to live in an unsold property in an empty development.', 'English', '2019-09-20 01:33:24'),
(229, 13645, 'tt6365796', 'The Grizzlies (2018)', 'the-grizzlies-2018', 2018, 102, 'THE GRIZZLIES is an inspiring true story based on a group of Inuit students in the small Arctic town of Kugluktuk. Suffering from widespread drug use, alcohol abuse, domestic violence and one of the highest teen suicide rates in the world, this northern community is periled by the legacy of colonialism. The students are naturally skeptical when Russ Sheppard, yet another ignorant and unprepared white rookie teacher, arrives from the South on a one-year teaching contract. With much to learn, but deeply shaken by the death of one of his students, Russ introduces his class to the sport of lacrosse in an effort to help lift the dangerous fog of trauma existing in his students. While initially resistant, the students gradually come together to embrace the sport, form Team Grizzlies, and find inspiration to make shifts in their own lives. Together with Russ, the team gains the support of a deeply divided town and eventually negotiates its way to the National Lacrosse Championships in ...', 'English', '2019-09-19 22:53:59'),
(230, 13644, 'tt7279188', 'Woman at War (2018)', 'woman-at-war-2018', 2018, 101, 'Halla, a woman in her forties, declares war on the local aluminum industry to prevent it from disfiguring her country. She risks all she has to protect the highlands of Iceland-but the situation could change with the unexpected arrival of a small orphan in her life.', 'English', '2019-09-19 20:01:29'),
(231, 13643, 'tt6104206', 'Jackals (2017)', 'jackals-2017', 2017, 85, 'Set in the 1980s, an estranged family hires a cult deprogrammer to take back their teenage son from a murderous cult, but find themselves under siege when the cultists surround their cabin, demanding the boy back.', 'English', '2019-09-19 08:33:26'),
(232, 13642, 'tt8351882', 'No Surrender (2018)', 'no-surrender-2018', 2018, 114, 'An Egyptian police officer named General Yousef al-Masri lives in Karamouz neighborhood in Alexandria. The film dates back to the reign of King Farouk before the 1952 revolution in the English occupation of Egypt.', 'English', '2019-09-19 23:01:18'),
(233, 13641, 'tt0075040', 'Seven Beauties (1975)', 'seven-beauties-1975', 1975, 116, 'Pasqualino, an Italian everyman, deserts the army during World War II. Germans capture him and send him to a prison camp, where he does just about anything to survive. In lengthy flashbacks, we see him and his family of seven unattractive sisters (the seven beauties), his accidental murder of one sister\'s lover, his confession and imprisonment, his calculated switch to an asylum, his rape of a patient, and his volunteering to be a soldier to escape confinement. To the chagrin of his obese German captor, his weak and cowardly character enables him to survive the war and return to Naples where he has a plan to survive the next world catastrophe.', 'English', '2019-09-19 04:16:50'),
(234, 13640, 'tt0490076', 'All the Boys Love Mandy Lane (2006)', 'all-the-boys-love-mandy-lane-2006', 2006, 0, 'A group of high-schoolers invite Mandy Lane, an innocent, desirable girl, to a weekend party on a secluded ranch. While the festivities rage on, the number of revelers begins to drop mysteriously.', 'English', '2019-09-18 23:03:24'),
(235, 13639, 'tt0054973', 'His and Hers (1961)', 'his-and-hers-1961', 1961, 90, 'While researching his latest novel in North Africa, Reggie Blake finds himself lost in the desert. Rescued by a Bedouin tribe, and finally shipped home, Reggie enthusiastically adopts Bedouin dress and customs, much to the frustration of his wife.', 'English', '2019-09-19 20:28:18'),
(236, 13638, 'tt0197569', 'L\'HumanitÃ© (1999)', 'lhumanite-1999', 1999, 141, 'In a town near Lille, melancholy police superintendent Pharaon De Winter lives with his mother. An 11-year-old girl has been raped and murdered. Over the next week, De Winter investigates and grieves, his face nearly expressionless. He bikes, he gardens. He accompanies his neighbors, Joseph and Domino, to dinner and to the seaside; he even observes them in vigorous if not rough coitus. For Domino, sex seems her way of connecting. Does she fancy Pharaon? A plowed field, the sea, Pharaon\'s flowers, the pudenda of Domino and of the ravaged girl - this mix of images of beauty, evil, and possibility assaults Pharaon as he tries to do his job and hold on to his humanity.', 'English', '2019-09-18 03:04:12'),
(237, 13637, 'tt0191754', '28 Days (2000)', '28-days-2000', 2000, 103, 'New York based writer Gwen Cummings knows that she drinks a lot but doesn\'t believe it\'s a problem, and if she decides that it is an issue that she could stop drinking on her own. She and her live-in boyfriend Jasper fuel each other\'s hyperactivity with this excessive alcohol consumption, \"a normal life\" is not in either\'s vocabulary. Between Gwen and her older straight-laced sister Lily, Gwen more closely resembles their larger than life mother, who was also an alcoholic and who died because of that when they were children. Lily believes that Gwen\'s addictions makes her a difficult if not impossible person to love. While Gwen is in a drunken stupor at Lily\'s wedding, Gwen causes one issue after another, ruining the day for Lily. Gwen is forced to examine her drinking with the culmination of bad events she caused at the wedding, leading to her being court ordered to enter into rehab or jail for twenty-eight days, which is only marginally more tolerable an idea to her than the ...', 'English', '2019-09-17 23:23:00'),
(238, 13636, 'tt7533756', 'Louis & Luca - Mission to the Moon (2018)', 'louis-luca-mission-to-the-moon-2018', 2018, 80, 'In the international race to the moon, the Norwegian mission is led by brilliant inventor Reodor from the village of Flaklypa. With Nolan the Magpie as the brave astronaut, what could possibly go wrong? Quite a bit, actually - on the daring mission, secret passengers are discovered, hidden agendas are revealed, and nothing seems to work out the way it was planned. Nolan and his friend Louis the Hedgehog are in for some surprises on their trip to the moon. This is the third film in the stop-motion trilogy featuring the beloved characters from the Flaklypa universe.', 'English', '2019-09-17 20:40:23'),
(239, 13635, 'tt0060175', 'The Blood Drinkers (1964)', 'the-blood-drinkers-1964', 1964, 88, 'This weird and chilling tale of vampires and the undead seeking to bring their kind back to life features the evil Marco (Ronald Remy), an updated version of the vampiric Count Dracula replete with cape, fangs, and clean-shaven head! Marco seeks to reanimate his long lost love and infuse her with the blood of his victims as he casts his evil spell over the inhabitants of a lonely village. Sharp fangs gleam in the night as bloodsuckers and bats seek fresh blood from the veins of their victims in this eerie drive-in favorite, also known as \"The Vampire People\" and featuring unusual color photography and tinting effects.', 'English', '2019-09-17 17:50:50'),
(240, 13634, 'tt0047580', 'Three Coins in the Fountain (1954)', 'three-coins-in-the-fountain-1954', 1954, 102, 'Three American women, rooming together while working abroad in Rome, Italy, hope for romance and marriage. Frances, oldest of the three, has been fifteen years a secretary to novelist John Frederick Shadwell, a man whom she loves but whose reclusive nature prompts most people to believe him long since dead. Anita, one week away from returning to America (under the claim of getting married), finally bucks company rules (and gets caught) by finally accepting an invitation from an Italian co-worker to visit his family\'s farm for his sister\'s wedding. Newly arrived Maria soon sets her generally innocent eyes on Dino di Cessi, an actual prince with a reputation for womanizing, and makes a play for him by making herself his perfect match.', 'English', '2019-09-17 16:44:03'),
(241, 13633, 'tt7832848', 'Inside Man: Most Wanted (2019)', 'inside-man-most-wanted-2019', 2019, 0, 'An NYPD hostage negotiator teams up with a federal agent to rescue dozens of tourists held hostage during a 10-hour siege at the U.S. Federal Reserve.', 'English', '2019-09-17 14:33:23'),
(242, 13632, 'tt9697340', 'Rogue Cell (2019)', 'rogue-cell-2019', 2019, 75, 'When a contract killer discovers his latest set of targets have supernatural abilities and are connected to the death of his late wife, he goes rogue, turning his targets into a weapon against the corrupt officials that hired him.', 'English', '2019-09-19 15:31:07'),
(243, 13631, 'tt7907714', 'We Are Gathered Here (2019)', 'we-are-gathered-here-2019', 2019, 82, 'When groom-to-be Ben\'s wild ex-girlfriend Jules bursts in to declare her love for him on the eve of his wedding to Lisa, Ben is suddenly faced with a decision he didn\'t realize he had to make. But that\'s the problem: he has to decide.', 'English', '2019-09-19 13:25:53'),
(244, 13630, 'tt6264182', 'Candy Corn (2019)', 'candy-corn-2019', 2019, 85, 'It\'s Halloween weekend and a group of bullies are planning their annual hazing on local outcast, Jacob Atkins. When they take things too far, he\'s resurrected to seek revenge against those that wronged him.', 'English', '2019-09-19 11:20:06'),
(245, 13629, 'tt7916276', 'Boudica: Rise of the Warrior Queen (2019)', 'boudica-rise-of-the-warrior-queen-2019', 2019, 82, 'Boudica is an innocent sixteen-year-old girl who is forced into an arranged marriage by her father, the leader of a Celtic Tribe. However, her mother is unsure, doing whatever it takes to protect her daughter; so much so that she takes Boudica and persuades her to flee the village and live in her childhood home, away from an arranged marriage and a miserable life. Confusion and uncertainty fills Boudica\'s world as she faces so many challenges - the constant protection from her mother, falling in love, the ambiguity of her father\'s whereabouts and finding her inner strength and power. It is only a matter of time before the past catches up with everyone and Boudica must transform from a girl into the warrior queen of legend in order to protect the lives of those she loves.', 'English', '2019-09-17 07:35:52'),
(246, 13628, 'tt7511368', 'The Fight (2018)', 'the-fight-2018', 2018, 91, 'Tina lives in a quiet seaside town but her life is anything but quiet - her mother is threatening to leave her father, her daughter is being bullied and she and her husband Mick are juggling full time jobs and three children. Determined to ditch the dysfunction and beat her inner demons, Tina puts on her fighting gloves - literally, stepping into the boxing ring to sweat out her anxieties and punch up her self-worth. But does she have what it takes to get her family off the ropes and emerge victorious?', 'English', '2019-09-17 05:02:01'),
(247, 13627, 'tt6222286', 'Perfect (2018)', 'perfect-2018', 2018, 88, 'Garrett, an emotionally-troubled young man, is sent to a clinic, whispering soothing promises of perfection. By planting characteristics directly into his own body, he\'s relieved of his dark visions, but pays the price for purity of mind.', 'English', '2019-09-17 02:27:47'),
(248, 13626, 'tt8350360', 'Annabelle Comes Home (2019)', 'annabelle-comes-home-2019', 2019, 106, 'Determined to keep Annabelle from wreaking more havoc, demonologists Ed and Lorraine Warren bring the possessed doll to the locked artifacts room in their home, placing her \"safely\" behind sacred glass and enlisting a priest\'s holy blessing. But an unholy night of horror awaits as Annabelle awakens the evil spirits in the room, who all set their sights on a new target--the Warrens\' ten-year-old daughter, Judy, and her friends.', 'English', '2019-09-16 23:37:05'),
(249, 13625, 'tt4772856', 'Better Than Love (2019)', 'better-than-love-2019', 2019, 85, 'In the era of gansta\' rap wannabes, 19-year-old Jon\'s hopes of escaping the suburban ghetto get derailed when his drug-hustling childhood friend is incarcerated. Jon\'s loyalty challenges his morality as he ascends to benevolent \'kingpin of his neighborhood.\' Jon develops a relationship with a beautiful recovering addict, AJ. Everything comes to a halt when Jon suffers a severe accident. Immobilized and separated from his phone, Jon\'s physical and emotional pain leads him to a new romance, with OxyContin. Unable to track down AJ, Jon falls into the deep hole of addiction. Caught between love and death, Jon tries to save everyone but himself.', 'English', '2019-09-19 09:20:40'),
(250, 13624, 'tt0085859', 'Local Hero (1983)', 'local-hero-1983', 1983, 111, 'Oil billionaire Happer sends Mac to a remote Scottish village to secure the property rights for an oil refinery they want to build. Mac teams up with Danny and starts the negotiations, the locals are keen to get their hands on the \'Silver Dollar\' and can\'t believe their luck. However, a local hermit and beach scavenger, Ben Knox, lives in a shack on the crucial beach which he also owns. Happer is more interested in the Northern Lights and Danny in a surreal girl with webbed feet, Marina. Mac is used to a Houston office with fax machines but is forced to negotiate on Bens terms.', 'English', '2019-09-19 06:22:50'),
(251, 13623, 'tt4106264', 'Foreseen (2019)', 'foreseen-2019', 2019, 74, 'Is Karmen\'s ability to write a gift or a curse? She\'s about to find out if her entire life is a lie.', 'English', '2019-09-16 18:16:24'),
(252, 13622, 'tt7403614', 'Mission Panda: Ein tierisches Team (2019)', 'mission-panda-ein-tierisches-team-2019', 2019, 90, 'A goofy stork mistakenly delivers a baby panda to the wrong door. A bear, a moose, a tiger and a rabbit set on an arduous but fun filled adventure through wilderness to return the panda to its rightful home.', 'English', '2019-09-19 01:42:50'),
(253, 13621, 'tt0021331', 'The Blood of a Poet (1932)', 'the-blood-of-a-poet-1932', 1932, 0, 'A young artist draws a face at a canvas on his easel. Suddenly the mouth on the drawing comes into life and starts talking. The artist tries to wipe it away with his hand, but when he looks into the hand he finds the living mouth on his palm. He tries to wipe it off on the mouth of an unfinished statue of a young woman. The statue comes into life and tells him that the only way out of the studio is through the looking glass. The artist jumps into the mirror and comes to the Hotel of Dramatic Lunacies. He peeps through the keyholes of a series of hotel rooms. In the last room he sees desperate meetings of hermaphrodites. One of them has a signboard saying \"Mortal danger\". Back in the studio the artist crushes the statue with a sledgehammer. Because of this he himself becomes a statue, located at the side of a square. Some schoolboys start a snowball fight around the statue. One of the boys is killed by a snowball. A fashionable couple start playing cards at a table beside the corpse. ...', 'English', '2019-09-19 00:21:37'),
(254, 13620, 'tt0058888', 'Red Beard (1965)', 'red-beard-1965', 1965, 185, 'In a charity hospital, a hard-bitten but honorable older doctor, Dr. Niide, takes a young intern under his guidance through the course of a number of difficult cases.', 'English', '2019-09-18 21:22:15'),
(255, 13619, 'tt0120448', 'The Life of Jesus (1997)', 'the-life-of-jesus-1997', 1997, 96, 'A social movie about current life in the north of France. Freddy and his friends are all unemployed. They pass away time by wandering around on their motorcycles and by directing their aggressive feelings towards Arab immigrants. Freddy is in love with Marie, a cashier at a local supermarket. When she is proposed to by Kader, a young Arab man, Freddy and his friends have an idea: they decide to punish Kader for what they call \"such a provocation.\" After they have raped another girl, Marie finally commits to Kader, which seals his fate.', 'English', '2019-09-15 09:39:29'),
(256, 13618, 'tt5480782', 'Good Manners (2017)', 'good-manners-2017', 2017, 135, 'Clara, a lonely nurse from the outskirts of SÃ£o Paulo, is hired by mysterious and wealthy Ana as the nanny for her unborn child. The two women develop a strong bond, but a fateful night changes their plans.', 'English', '2019-09-18 17:41:33'),
(257, 13617, 'tt0082329', 'Endless Love (1981)', 'endless-love-1981', 1981, 116, 'Two young teenagers, Jade Butterfield and David Axelrod, fall in love with each other. But the passion is too consuming for Jade\'s bohemian parents. Her parents try to stop them from seeing each other. But when this doesn\'t work, David burns down the house and is sent to a mental hospital. This doesn\'t stop him from seeing her. When he gets out, he goes to look for her and remains in love with her. But in the end, the passion for his first love is too strong and she has to leave or this love will kill both of them.', 'English', '2019-09-15 06:22:13'),
(258, 13616, 'tt0081176', 'My American Uncle (1980)', 'my-american-uncle-1980', 1980, 125, 'Prof. Henri Laborit uses the stories of the lives of three people to discuss behaviorist theories of survival, combat, rewards and punishment, and anxiety. RenÃ© is a technical manager at a textile factory and must face the anxiety caused by corporate downsizing. Janine is a self-educated actress/stylist who learns that the wife of her lover is dying and must decide to let them reunite. Jean is a controversial career-climbing writer/politician at a crossroads in life.', 'English', '2019-09-18 14:08:30'),
(259, 13615, 'tt5581284', 'All About Me (2018)', 'all-about-me-2018', 2018, 100, 'Dramatised origin story of one of Germany\'s most beloved contemporary comedians.', 'English', '2019-09-14 23:00:25'),
(260, 13614, 'tt0102571', 'The Elementary School (1991)', 'the-elementary-school-1991', 1991, 100, 'The time is 1945-46. 10 year old Eda and his friend Tonda live in a small village outside Prague. In school, their class is so wild and indisciplined that their teacher quits and is replaced by the militant Igor Hnidzo. He is very strict - but also very just. His weakness is his interest in young women.', 'English', '2019-09-18 10:52:48'),
(261, 13613, 'tt0066549', 'Waterloo (1970)', 'waterloo-1970', 1970, 134, 'After defeating France and imprisoning Napoleon on Elba, ending two decades of war, Europe is shocked to find Napoleon has escaped and has caused the French Army to defect from the King back to him. The best of the British generals, the Duke of Wellington, beat Napolean\'s best generals in Spain and Portugal, but has never faced Napoleon. Wellington stands between Napoleon with a makeshift Anglo-Allied army and the Prussians. A Napoleon victory will plunge Europe back into a long term war. An allied victory could bring long term peace to Europe. The two meet at Waterloo where the fate of Europe will be decided.', 'English', '2019-09-18 07:26:37'),
(262, 13612, 'tt0062235', 'The Torture Chamber of Dr. Sadism (1967)', 'the-torture-chamber-of-dr-sadism-1967', 1967, 80, 'In the Olden Tymes, Count Regula is drawn and quartered for killing twelve virgins in his dungeon torture chamber. Thirty-five years later, he comes back to seek revenge on the daughter of his intended thirteenth victim and the son of his prosecutor in order to attain immortal life.', 'English', '2019-09-14 16:50:48'),
(263, 13611, 'tt8663516', 'Child\'s Play (2019)', 'childs-play-2019', 2019, 90, 'After moving to a new city, young Andy Barclay receives a special present from his mother -- a seemingly innocent Buddi doll that becomes his best friend. When the doll suddenly takes on a life of its own, Andy unites with other neighborhood children to stop the sinister toy from wreaking bloody havoc.', 'English', '2019-09-14 14:15:40'),
(264, 13610, 'tt3699692', 'Dude Bro Party Massacre III (2015)', 'dude-bro-party-massacre-iii-2015', 2015, 91, 'DUDE BRO PARTY MASSACRE III follows BRENT CHIRINO as he enters the oil-misted halls of the DELTA BI THETA fraternity. Brent isn\'t just any pledge... he\'s a legacy. And it\'s a legacy of death. See, Brent is here to solve the mystery of his identical twin brother BROCK\'s murder, and he\'ll do anything to crack the case... even attempt the frat\'s most daring prank of all time. After the Deltas\' senior prank causes two commercial jets to collide over an orphanage, they\'re punished to a weekend at The Old Sorority House by the Lake. But they\'re not the only ones there... a mysterious killer named MOTHERFACE lurks nearby. She knows the bros\' deepest fears... and she\'s taking advantage of those fears to pick them off, one by shirtless one, in increasingly gory ways. It\'s a race against time for Brent to discover the mysteries of his brother\'s death before Motherface butchers them all!', 'English', '2019-09-14 11:28:14'),
(265, 13609, 'tt0044014', 'Secret People (1952)', 'secret-people-1952', 1952, 96, 'In 1930, Maria Brentano and her younger sister Nora flee to London after their father is murdered by a European dictator. Seven years later, during a weekend trip to Paris, Maria unexpectedly meets Louis, her former lover who is now plotting the assassination of the dictator. Maria and Nora become involved in the plan, which goes tragically wrong when the time bomb they plant kills an innocent bystander.', 'English', '2019-09-18 04:46:58'),
(266, 13608, 'tt0021165', 'Murder! (1930)', 'murder-1930', 1930, 104, 'The police find the actress, Diana Baring, near the body of her friend. All the circumstantial proofs seems to point to her and, at the end of the trial, she is condemned. Sir John Menier, a jury member, suspects Diana\'s boyfriend, who works as an acrobat wearing a dress.', 'English', '2019-09-14 08:24:52'),
(267, 13607, 'tt8111130', 'The Weekend (2018)', 'the-weekend-2018', 2018, 87, 'A comedian goes away for the weekend with an ex-boyfriend and his new girlfriend.', 'English', '2019-09-14 05:39:37'),
(268, 13606, 'tt6385768', '3 Days with Dad (2019)', '3-days-with-dad-2019', 2019, 94, 'The last thing Eddie Mills (Larry Clarke) wants to do is go home to deal with his dying Dad (Brian Dennehy). But the Catholic guilt gnaws at him, and he returns home to his crazy family, an overbearing step-mother (Leslie Ann Warren) , and his bear of a father. Once there, Eddie is confronted with a revelation that forces him to deal with the past he has always avoided.', 'English', '2019-09-14 00:10:10'),
(269, 13605, 'tt6570372', 'Gags The Clown (2018)', 'gags-the-clown-2018', 2018, 89, 'A small city in Wisconsin is terrorized by a mysterious clown who roams the streets late at night with nothing more than a handful of black balloons. The local news stations scramble to break the story on who he is and what he wants while a group high schoolers see the clown\'s arrival as an excuse to create a little trouble themselves. The police try to maintain order in a city that has gone clown crazy and a conservative podcast host vows to put a stop to the clown known as Gags while broadcasting his \"clown hunt\" on social media for the world to see.', 'English', '2019-09-13 21:21:07'),
(270, 13604, 'tt6945932', 'Scarborough (2018)', 'scarborough-2018', 2018, 87, 'At the Grand Hotel in Scarborough overlooking the North Sea, first Liz and then Aiden receive the keys of the respective rooms, declaring to be alone but finding themselves, in the space of a trip in the elevator, each one clinging to a younger lover. Over the course of a weekend, two love stories intersect and merge, forbidden and marked, mirroring one another. The couples\' game is balanced, with Liz and Aiden both teachers struggling with both intense and problematic loves for sixteen-year-old Daz and Beth. Overflowing with vital ingenuity, the two boys represent a romantic and sensual ideal that begs to be lived, but at the same time requires to be hidden from prying eyes: there is not only age to complicate things, but the fact that every couple is composed of teacher and student. Liz is lithe and luminous as a 45 year-old teacher in love with her muscular pupil Daz, whose puppy-like naive enthusiasm could clearly wane. They\'ve only actually spent 22 hours together during their ...', 'English', '2019-09-13 18:42:10'),
(271, 13603, 'tt8707922', 'Can You Keep a Secret? (2019)', 'can-you-keep-a-secret-2019', 2019, 0, '', 'English', '2019-09-13 15:53:31'),
(272, 13602, 'tt9352926', 'The Sound of Silence (2019)', 'the-sound-of-silence-2019', 2019, 0, '', 'English', '2019-09-13 13:02:33'),
(273, 13601, 'tt6628322', 'Shanghai Fortress (2019)', 'shanghai-fortress-2019', 2019, 107, 'Set in the future, the city of Shanghai, China battles to defend itself against an ongoing attack by an alien force that has laid siege to numerous cities around the globe in its quest to harvest a hidden energy only found on earth.', 'English', '2019-09-18 02:27:35'),
(274, 13600, 'tt9252508', 'Tall Girl (2019)', 'tall-girl-2019', 2019, 101, 'Jodi (Ava Michelle) has always been the tallest girl in school - and she\'s always been uncomfortable with it. After slouching her way through life for 16 years and being made fun of by classmates, Jodi meets Stig (Luke Eisner), a seemingly perfect Swedish foreign exchange student who\'s even taller than she is. Jodi\'s new crush turns her world upside down and throws her into a surprising love triangle, but with the help of her two best friends (Griffin Gluck, Anjelika Washington) as well as her beauty queen sister Harper (Sabrina Carpenter), Jodi comes to realize that she\'s far more than her insecurities about her appearance have led her to believe.', 'English', '2019-09-18 00:11:14'),
(275, 13599, 'tt7946216', 'Depraved (2019)', 'depraved-2019', 2019, 114, 'A disillusioned field surgeon suffering from PTSD makes a man out of body parts and brings him to life in a Brooklyn loft.', 'English', '2019-09-17 21:34:40'),
(276, 13598, 'tt6049106', 'Riot Girls (2019)', 'riot-girls-2019', 2019, 81, 'In an alternate 1995, a mysterious disease has wiped out all of the adults. In this new age, two gangs are pitted against each other in a brutal war for territory, resources and survival.', 'English', '2019-09-17 19:23:11'),
(277, 13597, 'tt6535880', 'Haunt (2019)', 'haunt-2019', 2019, 92, 'On Halloween, a group of friends encounter an \"extreme\" haunted house that promises to feed on their darkest fears. The night turns deadly as they come to the horrifying realization that some nightmares are real.', 'English', '2019-09-13 01:52:37'),
(278, 13596, 'tt6320628', 'Spider-Man: Far from Home (2019)', 'spider-man-far-from-home-2019', 2019, 129, 'Our friendly neighborhood Super Hero decides to join his best friends Ned, MJ, and the rest of the gang on a European vacation. However, Peter\'s plan to leave super heroics behind for a few weeks are quickly scrapped when he begrudgingly agrees to help Nick Fury uncover the mystery of several elemental creature attacks, creating havoc across the continent.', 'English', '2019-09-12 12:49:47'),
(279, 13595, 'tt7323546', 'Behind the Bullet (2019)', 'behind-the-bullet-2019', 2019, 84, 'Every year, thousands of people are killed by guns in America. Each shooting devastates and forever changes the victim\'s family and friends. Behind the Bullet explores a side of gun violence that\'s rarely talked about - the impact a shooting has on the shooter. Four individuals share how the pull of a trigger changed them emotionally, physically, psychologically, and spiritually. They describe the conflicting emotions and moral injury that comes after a self-defense, accidental, or unintentional shooting, offering a new and unbiased perspective on gun violence.', 'English', '2019-09-12 16:02:25'),
(280, 13594, 'tt0057541', 'Summer Holiday (1963)', 'summer-holiday-1963', 1963, 107, 'A fabulous 60s Musical - 4 London Bus mechanics strike up a deal with London Transport. They do up a double decker London Bus, drive it around Europe as a hotel and if they make it they will own and be in charge of a whole fleet. While on the road in France they pick up 3 ladies whose car breaks down and offer to take them to their next singing job in Athens. They also pick up a stowaway. A young, American boy. Meanwhile, a young American female singer has gone missing. Her mother (who is a VERY ambitious woman) and her aid take the story to the press and it makes the front page. They do all they can to make the story run for as long as possible, including misdirecting the bus up an extremely steep Yugoslavian hill. We find out the young American boy is actually the young American girl who is missing. Mayhem ensues as the lead character, Don (Cliff Richard) falls for Barbara. Eventually, when the 8 bus riders reach Athens, they\'re arrested for kidnapping. In front of her mother and a ...', 'English', '2019-09-12 09:16:19'),
(281, 13593, 'tt8969332', 'The Biggest Little Farm (2018)', 'the-biggest-little-farm-2018', 2018, 91, 'A testament to the immense complexity of nature, The Biggest Little Farm follows two dreamers and a dog on an odyssey to bring harmony to both their lives and the land. When the barking of their beloved dog Todd leads to an eviction notice from their tiny LA apartment, John and Molly Chester make a choice that takes them out of the city and onto 200 acres in the foothills of Ventura County, naively endeavoring to build one of the most diverse farms of its kind in complete coexistence with nature. The land they\'ve chosen, however, is utterly depleted of nutrients and suffering from a brutal drought. The film chronicles eight years of daunting work and outsize idealism as they attempt to create the utopia they seek, planting 10,000 orchard trees and over 200 different crops, and bringing in animals of every kind- including an unforgettable pig named Emma and her best friend, Greasy the rooster. When the farm\'s ecosystem finally begins to reawaken, so does the Chesters\' hope - but as ...', 'English', '2019-09-17 12:48:31'),
(282, 13592, 'tt0120684', 'Gods and Monsters (1998)', 'gods-and-monsters-1998', 1998, 105, 'The story of James Whale, the Director of Frankenstein (1931) and Bride of Frankenstein (1935), in the time period following the Korean War. Whale was homosexual, and develops a friendship with his gardener, an ex-Marine.', 'English', '2019-09-17 10:19:04'),
(283, 13591, 'tt0073596', 'Queen of the Stardust Ballroom (1975)', 'queen-of-the-stardust-ballroom-1975', 1975, 98, 'A middle-aged woman finds herself simply a widow, a grandmother and a person when a friend takes her to the Stardust Ballroom, a dance hall which recreates the music and atmosphere of the 1940s. There she encounters a most unlikely Prince Charming, a middle-aged mailman. With this encounter, life takes on a new meaning for the film\'s heroine.', 'English', '2019-09-17 07:47:32'),
(284, 13590, 'tt8884430', 'Echo in the Canyon (2018)', 'echo-in-the-canyon-2018', 2018, 82, 'A look at the roots of the historic music scene in L.A.\'s Laurel Canyon featuring the music of iconic groups such as The Byrds, The Beach Boys, Buffalo Springfield, and The Mamas and the Papas.', 'English', '2019-09-12 00:44:04'),
(285, 13589, 'tt0057503', 'New Tale of Zatoichi (1963)', 'new-tale-of-zatoichi-1963', 1963, 91, 'Blind masseur and master swordsman, Zatoichi, is tired of killing. He journeys to his old village looking for peace, but is pursued by the brother of Boss Kanbei, a man he\'s killed. Back home, Ichi connects with Banno, his teacher, who seeks prestige and has arranged for his younger sister, Yayoi, to marry into a wealthy samurai family. Ichi and Yayoi realize they are in love, but Ichi\'s request for her hand meets with Banno\'s derision. Ichi is also drawn into Banno\'s plot to kidnap the son of a wealthy man, ostensibly to aid the Mito Goblins, a gang of thieves on the run; but Banno wants to keep the ransom. Ichi wants harmony and love, but can he escape a destiny of violence?', 'English', '2019-09-11 17:57:30');
INSERT INTO `imdbinfo` (`id`, `movie_id`, `imdb_code`, `title_long`, `slug`, `year`, `movie_runtime`, `description_full`, `language`, `date_uploaded`) VALUES
(286, 13588, 'tt0051150', 'The Vampire (1957)', 'the-vampire-1957', 1957, 75, 'Dr. Matthew Campbell has been experimenting on methods to regress the mind to primitive instincts so that we can find methods to improve our brains and not get taken in by cheap horror movie hogwash. He\'s developed a drug made from vampire bat blood and has begun treating himself with it. But instead of improving his mind, he\'s become ill and addicted. He dies, but not before trying to warn fellow doctor Paul Beecher. Fortunately for us, he dies before he can say more than that pills are to blame. While still at Campbell\'s house, Paul finds a bottle of pills and pockets them. He\'s also got another bottle of pills in his other pocket that he takes for frequent migraine attacks. He goes home, puts his jacket on a rack, and then he\'s struck with a migraine. He asks his daughter to give him the pills in his jacket pocket, and of course she gives him the pills of evil. He is instantly addicted and he must take one pill every day. Each time he takes a pill he turns into a hairy and very ...', 'English', '2019-09-11 15:22:30'),
(287, 13587, 'tt6446550', 'The Parting Glass (2018)', 'the-parting-glass-2018', 2018, 95, 'A family dealing with their sister\'s death travel across country to collect her belongings and piece together their memories of the woman they lost.', 'English', '2019-09-11 12:30:44'),
(288, 13586, 'tt0176783', 'Gossip (2000)', 'gossip-2000', 2000, 90, 'On a beautiful college campus, something ugly is about to be spread around. A bit of gossip that was told is starting to take a frightening turn. Who could it have offended and how far will the person on the other side of the gossip handle the embarrassing situation.', 'English', '2019-09-11 07:04:34'),
(289, 13585, 'tt1525836', 'Gantz: Perfect Answer (2011)', 'gantz-perfect-answer-2011', 2011, 0, 'Kato\'s (Ken\'ichi Matsuyama) death changes Kurono\'s (Kazunari Ninomiya) view of life completely. He decides to keep fighting until he earns 100 points so that he can bring back Kato. GANTZ calls back several other unwilling participants that were allowed to leave after scoring 100 points. Before Kurono succeeds in resurrecting Kato, he unexpectedly comes back. GANTZ and the fighters take on another enemy worse than ever before. To make matters worse, GANTZ starts acting up. GANTZ chooses the next target... this time it\'s not an alien but a human girl. Each unwilling participant in GANTZ\'s twisted game has a different motive for fighting, whether to protect a loved one or to do what they think is right.', 'English', '2019-09-11 02:46:56'),
(290, 13584, 'tt0059415', 'Loves of a Blonde (1965)', 'loves-of-a-blonde-1965', 1965, 0, 'A factory manager in rural Czechoslovakia bargains with the army to send men to the area, to boost the morale of his young female workers, deprived of male company since the local boys have been conscripted. The army sends reservists, mostly married middle-aged men - and the local beauty Andula, spurns those bold enough to try to win her, for the jazz pianist, newly come from Prague to perform. He seduces her and impresses her, telling her \"most women are round, like guitars but you are a guitar by Picasso\". Staying the night with him causes a lecture on a young woman\'s honour at her hostel so she throws over her other suitors and makes her way to Prague to find the young man. His protective Mamma and weary Pappa are not pleased when she arrives on the doorstep with her suitcase.', 'English', '2019-09-17 03:09:28'),
(291, 13582, 'tt5668208', '5th of July (2019)', '5th-of-july-2019', 2019, 100, 'Orlando Leal, a young black French professor, travels to the mountains on the 4th of July to complete his dying fathers last wish, to spread his ashes on the surface of Mosquito Lake. Orlando reluctantly complies, but when he curses his father at the lake, the universe turns on him. First he gets robbed of his wallet and keys by thieves named Dakota and Cowboy, then he gets drugged by some Burning Man neo hippies. On the 5th, he escapes farm work slavery by stealing the farm bosses motorcycle, which he drives home to find that those thieves have stolen everything out of his house. Meanwhile. Karen, the greatest new love of his life, is flying in tonight from Washinton D.C. and if he isn\'t there to meet her, he\'s going to lose her too. Can Orlando recover his life, undo his curse and return the stolen motorcycle in time to reunite with Karen?', 'English', '2019-09-10 23:25:37'),
(292, 13581, 'tt4827420', 'Human Affairs (2018)', 'human-affairs-2018', 2018, 80, 'A compassionate drama about a young, successful theatre couple in New York City who meet their surrogate mother for the first time and embark on a startling and intimate weekend of surprises and emotional revelations.', 'English', '2019-09-10 20:51:26'),
(293, 13580, 'tt5859352', 'Hellmington (2018)', 'hellmington-2018', 2018, 83, 'Upon the news from her police sergeant paternal uncle Rupert Woodhouse of her father Joe Woodhouse, a former prison guard, being on his deathbed, Samantha Woodhouse, a police detective herself, returns to her small hometown of Hellmington to be by her father\'s side, despite they having been estranged for years. Gasping for his last breaths, Joe blurts out the name Katie Owens just before he dies. Katie was the daughter of Vic Owens, a prison guard colleague of Joe\'s, and a classmate of Sam\'s who went missing shortly after their high school prom almost twenty years ago. Vic, too, disappeared mysteriously before Katie. Katie\'s disappearance was never solved, although her boyfriend at the time, Brad Kovacs, was always suspected of having something to do with it. Brad has always asserted that Katie went missing after receiving an invitation to go to an occultist meeting, the occult which she was researching at the time and in which she had always believed. Because of Joe\'s dying words, ...', 'English', '2019-09-10 18:32:17'),
(294, 13579, 'tt6547044', 'Being Frank (2018)', 'being-frank-2018', 2018, 109, 'A normal father\'s family life is turned upside down when his son discovers his dad has another family.', 'English', '2019-09-10 15:31:14'),
(295, 13578, 'tt3445280', 'Investigation 13 (2019)', 'investigation-13-2019', 2019, 90, 'A group of science students have discovered how to scientifically explain the paranormal. Their goal is to present their findings to their school board and petition to launch the very first parapsychology credited course at their university. Their thirteenth and final investigation lands them at Black Grove Psychiatric Asylum where they look into the urban legend of ,The Mole Man, an ex-patient of the asylum who is thought to live within its walls. This first feature will introduce the killer and we\'re looking to do a spin-off series where we will then go on to produce Mole Man, Mole Man 2 and Mole Man 3.', 'English', '2019-09-17 00:55:12'),
(296, 13576, 'tt7246106', 'Artik (2019)', 'artik-2019', 2019, 78, 'A comic book obsessed serial killer teaches his son how to get away with a series of brutal murders until the boy befriends a mysterious man who threatens to expose everything.', 'English', '2019-09-10 12:52:53'),
(297, 13577, 'tt8079248', 'Yesterday (2019)', 'yesterday-2019', 2019, 116, 'In Lowestoft UK, Jack Malik is a frustrated musician whose musical career is going nowhere despite the faith that his friend/manager Ellie Appleton has in him. However, on the night Jack decides to give up, the whole world is momentarily hit with a massive blackout during which Jack is hit by a bus. Upon regaining consciousness, Jack learns to his astonishment that he is apparently now the only one who knows the music of the Beatles. Realizing this improbable opportunity, Jack begins playing the music of the greatest of the rock bands, claiming it as his own. It pays off quickly and Jack becomes a worldwide musical sensation. However, Jack finds himself drifting away from Ellie, only realizing his love for her when she has become intimidated by his success, which depends on a blatant plagiarization that no one could find out. Now, Jack must make a fundamental moral decision about his music to satisfy his conscience as he decides what he truly needs.', 'English', '2019-09-17 05:21:02'),
(298, 13575, 'tt4461676', '1/2 New Year (2019)', '12-new-year-2019', 2019, 74, 'The story follows a group of friends who have an annual 1/2 New Year Party. This year in particular, relationships are tested, friendships made and feelings revealed as the group bands together to send off one of their own with lots of love and compassion. After all, friends are the family you get to choose.', 'English', '2019-09-10 10:33:41'),
(299, 13574, 'tt8080302', 'Penguins (2019)', 'penguins-2019', 2019, 76, 'Disneynature\'s all-new feature film \"Penguins\" is a coming-of-age story about an AdÃ©lie penguin named Steve who joins millions of fellow males in the icy Antarctic spring on a quest to build a suitable nest, find a life partner and start a family. None of it comes easily for him, especially considering he\'s targeted by everything from killer whales to leopard seals, who unapologetically threaten his happily ever after. From the filmmaking team behind \"Bears\" and \"Chimpanzee,\" Disneynature\'s \"Penguins\" opens in theaters nationwide in time for Earth Day 2019.', 'English', '2019-09-10 08:13:32'),
(300, 13573, 'tt4042818', 'The Death and Life of John F. Donovan (2018)', 'the-death-and-life-of-john-f-donovan-2018', 2018, 123, 'A decade after the death of an American TV star, a young actor reminisces the written correspondence he shared with him, as well as the impact those letters had on both their lives.', 'English', '2019-09-10 05:11:06'),
(301, 13572, 'tt7456310', 'Anna (2019)', 'anna-2019', 2019, 119, 'Beneath Anna Poliatova\'s striking beauty lies a secret that will unleash her indelible strength and skill to become one of the world\'s most feared government assassins.', 'English', '2019-09-11 11:48:22'),
(302, 13571, 'tt0081060', 'Little Darlings (1980)', 'little-darlings-1980', 1980, 0, 'Fifteen year olds Ferris Whitney and Angel Bright meet when they attend the same summer camp and are assigned the bunks next to each other in the same cabin. It\'s hate at first sight as they are seemingly polar opposites: romantic and literate Ferris comes from a wealthy and thus privileged background, while streetwise and chain-smoking Angel is from the proverbial wrong side of the tracks. But they share one similarity: they are both virgins, the only ones of their age in their cabin. Due to pressure from their cabin mates, most specifically the aggressive Cinder Carlson, the two enter into a bet on who will lose their virginity first and by the end of the summer. Ferris, who initially seems more interested in the pursuit of the opposite sex, quickly sets her sights on Gary Callahan, the much older coach at the camp. But Angel finds her own target, namely Randy Adams, an equally streetwise boy attending the camp across the lake. The process becomes a bonding exercise for the two ...', 'English', '2019-09-11 09:40:15'),
(303, 13570, 'tt2178941', 'Barbara (2012)', 'barbara-2012', 2012, 105, 'In 1980s East Germany, Barbara is a Berlin doctor banished to a country medical clinic for applying for an exit visa. Deeply unhappy with her reassignment and fearful of her co-workers as possible Stasi informants, Barbara stays aloof, especially from the good natured clinic head, Andre. Instead, Barbara snatches moments with her lover as she secretly prepares to defect one day. Despite her plans, Barbara learns more about her life that puts her desires and the people around her in a new light. With her changing perspective, Barbara finds herself facing a painful moral dilemma that forces her to choose what she values.', 'English', '2019-09-10 01:40:47'),
(304, 13569, 'tt0056937', 'Cleopatra (1963)', 'cleopatra-1963', 1963, 192, 'In 48 B.C., Julius Caesar (Sir Rex Harrison) pursues Pompey from Pharsalia to Egypt. Pharaoh Ptolemy XIII (Richard O\'Sullivan), now supreme ruler after deposing his older sister, Cleopatra VII (Dame Elizabeth Taylor), attempts to gain favor with Caesar by presenting the conquerer with the head of Pompey, borne by his governors, Pothinus (GrÃ©goire Aslan) and Achillas (John Doucette). To win Caesar\'s support from her brother, Cleopatra hides herself in a rug, which Apollodorus (Cesare Danova), her servant, presents to Caesar. The Roman is immediately infatuated. Banishing Ptolemy, he declares Cleopatra Egypt\'s sole ruler and takes her as his mistress. A son, Caesarion (Loris Loddi), is born of their union. Caesar, however, must return to Italy. Although he is briefly reunited with Cleopatra during a magnificent reception for the Queen in Rome, Caesar is assassinated shortly thereafter, and Cleopatra returns to Egypt. When Mark Antony (Richard Burton), Caesar\'s protÃ©gÃ©, beholds Cleopatra...', 'English', '2019-09-09 21:47:43'),
(305, 13568, 'tt6773126', 'Tucked (2018)', 'tucked-2018', 2018, 80, 'TUCKED is a raw and tender drama about an aging 80 year old drag queen who forms an unlikely friendship with a younger queen, both struggling with their own issues of gender identity and mortality. As they discover more about each other, they realize how to truly be themselves. It\'s a \'slice of life\' drama about love, loss and friendship; a feel good film with a great charm and sense of humour.', 'English', '2019-09-09 18:55:43'),
(306, 13567, 'tt7531138', 'Only You (2018)', 'only-you-2018', 2018, 119, 'Elena and Jake meet by chance on New Years Eve, arguing for the same taxi. However, instead of going their separate ways after sharing a taxi ,they start a passionate relationship.', 'English', '2019-09-09 15:50:36'),
(307, 13566, 'tt4642192', 'The Keeper (2018)', 'the-keeper-2018', 2018, 120, 'The Keeper tells the extraordinary love story between a young English woman and a German PoW, who together overcome prejudice, public hostility, and personal tragedy. While visiting a PoW camp near Manchester at the end of WWII, Margaret Friar, the daughter of the manager of the local football team, notices young German soldier Bert Trautmann. Her father is so taken by Bert\'s prowess as a goal-keeper that he gets him out of the camp to play for his local team. Margaret and Bert\'s love blossoms despite local hostility and resentment of the German PoWs. In the meantime, Bert\'s heroics in goal are noticed by Manchester\'s City Football Club. Rather than going back to Germany like nearly all the other camp inmates, Bert marries Margaret and signs for Man City. His signing causes outrage to thousands of Man City fans, many of them Jewish. But Margaret wins support from an unexpected direction: Rabbi Altmann, a Man City supporter who fled the Nazis, who publishes an open letter opposing the ...', 'English', '2019-09-09 12:38:17'),
(308, 13564, 'tt0069017', 'Night of the Devils (1972)', 'night-of-the-devils-1972', 1972, 91, 'In this adaptation of Tolstoy\'s story the Wurdulak, a mentally ill patient known as Nicola (Gianni Garko) flashes back to horrifying experiences that he encountered while driving through the country. Upon damaging his car, Nicola sets out for help, only to meet a mysterious family that lives in total fear of someone or something. This evil force slowly penetrates the household and thrusts each of its members into a frenzy of absolute terror!', 'English', '2019-09-09 09:45:09'),
(309, 13563, 'tt0082499', 'Hard Country (1981)', 'hard-country-1981', 1981, 104, 'Ambitious young Jodie wants more out of life than the small Texas country town she lives in has to offer. Jodie realizes that in order to pursue her dreams she will have to leave Texas and move to the big city. However, her shiftless factory worker boyfriend Kyle wants to stay in Texas.', 'English', '2019-09-09 06:28:38'),
(310, 13562, 'tt0074179', 'The Private Eyes (1976)', 'the-private-eyes-1976', 1976, 94, 'Private Eyes revolves the characters in a private detective agency headed by Wong Yuk-See (Michael Hui) with two employees, a stuttered, easily bullied Pighead (Ricky Hui) and secretary/receptionist, Jacky (Angie Chiu). The agency was soon joined by an out-of-work bottling plant employee Lee Kwok-Kit (Sam Hui). Among them, they took on various cases, mostly involving adulterous men and women. Comedic adventures occurred when Wong and Lee carried out these investigations. In the movie\'s finale, the two were trying to capture a blackmailer to a local theater and it ties several earlier sketches together.', 'English', '2019-09-09 03:20:19'),
(311, 13561, 'tt5492496', 'The Combination: Redemption (2019)', 'the-combination-redemption-2019', 2019, 0, 'John Morkos (George Basha) is haunted by the events that led to the death of his brother. As John begins to rebuild his life, he finds solace in the boxing ring at his local gymnasium. Meanwhile, tensions are building on the streets of western Sydney, as a ruthless new crime boss Nas (Johnny Nasser) seeks to expand his empire, and the formation of a radical group of white supremacists threatens to shatter the social fabric of the local community. When the gym becomes a focal point of these gathering forces, and the threat to the community begins to escalate, John must come to terms with his past, make the right choices, and take a stand against overwhelming odds. Sometimes you\'ve got to fight for what\'s right.', 'English', '2019-09-09 00:35:05'),
(312, 13560, 'tt0043117', 'Wagon Master (1950)', 'wagon-master-1950', 1950, 86, 'As Mormon settlers head to the promised land at the San Juan river in Utah, they hire horse traders Travis Blue and Sandy as wagon masters. They have to forge a trail across unknown territory and face many hardships along the way. They quickly come across some stranded travelers, a medicine show run by Dr. A. Locksley Hall which includes the attractive Denver. Along the way however, they are also joined by Shiloh Clegg and his murderous clan of robbers and thieves. An encounter with the Navajo leads to an invitation to their camp but after one of the Clegg boys gets a whipping for attacking one of the Navajo women, Uncle Shiloh plans his revenge. It\'s left to Sandy and Travis to protect the travelers and get them to their destination.', 'English', '2019-09-08 22:01:39'),
(313, 13559, 'tt0048387', 'Moonfleet (1955)', 'moonfleet-1955', 1955, 84, 'Somewhere in eighteenth century Great Britain, noble, but penniless, young boy John Mohune is sent by his dying mother to Moonfleet, to put himself under the protection of a certain Jeremy Fox. The boy discovers that Fox is both a former lover of his mother and the leader of a gang of buccaneers. A strange friendship grows as their adventures go on.', 'English', '2019-09-13 19:24:52'),
(314, 13558, 'tt0030287', 'Jezebel (1938)', 'jezebel-1938', 1938, 104, 'In one of her most renowned roles, Bette Davis portrays Julie Marsden, a spoiled Southern belle who risks losing her suitor with her impetuous behavior. Engaged to successful banker Preston Dillard, Julie pushes him away with her arrogant and contrary ways, leading to a scandalous scene at a major social event and his subsequent departure. When Preston eventually returns and Julie attempts to win him back, she discovers that it may be too late.', 'English', '2019-09-08 19:08:49'),
(315, 13557, 'tt0099776', 'Europa Europa (1990)', 'europa-europa-1990', 1990, 112, 'A Jewish boy, separated from his family in the early days of WWII, poses as a German orphan and is thereafter taken into the heart of the Nazi world as a \'war hero\' and eventually made a Hitler Youth. Although improbabilities and happenstance are cornerstones of the film, it is based upon a true story.', 'English', '2019-09-13 16:30:07'),
(316, 13556, 'tt8394314', 'Witnesses (2019)', 'witnesses-2019', 2019, 97, 'Best friends, Steve and Luke, set out to create a short film for their Film Studies class\' final project. Over their objections, Luke persuades Steve and their film\'s cast members, Natalie and Quint, to deviate from the planned shooting schedule and film their final scene in an abandoned warehouse. Inside they discover a cache of guns and drugs, and find a man savagely beaten and being held hostage by a merciless drug cartel. Before they can make their escape and get help, cartel enforcers return and heinously murder their hostage. Realizing they are not alone, the cartel sicarios hunt down to execute the film students that have witnessed their crime. Relentlessly determined to kill them, the college classmates must evade capture and survive against these hitmen, or become their next victims. Driven down into the massive subterranean labyrinth of the warehouse, the students come across a group of captive women held as human trafficked sex slaves, the cartel\'s secret drug processing ...', 'English', '2019-09-13 13:53:23'),
(317, 13555, 'tt0069131', 'The Public Eye (1972)', 'the-public-eye-1972', 1972, 0, 'When a straight-laced British accountant marries a free-spirited American, he starts trying to change her. His wife doesn\'t keep regular hours, so he suspects an affair and hires a detective (Topol). The wife notices she is being followed, and maintaining their distance she and the detective explore London for 10 days in a game of follow-the-leader without ever exchanging a word.', 'English', '2019-09-08 10:10:02'),
(318, 13552, 'tt0120148', 'Sliding Doors (1998)', 'sliding-doors-1998', 1998, 99, 'In London, the public relation Helen is fired from her position in a PR company. While returning home, she does not catch the train in the subway. But in another possibility of her life, she catches the train in the subway. The story shows two parallel lives of Helen: in one life, she stays with her boyfriend Gerry, and in the other life, she finds that Gerry cheats her with Lydia and falls in love with James Hammerton.', 'English', '2019-09-13 09:16:31'),
(319, 13551, 'tt4935462', 'Amazing Grace (2018)', 'amazing-grace-2018', 2018, 89, 'A documentary presenting Aretha Franklin with choir at the New Bethel Baptist Church in Watts, Los Angeles in January 1972.', 'English', '2019-09-08 07:01:17'),
(320, 13550, 'tt0821642', 'The Soloist (2009)', 'the-soloist-2009', 2009, 117, 'In 2005, the only thing hurting Los Angeles Times columnist Steve Lopez more than his face from a recent bike accident was his pressing need for story ideas. That is when he discovers Nathaniel Ayers, a mentally ill, homeless street musician who possesses extraordinary talent, even through his half-broken instruments. Inspired by his story, Lopez writes an acclaimed series of articles about Ayers and attempts to do more to help both him and the rest of the underclass of LA have a better life. However, Lopez\'s good intentions run headlong in the hard realities of the strength of Ayers\' personal demons and the larger social injustices facing the homeless. Regardless, Lopez and Ayers must find a way to conquer their deepest anxieties and frustrations to hope for a brighter future for both of them.', 'English', '2019-09-08 03:27:02'),
(321, 13549, 'tt0101757', 'Don\'t Tell Mom the Babysitter\'s Dead (1991)', 'dont-tell-mom-the-babysitters-dead-1991', 1991, 0, '', 'English', '2019-09-07 23:49:13'),
(322, 13548, 'tt0116259', 'Extreme Measures (1996)', 'extreme-measures-1996', 1996, 118, 'Thriller about Guy Luthan (Hugh Grant), a British doctor working at a hospital in New York who starts making unwanted enquiries when the body of a man who died in his emergency room disappears. The trail leads Luthan to the door of the eminent surgeon Dr Lawrence Myrick (Gene Hackman), but Luthan soon finds himself in danger from people who want the hospital\'s secret to remain undiscovered.', 'English', '2019-09-07 20:07:01'),
(323, 13547, 'tt5742304', 'Bodies (2016)', 'bodies-2016', 2016, 98, 'Two brothers posing as paramedics kidnap their victims and harvest their organs for the black market. That is until they kidnap a woman they find impossible to kill and it turns out she has more power over them than they over her.', 'English', '2019-09-07 16:56:05'),
(324, 13546, 'tt0221218', 'The Glass House (2001)', 'the-glass-house-2001', 2001, 106, 'When Ruby Baker\'s parents are killed in a car accident, she and her brother, Rhett, must travel to Malibu, to live with Terrence and Erin Glass, their former neighbors. At first, all seems well. Ruby is making new friends at school and Rhett is getting more video games and flashy toys than he\'s ever had in his life. When Ruby speaks to her family\'s estate lawyer, he tells her that her parents have left Rhett and her $4 million. Suddenly, Ruby begins to notice odd behavior from Terry and Erin.', 'English', '2019-09-07 13:48:36'),
(325, 13545, 'tt8244578', 'Christmas Break-In (2018)', 'christmas-break-in-2018', 2018, 87, 'Izzy is an energetic 9-year-old. Overscheduled and running late, Izzy\'s parents can\'t pick her up on-time the last day of school before Christmas break. A blizzard complicates the matter, but not as much as a pair of bad guys who are freezing in an ice cream truck. The school\'s janitor is kidnapped by the intruders, and it\'s up to Izzy to save the day.', 'English', '2019-09-07 11:10:59'),
(326, 13544, 'tt6643608', 'Robin: Watch for Wishes (2018)', 'robin-watch-for-wishes-2018', 2018, 80, 'A man of words is forced to become a man of action as John discovers the secret bucket list of his ill son Robin. The two abscond from the hospital to fulfill the boy\'s greatest wishes - as the police pursue John for kidnapping.', 'English', '2019-09-07 08:55:35'),
(327, 13543, 'tt2435970', 'Primrose Lane (2015)', 'primrose-lane-2015', 2015, 89, 'The decision to enter an unlocked home triggers an irreversible chain of events for Robin and Chris, catapulting them into an alternate reality where they are not as alone as they think.', 'English', '2019-09-07 06:28:27'),
(328, 13542, 'tt8685520', 'Dauntless: The Battle of Midway (2019)', 'dauntless-the-battle-of-midway-2019', 2019, 0, 'By June 1942, the Japanese Navy has swept across the Pacific. In an effort to change the course of the war, a United States carrier group is positioned off the coast of Midway, tasked with springing a trap on the enemy. During this pivotal battle, the two-man crew of a U.S. Navy dive bomber is forced to ditch in the sea. Set adrift, the men look towards their comrades for rescue; namely, the ragtag crew of a PBY Catalina, who are sent to search for survivors. Amid the vast openness of the Pacific, with days passing and the chance of rescue fading, the men are forced to face their own mortality.', 'English', '2019-09-07 03:48:07'),
(329, 13541, 'tt9063470', 'Juug Gone Wrong (2018)', 'juug-gone-wrong-2018', 2018, 103, 'chronicles the life of two cousins with similar hustles but different methods. Both work in the pharmaceutical field, one legally and one illegally. - He runs into his illegitimate street pharmacist cousin, Yayo, who has run his course of illegal \"juugs\" into the ground.', 'English', '2019-09-07 01:05:16'),
(330, 13540, 'tt4729426', 'The Last Photograph (2017)', 'the-last-photograph-2017', 2017, 85, 'The film centres on a random act of theft that has put Tom Hammond\'s life into a tailspin. Stolen from his bookshop is Tom\'s most treasured possession, a photograph of him with his son Luke...their last moment of shared happiness. THE LAST PHOTOGRAPH is set between London in 2003, and a dark night in 1988 when Pan Am 103 was blown out of the sky over Lockerbie.', 'English', '2019-09-06 22:30:03'),
(331, 13539, 'tt8783798', 'Next Level (2019)', 'next-level-2019', 2019, 95, 'The film centers on teens who compete for best performer of the summer while at Next Level, a specialized dance/hip-hop/songwriting performing arts program.', 'English', '2019-09-13 06:54:22'),
(332, 13537, 'tt3781476', 'Monster Hunt (2015)', 'monster-hunt-2015', 2015, 117, 'In an ancient world where monsters rule the land while humans keep to their own kingdom, a baby monster, Wuba, is born to a human father and monster queen. When mortals and creatures alike set out to capture the newborn, Wuba\'s adventure begins. The cute baby monster Huba is the child of a human man and a monster queen, threatened by both monster-hating humans and monsters attempting to capture the new-born in an ancient world based on medieval China.', 'English', '2019-09-06 13:21:42'),
(333, 13536, 'tt8266310', 'Blinded by the Light (2019)', 'blinded-by-the-light-2019', 2019, 118, 'In 1987 Britain, Javed Khan is a British-Pakistani college arts student in Luton in a family with a domineering father. Depressed by his oppressive family life and feeling he has no future in a hostile community, a newfound friend introduces Javed to the music of Bruce Springsteen. Touched by the rock star\'s powerfully eloquent affinity of his own feelings, Javed is inspired to reach out for his own dreams with his own talents. However, although Javed finds friends he never expected in this personal quest, he also finds himself butting heads with his newly unemployed father who stubbornly refuses to understand his son\'s new aspirations. In this conflict of values in a troubled time, Javed must decide what is truly important to him while his family struggles to understand what has changed and what remains with a new generation feeling born to run.', 'English', '2019-09-13 02:04:19'),
(334, 13535, 'tt6107548', 'Late Night (2019)', 'late-night-2019', 2019, 102, 'Katherine Newbury (Emma Thompson) is a pioneer and legendary host on the late-night talk-show circuit. When she\'s accused of being a \"woman who hates women,\" she puts affirmative action on the to-do list, and --presto!--Molly (Mindy Kaling) is hired as the one woman in Katherine\'s all-male writers\' room. But Molly might be too little too late, as the formidable Katherine also faces the reality of low ratings and a network that wants to replace her. Wanting to prove she\'s not merely a diversity hire who\'s disrupting the comfort of the brotherhood, Molly is determined to help Katherine revitalize her show and career--and possibly effect even bigger change at the same time.', 'English', '2019-09-12 23:16:17'),
(335, 13534, 'tt4310022', 'Boy Genius (2019)', 'boy-genius-2019', 2019, 0, 'A twelve year-old child prodigy teams up with a quirky retiree to solve a crime and save his family from splitting up.', 'English', '2019-09-12 20:58:24'),
(336, 13533, 'tt2866708', 'Strange But True (2019)', 'strange-but-true-2019', 2019, 96, 'A woman who, five years after the tragic death of her boyfriend, arrives on the doorstep of his family to tell them she is pregnant with his child. Though skeptical, the family find themselves trying to prove her right, only to discover that the truth is much more terrifying than they could have imagined.', 'English', '2019-09-06 08:26:01'),
(337, 13532, 'tt6143782', 'Hex (2018)', 'hex-2018', 2018, 85, 'A couple\'s holiday romance is thrown into chaos as they are afflicted by a malicious force.', 'English', '2019-09-12 19:00:26'),
(338, 13531, 'tt8510350', 'Satanic Panic (2019)', 'satanic-panic-2019', 2019, 85, 'A pizza delivery girl at the end of her financial rope has to fight for her life - and her tips - when her last order of the night turns out to be high society Satanists in need of a virgin sacrifice.', 'English', '2019-09-06 05:45:34'),
(339, 13530, 'tt8655738', 'Eternal Code (2019)', 'eternal-code-2019', 2019, 105, 'After a revolutionary invention with great implications Bridget finds a character flaw in the company they\'ve partnered with to develop the prototype that could be the fountain of youth. When she pulls the plug and step away from their original deal she quickly realizes they will stop at nothing to get it back. After her family gets kidnapped to sway a favorable vote their hopes rely on their teen daughter Miranda and her unlikely allies Corey (a suicidal military veteran) and Stephanie (a prostitute).', 'English', '2019-09-12 16:45:49'),
(340, 13529, 'tt7869070', 'The Fanatic (2019)', 'the-fanatic-2019', 2019, 88, 'The story is inspired by a real-life fan who pursued Limp Bizkit\'s frontman Fred Durst many years ago, and the screenplay was', 'English', '2019-09-12 14:43:07'),
(341, 13528, 'tt0092676', 'Bloody New Year (1987)', 'bloody-new-year-1987', 1987, 0, 'Five shipwrecked English teenagers take refuge in an island hotel that is decorated for New Years. The problem is, it\'s early summer, and soon enough, even the walls themselves are striking out against them...', 'English', '2019-09-06 02:43:29'),
(342, 13527, 'tt0092074', 'TerrorVision (1986)', 'terrorvision-1986', 1986, 83, 'Stan installs satellite TV for his family, but, soon, he picks up a signal from another planet and his television system becomes the gateway between the 2. A creature comes to his apartment and only their son Sherman sees it, but his parents don\'t believe the boy.', 'English', '2019-09-05 23:45:42'),
(343, 13526, 'tt0092933', 'Dudes (1987)', 'dudes-1987', 1987, 0, 'Two punks from the big city, traveling across the country in a Volkswagen bug, embrace the western ethos when they must take revenge against a group of rednecks for killing their friend in this lighthearted road movie. Along the way, they enlist the help of a young woman who runs a wrecking service.', 'English', '2019-09-05 20:33:50'),
(344, 13525, 'tt0074811', 'The Tenant (1976)', 'the-tenant-1976', 1976, 126, 'In Paris, the shy bureaucrat Trelkovsky rents an old apartment without bathroom where the previous tenant, the Egyptologist Simone Choule, committed suicide. The unfriendly concierge (Shelley Winters) and the tough landlord Mr. Zy establish stringent rules of behavior and Trelkovsky feels ridden by his neighbors. Meanwhile he visits Simone in the hospital and befriends her girlfriend Stella. After the death of Simone, Trelkovsky feels obsessed for her and believes his landlord and neighbors are plotting a scheme to force him to also commit suicide.', 'English', '2019-09-12 11:39:05'),
(345, 13524, 'tt3214240', 'Snow Bride (2013)', 'snow-bride-2013', 2013, 84, 'Greta Kaine (Katrina Law) is always in search of juicy gossip. As a tabloid reporter of gossip in Los Angeles, it\'s her job to expose the rich and famous. So when word gets out that the late Senator Tannehill\'s sons might be proposing marriage at the families Big Bear compound during Christmas, Greta and her chief rival Wes (Tom Lenk) are challenged by their old-school editor to get the scoop. There\'s incentive to be the first, too -- the editorship of the magazine\'s new online incarnation. Greta\'s assistant tells her that Wes has a head start to snowy Big Bear, so she dashes to the mountain resort. When she mistakenly ends up as a guest of the family, she\'s in the middle of what could be her best story yet! However, she soon discovers that the family, including matriarch Maggie Tannenhill (Patricia Richardson) and caretaker Peters (Robert Curtis Brown) are more down-to-earth than she ever gave them credit for. Increasingly guilt-ridden about her game of subterfuge, Greta must make a ...', 'English', '2019-09-05 03:40:34'),
(346, 13523, 'tt8615816', 'Occult Angel (2018)', 'occult-angel-2018', 2018, 66, 'Beautiful, mysterious - the occult history Jack Angel uncovers in the city of Bath is astonishing. But the discoveries become increasingly creepy and disturbing - and the \'final revelation\' will change the way you see the world. This film was made by Andy Roberts between 2008 and the present. In 2015 after a breakdown he re-cut the footage - adding disturbing messages and hidden clues.', 'English', '2019-09-05 01:10:20'),
(347, 13522, 'tt0395972', 'North Country (2005)', 'north-country-2005', 2005, 126, '1989. Josey Aimes takes her two kids, Sammy and Karen, and leaves her abusive husband Wayne, to return to her northern Minnesota home town. On a chance meeting with her old friend Glory Dodge who works as a driver and union rep at the mine operated by Pearson Taconite and Steel, Josey decides to work at the mine as well, work that is dominated by men in number and in tone. She does so to be able to stand on her own two feet for the first time in her life, something she probably could not have done if she remained in a job washing hair at a beauty salon. Working at the mine does not sit well with her father, Hank Aimes, who also works at the mine and who, like the other male workers, believes she is taking a job away from a man. Hank has believed that all Josey\'s problems are of her own doing, ever since she, unmarried, had Sammy while she was still in high school. Josey has always stated that she does not know who Sammy\'s biological father is, which fosters Hank\'s attitude about her. ...', 'English', '2019-09-04 22:19:32'),
(348, 13521, 'tt8284860', 'The Huntress: Rune of the Dead (2019)', 'the-huntress-rune-of-the-dead-2019', 2019, 105, '811 AD, a family, isolated in their home, deep in the woods a few days travel from Birka. They are poor. The hunting and fishing has been bad for some time, and the father, Joar, takes the desperate measure of going on a Viking raid. Joar does not return for a long time, and the family starts to fear he never will. Runa, the oldest daughter, takes over her father\'s chores in his absence. She misses him dearly and nourishes a tender hope that he, once again, will return to them. But in her heart somehow she knows the suffering of the family has just begun. There is something in the air, something in the water, the wind and in the soil. Runa is becoming aware of something vile, something dangerous out in the forest. One day when she is out hunting she finds a bleeding man, a warrior, almost unconscious. She brings him inside and the family tends to his wounds. As he heals, she realizes he is sent to protect the family from an approaching evil. And he brings news of her father.', 'English', '2019-09-04 19:13:37'),
(349, 13520, 'tt4239726', 'Tanna (2015)', 'tanna-2015', 2015, 104, 'Set on a remote Pacific island, covered in rain forest and dominated by an active volcano, this heartfelt story, enacted by the Yakel tribe, tells of a sister\'s loyalty, a forbidden love affair and the pact between the old ways and the new.', 'English', '2019-09-11 21:15:25'),
(350, 13519, 'tt2088893', 'Shell (2012)', 'shell-2012', 2012, 0, '', 'English', '2019-09-04 16:27:38'),
(351, 13518, 'tt0064072', 'Battle of Britain (1969)', 'battle-of-britain-1969', 1969, 132, 'Historical reenactment of the air war in the early days of World War II for control of the skies over Britain as the new Luftwaffe and the Royal Air Force determine whether or not an invasion can take place.', 'English', '2019-09-11 17:59:05'),
(352, 13517, 'tt0099422', 'Dick Tracy (1990)', 'dick-tracy-1990', 1990, 105, 'All Tess Trueheart wants is to settle down to a quiet life with her boyfriend, detective Dick Tracy. But there\'s something pretty rotten going on in town, with someone pretty rotten behind it, and Tracy has his hands full with the likes of villain Big Boy Caprice and with the almost irresistible Breathless Mahoney.', 'English', '2019-09-11 14:40:30'),
(353, 13516, 'tt3699104', 'Wine Wars (2017)', 'wine-wars-2017', 2017, 90, 'There are secrets hidden behind an auction of whopping priced red wine.', 'English', '2019-09-04 13:59:34'),
(354, 13515, 'tt0172711', 'Legend of the Wolf (1997)', 'legend-of-the-wolf-1997', 1997, 94, 'Fung Hin-Man (Donnie Yen) is a legendary warrior who lives now elderly, along with a friend, their memories and their remorse. When a young man comes to him, Fung tells him the story of when he saved the villagers from their oppressors and speaks of the death of the woman he loved. But the young man does not know that it is actually a hit man who wants to kill Fung for the fame that this murder would bring.', 'English', '2019-09-04 12:10:31'),
(355, 13513, 'tt6619250', 'Beloved Beast (2018)', 'beloved-beast-2018', 2018, 173, 'A young girl befriends a dangerous escaped mental patient after the death of her parents.', 'English', '2019-09-04 07:27:55'),
(356, 13512, 'tt4192552', 'Stained (2019)', 'stained-2019', 2019, 102, 'A terrifying, modern adaptation of Shakespeare\'s Macbeth set in Scotland, CA. Scorning the mediocrity of their mundane lives, John and Jane Macbeth carry out a horrific plan to make the American dream a reality.', 'English', '2019-09-04 09:51:03'),
(357, 13511, 'tt8585940', 'The Utah Cabin Murders (2019)', 'the-utah-cabin-murders-2019', 2019, 85, 'In this terrifying true life tale, a family\'s peaceful vacation at a remote cabin in Utah is shattered when they return from a day of exploring to find two masked intruders in their home. What begins as a robbery soon escalates into violence and two of the family are brutally murdered. As night falls only teenage sisters Linnea and Tina remain alive, battling for survival against their sadistic captors. But as the sun comes up the tormented teens find the strength to fight back and the intruders get more than they bargained for.', 'English', '2019-09-04 04:59:03'),
(358, 13510, 'tt7639528', 'Gintama 2: Rules Are Made to Be Broken (2018)', 'gintama-2-rules-are-made-to-be-broken-2018', 2018, 134, 'The Yorozuya gang returns to protect the country\'s shogun when the Shinsengumi police force finds itself in a crisis.', 'English', '2019-09-04 06:12:38'),
(359, 13509, 'tt8485548', 'Clownado (2019)', 'clownado-2019', 2019, 0, 'Cursed demonic circus clowns set out on a vengeful massacre using tornadoes. A stripper, Elvis impersonator, truck driver, teen runaway, and a dude get caught in the supernatural battle between femme fatal and the boss clown from hell.', 'English', '2019-09-04 02:40:57'),
(360, 13507, 'tt0209110', 'Lost, Lost, Lost (1976)', 'lost-lost-lost-1976', 1976, 180, 'Artist-writer-poet-filmmaker Jonas Mekas documents his early years building a life and discovering an arts community in New York.', 'English', '2019-09-04 00:07:39'),
(361, 13505, 'tt0079146', 'The Secret (1979)', 'the-secret-1979', 1979, 85, 'A real murder case which was complicated by the minage \' trois relationship of the victim and the main suspects. As different witnesses narrated their conflicting stories, the case seemed set to lead to nowhere; especially when the real identity of the dead person was finally discovered.', 'English', '2019-09-04 02:33:38'),
(362, 13504, 'tt0139491', 'The Negro Soldier (1944)', 'the-negro-soldier-1944', 1944, 43, 'Documentary focusing on the contributions to the American war effort of African-American soldiers.', 'English', '2019-09-04 00:56:05'),
(363, 13503, 'tt0064287', 'The Angels of the Street (1969)', 'the-angels-of-the-street-1969', 1969, 0, 'Jule Nickels, a long-established mobster in St. Pauli, Hamburgs well known demi-monde, has to deal with a new mack in his own territory. Jule tries to get him out of town, but when one of Jule\'s prostitutes is murdered by a client, both mobsters try to hunt him down to preserve the peace and keep out the cops. But peace doesn\'t come easy in St. Pauli.', 'English', '2019-09-03 22:37:06'),
(364, 13502, 'tt0056053', 'Hallelujah the Hills (1963)', 'hallelujah-the-hills-1963', 1963, 0, 'After courting a woman called Vera for seven years, friends Jack and Leo decide to seclude themselves in the Vermont woods near her home, when she finally decides to accept a third man called Gideon.', 'English', '2019-09-03 20:15:05'),
(365, 13501, 'tt8483220', 'Steam Room Stories: The Movie! (2019)', 'steam-room-stories-the-movie-2019', 2019, 95, 'Failing cosmetics magnate Sally Fay will stop at nothing to possess the waters of the Steam Room to help lift her sagging empire. What she doesn\'t count on is the Steam Room Guys banding together to thwart her evil plans.', 'English', '2019-09-03 21:37:47'),
(366, 13500, 'tt4465572', 'American Woman (2018)', 'american-woman-2018', 2018, 111, 'In a small, blue-collar town in Pennsylvania, a 32-year-old woman\'s teen daughter goes missing and she is left to raise her infant grandson alone. The story is told over the course of 11 years, from the time her daughter vanishes, through the the trials-and-tribulations of subsequent years looking for closure, leading up the long-awaited discovery of the truth.', 'English', '2019-09-03 18:45:37'),
(367, 13499, 'tt3246874', 'Wish Man (2019)', 'wish-man-2019', 2019, 107, 'Frank Shankwitz, an Arizona motorcycle cop with a troubled past, survives a near-fatal accident during a high-speed pursuit. As part of Frank\'s rehabilitation, police chief Sgt. Eddie Newman asks him to spend time with a terminally ill little boy, Michael, whose dying wish is to be a Highway Patrol motorcycle officer. To Michael, Frank is his hero, and an unlikely friendship is born. The boy inspires Frank to follow a new path, which leads to the creation of the Make-A-Wish foundation.', 'English', '2019-09-03 15:31:53'),
(368, 13498, 'tt7595276', 'Survival Box (2019)', 'survival-box-2019', 2019, 0, 'Seven teenagers. Five months. Twenty feet underground. No exit. The gripping story of a handful of high school kids trapped in a wealthy Philadelphia family\'s backyard bunker.', 'English', '2019-09-03 18:12:45'),
(369, 13497, 'tt0091829', 'Rawhead Rex (1986)', 'rawhead-rex-1986', 1986, 86, 'Ireland will never be the same after Rawhead Rex, a particularly nasty demon, is released from his underground prison by an unwitting farmer. The film follows Rex\'s cross country rampage, while a man struggles to stop it.', 'English', '2019-09-03 15:57:01'),
(370, 13496, 'tt0077355', 'Coma (1978)', 'coma-1978', 1978, 113, 'A young doctor at a hospital, Susan Wheeler (played by GeneviÃ¨ve Bujold), starts noticing a pattern of strange occurrences with patients. Healthy patients are suddenly developing complications and ending up in comas. She starts investigating and what she reveals is astonishing.', 'English', '2019-09-03 13:16:10'),
(371, 13495, 'tt2806788', 'Fukrey (2013)', 'fukrey-2013', 2013, 139, 'College. Three of the most important years of your life. Three years of studies (at times) and sheer indulgence. Indulgence in all the little pleasures that a carefree life has to offer. But it isn\'t always about ragging, fuchacha parties, college fests, races, and churning out ways to whack some extra pocket money from your parents. It\'s sometimes hard, ugly, and complicated. More so, when you really need to get admission in the coolest college in town and you know you don\'t deserve it. And to top that, you get yourself involved in the most bizarre stations that could crack you into pieces before you could crack it.', 'English', '2019-09-03 10:12:55'),
(372, 13494, 'tt3244744', 'No Land No Food No Life (2013)', 'no-land-no-food-no-life-2013', 2013, 75, 'No Land No Food No Life is a hard-hitting film which explores sustainable peasant and community agriculture and the urgent calls for an end to corporate global land grabs.', 'English', '2019-09-03 07:47:01'),
(373, 13493, 'tt0034891', 'In Which We Serve (1942)', 'in-which-we-serve-1942', 1942, 0, 'This is the story of a British Naval ship, H.M.S. Torrin, from its construction to its sinking in the Mediterranean during action in World War II. The ship\'s first and only commanding officer is the experienced Captain E.V. Kinross, who trains his men not only to be loyal to him, but to the country, and most importantly, to themselves. They face challenges at sea, and also at home. They lose some of their shipmates in action, and some of their loved ones in the devastation that is the blitz. Throughout it all, the men of the Torrin serve valiantly and heroically.', 'English', '2019-09-03 05:19:26'),
(374, 13492, 'tt0046903', 'DÃ©sirÃ©e (1954)', 'desiree-1954', 1954, 110, 'In Marseilles, France in 1794, Desiree Clary, a young millinery clerk, becomes infatuated with Napoleon Bonaparte, but winds up wedding Genaral Jean-Baptiste Berandotte, an aid to Napoleon who later joins the forces that bring about the Emperor\'s downfall. Josephine Beauharnais, a worldly courtesan marries Napoleon and becomes Empress of France, but is then cast aside by her spouse when she proves unable to produce an heir to the throne.', 'English', '2019-09-03 02:42:30'),
(375, 13491, 'tt0066826', 'The Touch (1971)', 'the-touch-1971', 1971, 115, 'A seemingly happy Swedish housewife and mother begins an adulterous affair with a foreign archaeologist who is working near her home. But he is an emotionally scarred man, a Jewish survivor from a concentration camp who found refuge in the U.S.,and, consequently, their relationship will be painfully difficult.', 'English', '2019-09-03 11:41:25'),
(376, 13490, 'tt0107969', 'Rising Sun (1993)', 'rising-sun-1993', 1993, 125, 'At the offices of a Japanese corporation, during a party, a woman, who\'s evidently a professional mistress, is found dead, apparently after some rough sex. A police detective, Web Smith is called in to investigate, but before getting there, he gets a call from someone who instructs him to pick up John Connor, a former police Captain and expert on Japanese affairs. When they arrive there, Web thinks that everything is obvious, but Connor tells him that there\'s a lot more going on.', 'English', '2019-09-03 07:16:56'),
(377, 13489, 'tt7472330', 'Morning, Noon & Night (2018)', 'morning-noon-night-2018', 2018, 101, '\"Everybody struggles with something. The real question asked is how does anyone get through life? After all, reality is just a crutch for people who can\'t handle drugs.\"', 'English', '2019-09-03 04:02:19'),
(378, 13488, 'tt8228172', 'The Furies (2019)', 'the-furies-2019', 2019, 82, 'A woman is kidnapped and finds herself an unwilling participant in a deadly game where women are hunted by masked men.', 'English', '2019-09-03 00:39:10'),
(379, 13487, 'tt0086640', 'Seeding of a Ghost (1983)', 'seeding-of-a-ghost-1983', 1983, 0, '', 'English', '2019-09-02 22:18:54');
INSERT INTO `imdbinfo` (`id`, `movie_id`, `imdb_code`, `title_long`, `slug`, `year`, `movie_runtime`, `description_full`, `language`, `date_uploaded`) VALUES
(380, 13486, 'tt0023293', 'The Old Dark House (1932)', 'the-old-dark-house-1932', 1932, 72, 'Seeking shelter from a pounding rainstorm in a remote region of Wales, several travellers are admitted to a gloomy, foreboding mansion belonging to the extremely strange Femm family. Trying to make the best of it, the guests must deal with their sepulchral host, Horace Femm and his obsessive, malevolent sister Rebecca. Things get worse as the brutish manservant Morgan gets drunk, runs amuck and releases the long pent-up brother Saul, a psychotic pyromaniac who gleefully tries to destroy the residence by setting it on fire.', 'English', '2019-09-03 01:40:19'),
(381, 13485, 'tt7468616', 'The Boat (2018)', 'the-boat-2018', 2018, 100, 'A solo sailor is locked inside the head of a sailboat which is under steam on autopilot.', 'English', '2019-09-02 23:15:48'),
(382, 13484, 'tt3696610', 'Stuck (2017)', 'stuck-2017', 2017, 90, 'A New York City subway train stops in the tunnel beneath the city with six complete strangers stuck inside the rear car. The strangers are a cross section of New Yorkers, of different race, culture and age. The emotions of the trapped, frustrated strangers explode, as the subway car becomes a kind of magical, musical, conduit cell. A place where strangers reveal through song more of themselves than any of them ever could have imagined.', 'English', '2019-09-02 21:06:53'),
(383, 13483, 'tt2788556', 'Gemma Bovery (2014)', 'gemma-bovery-2014', 2014, 99, 'Martin, an ex-Parisian well-heeled hipster passionate about Gustave Flaubert who settled into a Norman village as a baker, sees an English couple moving into a small farm nearby. Not only are the names of the new arrivals Gemma and Charles Bovery, but their behavior also seems to be inspired by Flaubert\'s heroes.', 'English', '2019-09-02 18:28:23'),
(384, 13482, 'tt4847546', 'Blood Feast (2016)', 'blood-feast-2016', 2016, 90, 'Fuad Ramses and his family have moved from the United States to France, where they run an American diner. Since business is not going too well, Fuad also works night shifts in a museum of ancient Egyptian culture. During these long, lonely nights he is repeatedly drawn to a statue representing the seductive ancient goddess ISHTAR. He becomes more and more allured by the goddess as she speaks to him in visions. Eventually he succumbs to her deadly charms. After this pivotal night, Fuad begins a new life, in which murder and cannibalism become his daily bread. He starts to prepare a ritual FEAST to honor his new mistress, a lavish affair dripping with BLOOD, organs, and intestines of human victims. As butchered bodies are heaped upon the Altar of Ishtar, Fuad slowly slips further into madness, until he is no more than the goddess\'s puppet; and she thirsts for the blood of Fuad\'s wife and daughter too.', 'English', '2019-09-02 13:46:04'),
(385, 13481, 'tt0045808', 'Genevieve (1953)', 'genevieve-1953', 1953, 86, 'It\'s time for the annual London to Brighton antique car rally, and Alan McKim and Ambrose Claverhouse are not going to let their friendship stop them from trying to humiliate each other. Along the way, some old jealousies are kindled to the point where the two men decide to have a \"friendly\" wager on who will be the first back to London. Once the competitive juices get all fired up, however, it quickly becomes a nasty, hotly-contested affair. Ambrose\'s companion must suffer through her \"maiden voyage\" on the rally, while Mrs. McKim, on the other hand, is a long-time sufferer of her husband\'s obsession.', 'English', '2019-09-02 11:13:17'),
(386, 13480, 'tt0019702', 'Blackmail (1929)', 'blackmail-1929', 1929, 85, 'Alice White is the daughter of a shopkeeper in 1920s London. Her boyfriend, Frank Webber is a Scotland Yard detective who seems more interested in police work than in her. Frank takes Alice out one night, but she has secretly arranged to meet another man. Later that night, Alice agrees to go back to his flat to see his studio. The man has other ideas, and as he tries to rape Alice, she defends herself and kills him with a bread knife. When the body is discovered, Frank is assigned to the case, he quickly determines that Alice is the killer, but so has someone else, and blackmail is threatened.', 'English', '2019-09-02 06:29:43'),
(387, 13479, 'tt0095302', 'High Hopes (1988)', 'high-hopes-1988', 1988, 108, 'Slice-of-life look at a sweet working-class couple in London, Shirley and Cyril, his mother, who\'s aging quickly and becoming forgetful, mum\'s ghastly upper-middle-class neighbors, and Cyril\'s pretentious sister and philandering husband. Shirley wants a baby, but Cyril, who reads Marx and wants the world to be perfect, is reluctant. Cyril\'s mum locks herself out and must ask her snooty neighbors for help. Then Cyril\'s sister Valerie stages a surprise party for mum\'s 70th birthday, a disaster from start to finish. Shirley holds things together, and she and Cyril may put aside her Dutch cap after all.', 'English', '2019-09-02 07:49:59'),
(388, 13478, 'tt5783630', 'The Narcissists (2017)', 'the-narcissists-2017', 2017, 82, 'Oliver and Cassi, a couple from Brooklyn, spend the day apart, meandering NYC, each with their respective best friend, trying to decide whether or not they should stay together and renew their lease or call it quits after five years.', 'English', '2019-09-02 01:28:01'),
(389, 13477, 'tt8483272', 'Strike (2018)', 'strike-2018', 2018, 100, 'Mungo Morrison is a young mole who is due to begin work at his proud father\'s side in their hometown\'s legendary gold mine. While his best friends are excited to be in the mine, Mungo secretly dreams of becoming a professional footballer. However, desperate not to upset his father, as well as being a small mole and unable to play football in bright light, Mungo sadly resigns himself to life as a miner. When the mine is forced to shut down after a mysterious accident, an evil and gold-obsessed supervillain known only as \'The Boss\', attempts to bully the townsfolk into selling him the mine. Against all odds and with a little help from his whacky friends, Mungo begins an epic adventure of thrills, laughs, action and peril, as he hurtles towards the Wild Cup football finals in Russia and a final, breathtaking showdown with \'The Boss.\'', 'English', '2019-09-02 04:50:38'),
(390, 13476, 'tt3794392', 'After the Reality (2016)', 'after-the-reality-2016', 2016, 85, 'The life of a contestant on a \'Bachelorette\' style reality show is thrown into turmoil when the sudden death of his father forces him to quit the series prematurely and reconnect with his estranged sister at the family cabin.', 'English', '2019-09-02 02:15:57'),
(391, 13475, 'tt6077540', 'Yesterday\'s Girl (2018)', 'yesterdays-girl-2018', 2018, 89, 'A young woman awakens in a world devastated by meteorite strike, yet she recalls her own death 70 years ago. Searching for answers she finds plague, destruction, madness and a terrifying adversary, who confronts her with a long forgotten memory and an impossible choice.', 'English', '2019-09-01 23:55:16'),
(392, 13474, 'tt0056632', 'The Ugly American (1963)', 'the-ugly-american-1963', 1963, 120, 'An intelligent, articulate scholar, Harrison MacWhite, survives a hostile Senate confirmation hearing at the hands of conservatives to become ambassador to Sarkan, a southeast Asian country where civil war threatens a tense peace. Despite his knowledge, once he\'s there, MacWhite sees only a dichotomy between the U.S. and Communism. He can\'t accept that anti-American sentiment might be a longing for self-determination and nationalism. So, he breaks from his friend Deong, a local opposition leader, ignores a foreman\'s advice about slowing the building of a road, and tries to muscle ahead. What price must the country and his friends pay for him to get some sense?', 'English', '2019-09-01 20:30:31'),
(393, 13473, 'tt0358294', 'Into the Sun (2005)', 'into-the-sun-2005', 2005, 0, '', 'English', '2019-09-01 18:11:10'),
(394, 13472, 'tt6982562', 'Nobody Famous (2018)', 'nobody-famous-2018', 2018, 90, 'A group of aspiring actors\' cottage weekend takes a turn for the worst when one of them finds out they\'ve booked a blockbuster role, and the rest of the group\'s jealously takes hold where there\'s no one else around.', 'English', '2019-09-01 17:36:43'),
(395, 13471, 'tt0065063', 'Take the Money and Run (1969)', 'take-the-money-and-run-1969', 1969, 85, 'This film is presented as a documentary on the life of an incompetent, petty criminal called Virgil Starkwell. It describes the early childhood and youth of Virgil, his failure at a musical career, and his obsession with bank robberies. The film uses a voice over narrative and interviews with his family, friends and acquaintances.', 'English', '2019-09-01 14:55:59'),
(396, 13470, 'tt3058674', 'VANish (2015)', 'vanish-2015', 2015, 79, 'A kidnapped young woman is forced on a road trip full of murder and mayhem that takes place entirely in her captor\'s getaway van.', 'English', '2019-09-01 07:47:03'),
(397, 13469, 'tt0430770', 'The Women (2008)', 'the-women-2008', 2008, 114, 'Based on a very clever comedy by Claire Booth, wife of Time Publisher Henry Luce and later Ambassador to Italy. One of the surprises was an all-woman cast, novel in the 1930\'s. And although there were no men in the cast, most of the dialog was about them. The story is rather thin and depended on the fact that divorce, in the 1930\'s, was not only difficult but almost impossible in New York. Mrs. Stephen Haynes learns that her husband is seeing a salesgirl at Saks, and reluctantly divorces him, abetted by her friends, all of whom have romantic problems of their own. In the 1930\'s New York women who could afford it went to Nevada, where residency could be established quickly and divorce was relatively easy. The 1939 film, starring Norma Shearer, Paulette Goddard, Rosalind Russell, and Joan Crawford, was a hit. This one, with an even better looking cast, is definitely not, largely because someone tried to move a 1930\'s situation comedy into the present.', 'English', '2019-09-01 07:20:15'),
(398, 13468, 'tt2509922', 'Where the Trail Ends (2012)', 'where-the-trail-ends-2012', 2012, 88, 'Freeride Entertainment, producers of the New World Disorder series, are pleased to announce the beginnings of a new project taking mountain biking back to the roots of freeriding. Where the trail ends - is the start of a new feature film based on the natural terrain progression of riding in remote international locations. Freeride is excited about their new project which started deep in the Gobi desert in China earlier this year. Featured riders from this first expedition were Darren Berrecloth, Kurt Sorge, and James Doerfling.', 'English', '2019-09-01 05:14:15'),
(399, 13467, 'tt3505754', 'Bachelors (2015)', 'bachelors-2015', 2015, 86, 'Womanizing advertising executive Aaron tries to stop best friend Sean from falling into the \"eternal damnation\" of marriage by throwing a wild bachelor party to remind Sean of the joys of bachelorhood.', 'English', '2019-09-01 01:49:39'),
(400, 13466, 'tt0071521', 'Freebie and the Bean (1974)', 'freebie-and-the-bean-1974', 1974, 113, 'Freebie and Bean, two San Francisco police detectives, have one goal in life: to bring down Red Meyers, a local hijacking boss. After many fruitless months they finally collect an important piece of evidence. However, before they can get an arrest warrant, they hear the news of the hitman being hired to kill Meyers.', 'English', '2019-09-01 01:54:16'),
(401, 13465, 'tt0074608', 'Harry and Walter Go to New York (1976)', 'harry-and-walter-go-to-new-york-1976', 1976, 115, 'Two hopelessly-out-of-their-class conmen attempt to pull off the largest bank heist of the nineteenth century. They gain the enmity of the most famous bank robber in the world, and the affection of a crusading newspaperwoman.', 'English', '2019-08-31 23:15:03'),
(402, 13464, 'tt5127398', 'Planeta Singli (2016)', 'planeta-singli-2016', 2016, 136, 'He is one of the top celebrities in the country: a fast-talking TV host, who can joke his way out of any situation. Women want to be with him, men want to be like him. He is looking for a new topic to discuss in his popular talk-show. She is a teacher at a musical school - a timid girl looking for Mr. Perfect on an internet dating site. He will help her realise her potential and teach her how to recognise various types of men for what they are, she will teach him what real life is about. The show will become a huge hit. It seems they are destined to fall in love and be together, but one day she actually does meet Mr. Perfect on the net.', 'English', '2019-08-31 22:11:52'),
(403, 13463, 'tt0156639', 'The Big Tease (1999)', 'the-big-tease-1999', 1999, 86, 'Flamboyant Glasgow hairdresser, Crawford Mackinzie, gets a letter from the World Hairdresser International Federation inviting him to its prestigious annual contest in L.A. Filmmaker Martin Samuels is making a fly-on-the-wall documentary about Crawford; he and the crew go too. After maxing out his credit card at the Century Plaza Hotel, Crawford discovers he\'s been invited to participate in the audience, not the contest; he tries every angle imaginable to get in the competition: he phones fellow Scot Sean Connery, he gets a union card, he asks the reigning champion for help, and he connects with Connery\'s publicist, who\'s having a bad hair day. Will he succeed, for the little people?', 'English', '2019-08-31 20:41:03'),
(404, 13462, 'tt0100944', 'The Witches (1990)', 'the-witches-1990', 1990, 91, 'A young boy, recently orphaned, is taken to England by his grandmother. At a hotel in which they are staying, a group of witches have gathered to prepare a plot to rid England of all children.', 'English', '2019-08-31 18:45:07'),
(405, 13461, 'tt0025878', 'The Thin Man (1934)', 'the-thin-man-1934', 1934, 91, 'After a four year absence, one time detective Nick Charles returns to New York with his new wife Nora and their dog, Asta. Nick re-connects with many of his old cronies, several of whom are eccentric characters, to say the least. He\'s also approached by Dorothy Wynant whose inventor father Clyde Wynant is suspected of murdering her father\'s mistress (his former secretary ).. Her father had left on a planned trip some months before and she has had no contact with him. Nick isn\'t all that keen on resuming his former profession but egged-on by wife Nora, who thinks this all very exciting, he agrees to help out. He solves the case, announcing the identity of the killer at a dinner party for all of the suspects.', 'English', '2019-08-31 18:18:08'),
(406, 13460, 'tt9422468', 'Bikes (2018)', 'bikes-2018', 2018, 92, 'Spokesville is the bike\'s land. Speedy, the main character, is a mountain bike ready to be the leader when the gasoline engine comes to disturb the city. Speedy and his friends, PiÃ±Ã³n, Gassy and Montana will fight against the annoying artifact to keep Spokesville clean.', 'English', '2019-08-31 13:56:47'),
(407, 13459, 'tt8974964', 'Memory: The Origins of Alien (2019)', 'memory-the-origins-of-alien-2019', 2019, 95, 'The untold origin story behind Ridley Scott\'s Alien - rooted in Greek and Egyptian mythologies, underground comics, the art of Francis Bacon, and the dark visions of Dan O\'Bannon and H.R. Giger. A contemplation on the symbiotic collaborative process of movie-making, the power of myth, and our collective unconscious.', 'English', '2019-08-31 13:56:57'),
(408, 13458, 'tt8433858', 'Royally Ever After (2018)', 'royally-ever-after-2018', 2018, 86, 'After dating for one year, Sara Dimarco, a second grade New Jersey schoolteacher from a working class background, is pretty sure her boyfriend Danny, a struggling non-fiction writer from Britain, is the person she wants to spend the rest of her life with despite his obsessiveness in not having an online footprint, which makes her and her best friend and teacher colleague Caitlin believe he\'s hiding something. When on their first anniversary date he proposes having already secretly received the consent of her loving parents, Marie and Bert Dimarco, a waitress and construction worker respectively, and she accepts does he divulge the reason for not having an online presence: he, really Daniel Christopher Seamus Horatio Hughes (and not just plain Danny) is the crown prince and first in line to the throne of St. Ives, a small monarchy off the coast of Britain. While Marie and Bert welcome the news of the engagement and of his true identity, Daniel must now convince his parents, King Edmond...', 'English', '2019-08-31 11:25:26'),
(409, 13457, 'tt0052564', 'The Angry Red Planet (1959)', 'the-angry-red-planet-1959', 1959, 83, 'The first spaceship to Mars, presumed lost, is found in space and brought back to Earth by remote control. Only two from an initial crew of four are still alive, but one is unconscious due to an attached alien growth, while the other is traumatized, blocking out all memory of what happened. In hopes to save the unconscious crewman, the amnesiac is interrogated back into remembering. Those in charge thereby learn of the terrible dangers awaiting anyone venturing into the spooky, ruddy stillness of the very alien Martian ecosystem.', 'English', '2019-08-31 09:05:50'),
(410, 13456, 'tt0085689', 'Hostage (1983)', 'hostage-1983', 1983, 90, 'Horrific true tale set in the late 70\'s Australia about Christine Lewis, a naive 16 year old who in 1974 meets a handsome German immigrant called Walter Maresch working as a carny, and they quickly fall in love. However, his secret sadistic side quickly begins to reveal itself and he manages to strong-arm her into marriage. Things get progressively worse even after they have a baby, but her nightmare truly begins when he reveals to her that he is actually a fanatical member of the banned Nazi Party and forces her to move with him to West Germany, where the neo-Nazi group he belongs to operates. As his abusive behavior worsens and his neo-Nazi activities turn violent, she\'s forced to choose between her life - and his.', 'English', '2019-08-31 08:33:57'),
(411, 13455, 'tt4061944', 'Te Ata (2016)', 'te-ata-2016', 2016, 105, 'Te Ata (TAY\' AH-TAH) is based on the inspiring, true story of Mary Thompson Fisher, a woman who traversed cultural barriers to become one of the greatest Native American performers of all time. Born in Indian Territory, and raised on the songs and stories of her Chickasaw tribe, Te Ata\'s journey to find her true calling led her through isolation, discovery, love and a stage career that culminated in performances for a United States president, European royalty and audiences across the world. Yet of all the stories she shared, none are more inspiring than her own.', 'English', '2019-08-31 02:22:10'),
(412, 13454, 'tt4229864', 'Eat Me (2018)', 'eat-me-2018', 2018, 95, 'Over the course of one torturous night, a suicidal woman and the violent home intruder that saved her life test the limits of human endurance and the boundaries of forgiveness.', 'English', '2019-08-30 23:21:37'),
(413, 13453, 'tt7474914', 'Unbridled (2018)', 'unbridled-2018', 2018, 0, 'Abel (Daniel Grao) is a politician dedicated to the struggle for the most disadvantaged and Nora (Natalia Molina), his wife, is the unconditional support for him and who keeps an important secret that can transform everything. His quiet life in a secluded Andalusian farmhouse will change when Victor, an ousted high official, appears. Virginia and Felix will be the final surprise, two old friends of a time that they preferred to leave behind. Together they will have to face adversity and find out how far they are willing to go to stay together.', 'English', '2019-08-30 22:26:04'),
(414, 13452, 'tt8695030', 'The Dead Don\'t Die (2019)', 'the-dead-dont-die-2019', 2019, 104, 'The peaceful town of Centerville finds itself battling a zombie horde as the dead start rising from their graves.', 'English', '2019-08-31 05:23:57'),
(415, 13451, 'tt7058080', 'Angel of Mine (2019)', 'angel-of-mine-2019', 2019, 98, 'A woman grieving over the death of her daughter loses grip of reality when she begins to think her girl may still be alive.', 'English', '2019-08-30 20:30:49'),
(416, 13450, 'tt1024855', 'London Heist (2017)', 'london-heist-2017', 2017, 95, 'Armed robber and career criminal Jack Cregan seeks to discover the truth behind his father\'s murder and his stolen heist money and in doing so puts his life in danger. The devastation that Jack soon discovers puts his very own existence into question. Set around Spain\'s glamorous Marbella and London\'s dark underworld, he battles to unravel the mystery and exact brutal revenge on all those responsible while being pursued by gangland criminals and a corrupt police detective. GET READY FOR REVENGE!', 'English', '2019-08-30 17:36:58'),
(417, 13449, 'tt6830716', 'Expo (2019)', 'expo-2019', 2019, 80, 'With only three days to prove his innocence, a struggling ex-soldier (Derek Davenport) is forced to take one last job and save his client\'s kidnapped daughter (Amelia Haberman) or face time for a crime he did not commit.', 'English', '2019-08-30 16:40:30'),
(418, 13447, 'tt6895284', 'Itsy Bitsy (2019)', 'itsy-bitsy-2019', 2019, 94, 'Kara, a private nurse and single mother, moves from the big city to the quiet countryside with her two children, 13-year-old Jesse and 8-year-old Cambria, to live with and take care of an elderly man with multiple sclerosis. Things seem normal enough until Jesse discovers a mysterious old relic in the old man\'s house, leading to unexpected and horrifying things coming to life.', 'English', '2019-08-30 14:34:19'),
(419, 13446, 'tt7942736', 'Spider in the Web (2019)', 'spider-in-the-web-2019', 2019, 113, 'A young operative is sent on a mission to follow an older agent, whose behavior has come into question.', 'English', '2019-08-30 12:03:37'),
(420, 13445, 'tt7587984', 'The Knight of Shadows: Between Yin and Yang (2019)', 'the-knight-of-shadows-between-yin-and-yang-2019', 2019, 109, 'A legendary demon hunter (Jackie Chan), tracking down beasts that enter the human dimension, assisted by a lawman protÃ©gÃ© and a motley group of friendly monsters.', 'English', '2019-08-30 09:32:50'),
(421, 13444, 'tt1891923', 'The Hoarder (2015)', 'the-hoarder-2015', 2015, 84, 'When Ella discovers her Wall Street banker boyfriend is renting a secret storage unit, she suspects he\'s using it to hide an affair. Enlisting the help of her best friend Molly she breaks into the facility only to discover something more terrifying instead. Now trapped in a darkened building with a group of neurotic strangers who start disappearing one by one, Ella soon uncovers even worse horror in the dank depths. Her life or death battle to escape eternal enslavement is about to begin....', 'English', '2019-08-30 07:19:17'),
(422, 13443, 'tt0029162', 'Lost Horizon (1937)', 'lost-horizon-1937', 1937, 132, 'British diplomat Robert Conway and a small group of civilians crash land in the Himalayas, and are rescued by the people of the mysterious, Eden-like valley of Shangri-la. Protected by the mountains from the world outside, where the clouds of World War II are gathering, Shangri-la provides a seductive escape for the world-weary Conway.', 'English', '2019-08-30 04:19:31'),
(423, 13442, 'tt2403393', 'Desert Dancer (2014)', 'desert-dancer-2014', 2014, 104, 'A film based on an incredible true story. Desert Dancer is a classic hero story about brave young people risking their lives to rebel against their government and fight for their dreams. Set in Iran, where it is currently forbidden to dance, the story follows Afshin Ghaffarian and his friends who despite the dangers form an underground dance company where, via hacking into YouTube, they learn from the very best - Michael Jackson, Pina Bausch, Gene Kelly and Rudolf Nureyev. Reveling in the freedom of expression that dance gives them, they set upon putting on a performance deep in the desert, away from the watchful eyes of the military police.', 'English', '2019-08-30 01:36:20'),
(424, 13441, 'tt3520290', 'Blunt Force Trauma (2015)', 'blunt-force-trauma-2015', 2015, 97, 'Follows the journey of John and Colt, gunfighters and sometimes lovers, on parallel but very different journeys through an underground dueling culture.', 'English', '2019-08-29 22:56:03'),
(425, 13440, 'tt7315570', 'Santa Girl (2019)', 'santa-girl-2019', 2019, 90, 'The only daughter of Santa Claus (Barry Bostwick \"Spin City\") wants to experience the \"real world\" before she must marry the son of Jack Frost and take over the family business. Cassie Claus (Jennifer Stone \"Wizards of Waverly Place\"), along with her trusty elf, sets off to college while trying to keep her magic powers and famous father a secret. At school, Cassie is pursued by two boys: Sam (Devon Werkheiser \"Ned\'s Declassified School Survival Guide\") who is sweetly awkward and J.R., handsome and wealthy. As her impending arranged marriage looms, Cassie struggles with her feelings for Sam and her obligation to her father and to Christmas itself.', 'English', '2019-08-30 10:26:49'),
(426, 13439, 'tt0108053', 'Schramm: Into the Mind of a Serial Killer (1993)', 'schramm-into-the-mind-of-a-serial-killer-1993', 1993, 65, 'Lothar Schramm is a simple man with complex problems, yet he seems like such a nice guy. He works as a taxi driver and lives by himself where he is happy to answer his door to strangers and kill them outright. As with many shy loner types he has a problem dealing with woman so he drugs them and photographs their nude bodies for sexual stimulation. He then murders his helpless victims and so goes the life of a deranged serial killer.', 'English', '2019-08-30 08:04:04'),
(427, 13438, 'tt0045897', 'I Confess (1953)', 'i-confess-1953', 1953, 95, 'Otto Keller and his wife Alma work as caretaker and housekeeper at a Catholic church in QuÃ©bec City, QuÃ©bec. While robbing a house where he sometimes works as a gardener, Otto is caught and kills the owner. Racked with guilt, he heads back to the church where Father Michael Logan is working late. Otto confesses his crime, but when the police begin to suspect Father Logan, he cannot reveal what he has been told in the confession.', 'English', '2019-08-30 05:13:16'),
(428, 13437, 'tt0080836', 'Hangar 18 (1980)', 'hangar-18-1980', 1980, 97, 'Shortly after the launch of a satellite from a space shuttle the satellite collides with a UFO in front of the crew\'s eyes. Because of an election campaign some politicians try to hide the crashed UFO -- inside hangar 18.', 'English', '2019-08-30 01:51:10'),
(429, 13436, 'tt0104014', 'All Ladies Do It (1992)', 'all-ladies-do-it-1992', 1992, 93, 'For a while now, beautiful 24-year-old Diana Bruni who\'s been happily married for five years, has been feeling distressed, experiencing an inexplicable, rather restless craving to finally live her life to the full and to break free from what society forbids. As this urge grows stronger by the day, Diana will ultimately yield to her carnal longings, and through a parade of particularly explicit nocturnal sensual adventures, she will utterly embrace passion, even if this comes by way of transgression. However, before long, the unaware husband, Paolo, will find all about his headstrong and disobedient wife\'s extra-marital escapades, raunchy experiences vividly retold by Diana\'s very lips, with the intention to rekindle their love and spice up their sexual life. Inevitably, poor Paolo disgraced, enraged and green with jealousy (or could it be envy?), will threaten to move out leaving for good his liberated and adulterous wife who seems to feel no contrition at all. But how can Diana make ...', 'English', '2019-08-29 22:04:07'),
(430, 13435, 'tt6565702', 'Dark Phoenix (2019)', 'dark-phoenix-2019', 2019, 113, 'The X-Men. Protectors of peace. Jean Grey is one of the most beloved X-Men. But when a mission goes wrong, Jean is exposed to a dark and ancient power. This power has destroyed everything it comes in contact with, until her. Now that this power is becoming unstable, she releases it with destruction and anger. Now that this foreign power is consuming her, and the world is threatened, the X-Men have to face an important truth: they must save either the world, or their friend who threatens it.', 'English', '2019-08-29 13:19:21'),
(431, 13434, 'tt9213932', 'Kardec (2019)', 'kardec-2019', 2019, 110, 'Tells the story of Allan Kardec, from his days as an educator to his contribution to the spiritist codification.', 'English', '2019-08-29 14:25:00'),
(432, 13433, 'tt9860728', 'Falling Inn Love (2019)', 'falling-inn-love-2019', 2019, 98, 'Gabriela Diaz\'s (Christina Milian) San Francisco design firm folds the week of her break-up. Inspired by a potent concoction of wine and Wi-Fi, she successfully enters a contest to \"Win an Inn\" overlooking New Zealand\'s countryside. Thousands of airline miles later, she discovers The Bellbird Valley Farm boasts a crumbling facade, floorboard-treading goat, and meddling neighbor who covets the space. Eager to renovate and sell the property fast, she partners with Jake Taylor (Adam Demos), the Kiwi contractor and volunteer firefighter observing much of her city-girl culture shock. Once the final fixtures are hung, she\'s hesitant to leave him, the inn, and the inviting community that nurtured her creative side.', 'English', '2019-08-29 04:44:00'),
(433, 13432, 'tt0056663', 'Vivre Sa Vie (1962)', 'vivre-sa-vie-1962', 1962, 80, 'This film explores a Parisian woman\'s descent into prostitution. The movie is comprised of a series of 12 \"tableaux\"-- scenes which are basically unconnected episodes, each presented with a worded introduction.', 'English', '2019-08-29 12:08:45'),
(434, 13431, 'tt0191255', 'Love Thy Neighbour (1973)', 'love-thy-neighbour-1973', 1973, 85, 'Two men who are nextdoor neighbors constantly battle it out over seemingly trivial offenses. Their wives, on the other hand, are best of friends. The two couples attempt to win a \'love-thy-neighbor\' competition by lying...', 'English', '2019-08-29 09:48:13'),
(435, 13430, 'tt2707858', 'Yves Saint Laurent (2014)', 'yves-saint-laurent-2014', 2014, 106, 'A look at the life of French designer Yves Saint Laurent from the beginning of his career in 1958 when he met his lover and business partner, Pierre Berge.', 'English', '2019-08-29 07:06:22'),
(436, 13429, 'tt0051792', 'The Music Room (1958)', 'the-music-room-1958', 1958, 100, 'Huzur Biswamghar Roy is a rich landowner who lives in a palace with his wife and son and his many servants. His passion - his wife would call it his addiction - is music and he spends a great deal of his fortune on concerts held for the locals in his magnificent music room. His wealth is in decline however. His lands are being eroded by the local river and he pays for the concert he arranges for his son\'s coming of age party by selling some of the family jewels. When his neighbor Ganguli invites him to a party at his house, Roy decides to one up him and organizes a lavish party for the same day - costing him the last of the jewels. After his wife and son are killed in a storm, Roy becomes something of a recluse, closing up the music room. Now, many years later he decides to have one final concert, spending the last of his money to again outdo - and spite - Ganguli.', 'English', '2019-08-29 04:31:26'),
(437, 13428, 'tt0097202', 'The Killer (1989)', 'the-killer-1989', 1989, 111, 'Jeffrey is an assassin who wishes to leave the business so he can take care of Jennie, the beautiful lounge singer who he inadvertently blinded during a previous assignment. Li Ying is the determined cop who will stop at nothing to bring him in, only he realizes that Jeffrey is no ordinary assassin, and wishes to help him in his quest. Only problem is that Jeffrey\'s employers refuse to pay him for his last job, money which is needed to restore Jennie\'s eyesight.', 'English', '2019-08-29 01:42:53'),
(438, 13427, 'tt0071771', 'The Longest Yard (1974)', 'the-longest-yard-1974', 1974, 121, 'A football player-turned-convict organizes a team of inmates to play against a team of prison guards. His dilemma is that the warden asks him to throw the game in return for an early release, but he is also concerned about the inmates\' lack of self-esteem.', 'English', '2019-08-28 22:31:05'),
(439, 13426, 'tt5480520', 'Vultures (2018)', 'vultures-2018', 2018, 95, 'Sharp-suited Erik represents the aspirational face of modern Iceland. Atli, a petty criminal just released from prison, is stuck in a downward spiral. The distance between these two very different brothers vanishes when the duo teams up to smuggle cocaine into Iceland, inside plastic pellets swallowed by a young Polish mule, Sofia. But things go wrong when rule-breaking cop Lena starts closing in on them and Sofia falls sick. With the drugs yet to reach their destination and a rival gang demanding a slice of the action, time is a luxury that the brothers can\'t afford. Charismatic anti-hero Erik\'s ability to stay one step ahead is tested to the limit - how many lives is he willing to sacrifice to sustain his own?', 'English', '2019-08-28 15:37:33'),
(440, 13425, 'tt7203052', 'The Creatress (2019)', 'the-creatress-2019', 2019, 110, 'Young, bestselling author Eryn Bellow concludes her bookstore tour with her agent selling film rights and closing a six figure advance for her follow-up. Headwinds arise as critics get offended by the claims that Eryn is being declared a living literary legend. The storm gathers force as the assaults gravitate from bad reviews to a fake-memoir designed to obliterate her from the field. Through the noise, Eryn attempts to write her way out of the public fray, and reclaim her voice in the minds of her readers. Along the way, she hopes to prove a happy ending is not always a bad thing.', 'English', '2019-08-28 12:46:42'),
(441, 13424, 'tt5974050', 'Dating My Mother (2017)', 'dating-my-mother-2017', 2017, 88, 'Dating My Mother explores the intimate and sometimes tumultuous relationship between a single mother and her gay son as they navigate the dizzying world of online dating.', 'English', '2019-08-28 14:53:31'),
(442, 13423, 'tt0054310', 'Sink the Bismarck ! (1960)', 'sink-the-bismarck-1960', 1960, 97, 'Chronicles the breakout of the Bismarck during the early days of World War II. Seen from the point of view of the many Naval vessels on both sides and from the central headquarters of the British where the search for the super battleship was controlled.', 'English', '2019-08-28 12:37:06'),
(443, 13422, 'tt3505712', 'Time Out of Mind (2014)', 'time-out-of-mind-2014', 2014, 120, 'George seeks refuge at Bellevue Hospital, a Manhattan intake center for homeless men, where his friendship with a fellow client helps him try to repair his relationship with his estranged daughter.', 'English', '2019-08-28 03:53:16'),
(444, 13421, 'tt0047834', 'Animal Farm (1954)', 'animal-farm-1954', 1954, 72, 'Britain\'s second animated feature, which, despite the title and Disney-esque animal animation, is in fact a no-holds-barred adaptation of George Orwell\'s classic satire on Stalinism, with the animals taking over their farm by means of a revolutionary coup, but then discovering that although all animals are supposed to be equal, some are more equal than others...', 'English', '2019-08-28 01:18:18'),
(445, 13420, 'tt0042208', 'The Asphalt Jungle (1950)', 'the-asphalt-jungle-1950', 1950, 112, 'When the intelligent criminal Erwin \"Doc\" Riedenschneider is released from prison, he seeks a fifty thousand-dollar investment from the bookmaker Cobby to recruit a small gang of specialists for a million-dollar heist of jewels from a jewelry. Doc is introduced to the lawyer Alonzo D. Emmerich that offers to finance the whole operation and buy the gems immediately after the burglary. Doc hires the safecracker Louis Ciavelli, the driver Gus Minissi and the gunman Dix Handley to the heist. His plan works perfectly but bad luck and betrayals compromise the steps after the heist and the gangsters need to flee from the police.', 'English', '2019-08-28 00:12:34'),
(446, 13419, 'tt0954947', 'The Killer Inside Me (2010)', 'the-killer-inside-me-2010', 2010, 109, 'Sadism and masochism beneath a veneer of revenge. Lou Ford is a mild-mannered sheriff\'s deputy in a Texas oil town in the mid 1950\'s. His boss sends him to roust a prostitute living in a rural house. She slaps him; he hits her, then, after daily sex for the next few weeks, he decides it\'s love. She\'s devoted to him and becomes his pawn in a revenge plot she thinks is to shakedown the son of Chester Conway, the town\'s wealthy king of construction. Lou has a different plan, and bodies pile up as murder leads to murder. The district attorney suspects Lou, and Conway may have an inkling, but Lou stays cool. Is love, or at least peace, in the cards?', 'English', '2019-08-27 21:40:16'),
(447, 13418, 'tt0056732', 'The Exterminating Angel (1962)', 'the-exterminating-angel-1962', 1962, 95, 'After a lavish dinner party, the guests find themselves mysteriously unable to leave the room... and over the next few days all the elaborate pretenses and facades that they\'ve built up by virtue of their position in society collapse completely as they become reduced to living like animals...', 'English', '2019-08-27 15:44:19'),
(448, 13417, 'tt3919598', 'The Inhabitants (2015)', 'the-inhabitants-2015', 2015, 90, 'A young couple gets more than they bargained for when they buy an historic bed and breakfast in New England only to discover that the old house is hiding a dark secret within its walls.', 'English', '2019-08-27 16:42:00'),
(449, 13416, 'tt5145662', 'Monsters at Large (2018)', 'monsters-at-large-2018', 2018, 91, 'Alex decides to end his kid brother\'s nightmares by forming a task force to take care of imaginary monsters. When their business becomes a hit, nothing can go wrong...until one of the monsters turns out to be real, and really big.', 'English', '2019-08-27 12:43:56'),
(450, 13415, 'tt0075276', 'Stroszek (1977)', 'stroszek-1977', 1977, 115, 'Bruno Stroszek is released from prison and warned to stop drinking. He has few skills and fewer expectations: with a glockenspiel and an accordion, he ekes out a living as a street musician. He befriends Eva, a prostitute down on her luck. After they are harried and beaten by the thugs who have been Eva\'s pimps, they join Bruno\'s neighbor, Scheitz, an elderly eccentric, when he leaves Germany to live in Wisconsin. In that winter bound, barren prairie, Bruno works as a mechanic, Eva as a waitress. They buy a trailer. Then, bills mount, the bank threatens to repossess the trailer, Eva wants privacy, and inexorably, the promise of a new life deserts Bruno.', 'English', '2019-08-27 13:57:37'),
(451, 13414, 'tt3759912', 'Ladyworld (2018)', 'ladyworld-2018', 2018, 93, 'Eight teenage girls become trapped in an endless birthday party after a massive (imaginary?) earthquake. The girls\' sanity and psyches dissolve as they run out of food and water. Eventually, they regress to their baser instincts, exploiting each other\'s fears and insecurities.', 'English', '2019-08-27 11:32:46'),
(452, 13412, 'tt5073756', 'All At Once (2016)', 'all-at-once-2016', 2016, 112, 'A young up and coming artist in New York city has his life and dreams forever altered when the tragic events of 9/11 take the lives of his two best friends and he accepts guardianship of the couple\'s two young daughters. Now eleven years later, and teaching art at an elementary school, he raises the girls as if they were his own, but the financial grind to live in NYC is too much, so he decides to take the girls away from the only place they\'ve ever called home and move back to Buffalo where he grew up. This \"non-traditional\" family now faced with change, new surroundings, and a new journey, must learn how to adjust to this new life, while trying to find themselves along the way.', 'English', '2019-08-26 23:11:39'),
(453, 13411, 'tt8218662', 'Shadowplay (2019)', 'shadowplay-2019', 2019, 90, 'When a private eye takes a case to find a missing university student, he must explore the deep dark depths of his own mind to uncover the truth around his own childhood disappearance as he tracks down the missing girl.', 'English', '2019-08-26 23:26:43'),
(454, 13410, 'tt0093898', 'Russkies (1987)', 'russkies-1987', 1987, 0, 'It is during the Cold War and all Americans have a view of Russians as one thing: bad people. A group of American boys discovers a Russian sailor washed up on the coast of Florida and decide to befriend him, assuming that he is friendly and will bring them no danger and thus go against the ideas of their parents, as well as the government.', 'English', '2019-08-26 20:28:04'),
(455, 13409, 'tt8354344', 'Witches in the Woods (2019)', 'witches-in-the-woods-2019', 2019, 90, 'Jill, a tenacious UMass freshman, abandons her studies for an off-the-grid snowboarding trip. But after the sun has dipped below the horizon, their SUV mysteriously becomes lost in the freshly-logged mountains, eventually running out of gas. As temperatures fall, the group dynamic unravels as a virtual and then literal witch hunt begins.', 'English', '2019-08-26 16:30:44'),
(456, 13408, 'tt6146586', 'John Wick: Chapter 3 - Parabellum (2019)', 'john-wick-chapter-3-parabellum-2019', 2019, 131, 'In this third installment of the adrenaline-fueled action franchise, skilled assassin John Wick (Keanu Reeves) returns with a $14 million price tag on his head and an army of bounty-hunting killers on his trail. After killing a member of the shadowy international assassin\'s guild, the High Table, John Wick is excommunicado, but the world\'s most ruthless hit men and women await his every turn.', 'English', '2019-08-26 05:06:18'),
(457, 13407, 'tt7464188', 'In Fabric (2018)', 'in-fabric-2018', 2018, 118, 'In Fabric is a haunting ghost story set against the backdrop of a busy winter sales period in a department store and follows the life of a cursed dress as it passes from person to person, with devastating consequences..', 'English', '2019-08-26 04:28:32'),
(458, 13406, 'tt7446692', 'Doll Cemetery (2019)', 'doll-cemetery-2019', 2019, 80, 'Brendan Cobbs, a famous novelist, is sent to a remote cottage in rural England to find inspiration for his next novel. He believes he found his next subject when he encounters Alfred, a child size doll who can come to life. But deadly consequences arise when Brendan realizes Alfred has an intent to kill.', 'English', '2019-08-26 02:30:25'),
(459, 13405, 'tt0320193', 'Oasis (2002)', 'oasis-2002', 2002, 132, 'Jong-du, a young man just out of prison for manslaughter, is a social misfit: fidgety, snuffling, laughing inappropriately, without a super ego. When released, he calls on the family of the victim; they send him away, but not before he has seen Gong-ju, a young woman disabled severely by cerebral palsy. Both are abused by their families, and both are used by them as well. Although their relationship begins with Jong-du\'s criminal behavior, a friendship develops. They talk of favorite things; he washes her hair; they go out; in late night phone calls, he helps her past her fears of the dark. Is there a place in the world for these two inarticulate people?', 'English', '2019-08-25 23:28:55'),
(460, 13404, 'tt0097336', 'Fat Man and Little Boy (1989)', 'fat-man-and-little-boy-1989', 1989, 127, 'In real life, Robert Oppenheimer was the scientific head of the Manhattan Project, the secret wartime project in New Mexico where the first atomic bombs were designed and built. General Leslie Groves was in overall command of it. This film reenacts the project with an emphasis on their relationship.', 'English', '2019-08-25 22:08:55'),
(461, 13403, 'tt6535838', 'Woodstock or Bust (2019)', 'woodstock-or-bust-2019', 2019, 90, 'Two teen song-writers saddle up their West coast \'65 Mustang convertible and head East, answering the call to Yasgur\'s farm, to debut their original music at the Woodstock Music Festival.', 'English', '2019-08-25 19:07:43'),
(462, 13402, 'tt0113762', 'The Mangler (1995)', 'the-mangler-1995', 1995, 106, 'When an accident involving a folding machine at an old laundry occurs, detective John Hunton decides to investigate. What he finds is the owner of the laundry, Bill Gartley. Meanwhile the folding machine has acquired a taste for the flesh of human beings, but is there more to Bill Gartley than meets the eye, and does he know what monster hides behind the machine?', 'English', '2019-08-25 20:06:30'),
(463, 13401, 'tt0096341', 'Uninvited (1988)', 'uninvited-1988', 1988, 90, 'A bunch of young people are invited to a Caribbean cruise on a gangster\'s yacht, to distract the attention of the authorities. Unfortunately, a mutant cat which escaped from a test laboratory also gets on board, and kills most of the passengers.', 'English', '2019-08-25 17:11:20'),
(464, 13400, 'tt0042531', 'The Gunfighter (1950)', 'the-gunfighter-1950', 1950, 85, 'A reformed Gunfighter Jimmy Ringo is on his way to a sleepy town in the hope of a reunion with his estranged sweetheart and their young son who he has never seen. On arrival, a chance meeting with some old friends including the town\'s Marshal gives the repentant Jimmy some respite. But as always Jimmy\'s reputation has already cast its shadow, this time in the form of three vengeful cowboys hot on his trail and a local gunslinger hoping to use Jimmy to make a name for himself. With a showdown looming, the town is soon in a frenzy as news of Jimmy\'s arrival spreads. His movements are restricted to the saloon while a secret meeting with his son can be arranged giving him ideas of a long term reunion with his family far removed from his wild past.', 'English', '2019-08-25 14:59:01'),
(465, 13399, 'tt1097643', 'Fifty Dead Men Walking (2008)', 'fifty-dead-men-walking-2008', 2008, 117, 'Based on Martin McGartland\'s shocking real life story. Martin is a young lad from west Belfast in the late 1980s who is recruited by the British Police to spy on the IRA. He works his way up the ranks as a volunteer for the IRA whilst feeding information to his British handler and saving lives in the process.', 'English', '2019-08-25 12:24:05'),
(466, 13398, 'tt3322420', 'Queen (2013)', 'queen-2013', 2013, 146, 'Queen is a movie about growing up. Rani (Kangana Ranaut) is a Delhi girl from a conservative family who is ditched by her fiancÃ© just before her wedding. Shocked by this, she decides to set out on the planned honeymoon alone. As she travels the world and meets new people, she gains new experiences and discovers her own identity.', 'English', '2019-08-25 09:13:13'),
(467, 13397, 'tt0089572', 'The Mean Season (1985)', 'the-mean-season-1985', 1985, 103, 'Malcolm Anderson is a reporter for a Miami newspaper. He\'s had enough of reporting the local murders and so promises his school teacher girlfriend (Christine), they\'ll move away soon. Before Malcolm can hand in his notice, the murderer from his latest article phones him. The murderer tells Malcolm that he\'s going to kill again. The phone calls and murders continue, soon Malcolm finds that he\'s not just reporting the story, he is the story.', 'English', '2019-08-25 07:30:38'),
(468, 13396, 'tt1534335', 'Dolphins in the Deep Blue Ocean (2009)', 'dolphins-in-the-deep-blue-ocean-2009', 2009, 0, 'Dolphins are inspiring, playful, strong, exciting, and highly intelligent animals -- and in this documentary, you can see how these beautiful animals frolic in their natural environment in the reef of Eilat in Israel.', 'English', '2019-08-25 02:18:38'),
(469, 13395, 'tt0089006', 'Death of a Salesman (1985)', 'death-of-a-salesman-1985', 1985, 136, 'Salesman Willy Loman is in a crisis. He\'s about to lose his job, he can\'t pay his bills, and his sons Biff and Happy don\'t respect him and can\'t seem to live up to their potential. He wonders what went wrong and how he can make things up to his family.', 'English', '2019-08-25 02:11:07'),
(470, 13394, 'tt0024216', 'King Kong (1933)', 'king-kong-1933', 1933, 100, 'Carl Denham needs to finish his movie and has the perfect location; Skull Island. But he still needs to find a leading lady. This \'soon-to-be-unfortunate\' soul is Ann Darrow. No one knows what they will encounter on this island and why it is so mysterious, but once they reach it, they will soon find out. Living on this hidden island is a giant gorilla and this beast now has Ann in it\'s grasps. Carl and Ann\'s new love, Jack Driscoll must travel through the jungle looking for Kong and Ann, whilst avoiding all sorts of creatures and beasts.', 'English', '2019-08-24 23:37:18'),
(471, 13393, 'tt0053602', 'The Angry Silence (1960)', 'the-angry-silence-1960', 1960, 0, 'The right of every individual to be different from his fellow man is the theme behind this internationally-hailed, British production. The story tells of a man\'s dilemma when he refused to participate in an unofficial strike, where he works. While vicious, calculated violence brings the other dissenters into line, he goes it alone and is sent to Coventry (given the silent treatment) by his fellow workers. A stirring, thought-provoking movie that portrays the human problems and high emotions generated when a man dares to act on the courage of his convictions, and dares fight to keep his individual freedom.', 'English', '2019-08-24 23:03:36');
INSERT INTO `imdbinfo` (`id`, `movie_id`, `imdb_code`, `title_long`, `slug`, `year`, `movie_runtime`, `description_full`, `language`, `date_uploaded`) VALUES
(472, 13392, 'tt0080380', 'The Apple (1980)', 'the-apple-1980', 1980, 90, 'Alphie and Bibi, two sweet, naive youths from Moose Jaw, Canada, have come to America to compete in the 1994 Worldvision Song Festival. Although the pair have talent, they are beaten out by the underhanded tactics of the festival favorites, another duo with the backing of BIM: Boogalow International Music, and its leader, Mr. Boogalow. Though crestfallen by their loss, Bibi and Alphie are soon delighted to hear that Mr. Boogalow has taken an interest in their music and wants to sign them to his label. All is looking up for the two until they begin to discover the dark underside of the rock and roll world.', 'English', '2019-08-24 20:48:41'),
(473, 13391, 'tt6459382', 'Sylvio (2017)', 'sylvio-2017', 2017, 0, 'A small town gorilla joins a local TV program where a series of on-air mishaps send him on a journey of self-discovery.', 'English', '2019-08-24 18:19:58'),
(474, 13390, 'tt3016748', 'Jacob\'s Ladder (2019)', 'jacobs-ladder-2019', 2019, 89, 'After his brother returns home from war, Jacob Singer struggles to maintain his sanity. Plagued by hallucinations and flashbacks, Singer rapidly falls apart as the world and people around him morph and twist into disturbing images. A remake of the 1990 thriller starring Tim Robbins.', 'English', '2019-08-24 11:31:56'),
(475, 13389, 'tt0109456', 'Color of Night (1994)', 'color-of-night-1994', 1994, 121, 'Psychologist Bill Capa gives up his practise when he unintentionally pushes a patient to commit suicide. In an effort to come to terms with this tragedy he visits an old colleague, Bob Moore, who is subsequently murdered. The quest to catch the killer centres around a group of Moore\'s psychologically disturbed patients, however equally as important is an affair which develops between Capa and the mysterious Rose.', 'English', '2019-08-24 06:46:53'),
(476, 13388, 'tt8332666', 'Tone-Deaf (2019)', 'tone-deaf-2019', 2019, 87, 'After losing her job and imploding her latest dysfunctional relationship, Olive (Amanda Crew) flees the city for the weekend, escaping to the countryside for some peace and self-reflection. She rents an ornate country house from an eccentric widower named Harvey (Robert Patrick). Soon two generations collide with terrifying results as Olive awakens Harvey\'s homicidal tendencies and is plunged into a blood-soaked fight for her life. More than your average slasher film, TONE-DEAF provides a dark critique of the bizarre cultural and political climate that currently exists.', 'English', '2019-08-23 18:26:51'),
(477, 13387, 'tt8329148', 'Astro Kid (2019)', 'astro-kid-2019', 2019, 89, 'Following the destruction of their ship, the young Willy is separated from his parents with whom he traveled in space. His spare capsule lands on a wild and unexplored planet. With the help of Buck, a survival robot, he will have to hold until the arrival of a rescue mission.', 'English', '2019-08-23 14:39:00'),
(478, 13386, 'tt0067367', 'Lust for a Vampire (1971)', 'lust-for-a-vampire-1971', 1971, 95, 'In 1830, forty years to the day since the last manifestation of their dreaded vampirism, the Karnstein heirs use the blood of an innocent to bring forth the evil that is the beautiful Mircalla - or as she was in 1710, Carmilla. The nearby Finishing School offers rich pickings not only in in the blood of nubile young ladies but also with the headmaster who is desperate to become Mircalla\'s disciple, and the equally besotted and even more foolish author Richard Lestrange.', 'English', '2019-08-23 11:31:34'),
(479, 13385, 'tt8009314', 'Burn (2019)', 'burn-2019', 2019, 88, 'When a gas station is held at gunpoint by a desperate man in need of cash, a lonely and unstable gas station attendant, tired of being overshadowed by her more outgoing co-worker, finds an opportunity to make a connection with the robber.', 'English', '2019-08-23 02:07:18'),
(480, 13384, 'tt5707304', 'Mother (2016)', 'mother-2016', 2016, 95, 'Diana Prieto is pregnant and taking care of her autistic son Martin has become overwhelming. She has no one to help her while her husband Tomas spends months working in Asia. Diana\'s at her breaking point with Martin when Luz, a gifted caregiver from the Philippines, steps in to help. Martin quickly begins improving under Luz\'s supervision, but Diana\'s worried that he\'s only being taught to speak Filipino. Diana begins to suspect that Luz is using the language barrier and voodoo to turn Martin against Diana and into something far more sinister...', 'English', '2019-08-23 01:56:42'),
(481, 13383, 'tt0119375', 'Insomnia (1997)', 'insomnia-1997', 1997, 96, 'In a Norwegian city with a 24-hour daylight cycle, a Swedish murder investigator is brought in to find an elusive killer. But when the officer accidentally kills his own partner and covers it up, a double sided game of cat-and-mouse ensues.', 'English', '2019-08-22 23:38:31'),
(482, 13382, 'tt4381236', 'The Greasy Strangler (2016)', 'the-greasy-strangler-2016', 2016, 93, 'The Los Angeles-set tale follows Ronnie, a man who runs a Disco Walking tour along with his browbeaten son, Brayden. When a sexy, alluring woman comes to take the tour, it begins a competition between father and son for her attentions. It also signals the appearance of an oily, slimy inhuman maniac who stalks the streets at night and strangles the innocent, soon dubbed \'The Greasy Strangler.\'', 'English', '2019-08-22 23:27:01'),
(483, 13381, 'tt6186940', 'Hot Air (2018)', 'hot-air-2018', 2018, 99, 'Slick comedy-drama from the director of The Wedding Singer, with Steve Coogan as an abrasive right-wing radio host whose perfect life is thrown into disarray when his sassy long lost 16-year old niece turns up on his doorstep, ready to challenge everything he stands for.', 'English', '2019-08-22 20:58:22'),
(484, 13380, 'tt0291341', 'Mean Machine (2001)', 'mean-machine-2001', 2001, 99, 'Disgraced ex-England captain (Danny \'Mean Machine\' Meehan) is thrown in jail for assaulting two police officers. Whilst in jail, he doesn\'t recieve any favours because of his celebrity status in the outside world. He is out numbered and many prisoners constantly barrage him with insults for letting down his country in a crucial World Cup game. He keeps his head down and has the opportunity to forget everything and change the lives of the prisoners. These prisoners have the chance to put one over the evil guards. The prisoners are lead by Danny and the whole of the prison, guards aside, are behind them. Game on......', 'English', '2019-08-22 20:34:06'),
(485, 13379, 'tt0484382', 'One Way (2006)', 'one-way-2006', 2006, 116, 'In New York, the competent creative director of Birk Advertising Eddie Shneider is living a successful moment of his professional life and is engaged and has just proposed Judy Birk, the daughter of the owner of the company where he works. Eddie is also a wolf and very successful with many women, and is having an affair with a neighbor of the street where he lives with Judy. When he gets the account of the greatest American airline for his company, he is promoted to partner and he celebrates with his assistant and friend Angelina Sable in a lunch party in a restaurant. After hours, when they are in the garage, Angeline notes that she had forgotten her car keys in the office, and when she returns, she is violently raped by the despicable brother of Judy, Anthony Birk. On the next morning, when Eddie arrives in the garage, he finds the traumatized Angeline on the floor and he takes her to a hospital. He returns to the company and Anthony blackmails Eddie with pictures of his many ...', 'English', '2019-08-22 16:59:05'),
(486, 13378, 'tt0064855', 'Putney Swope (1969)', 'putney-swope-1969', 1969, 84, 'Dark satire in which the token black man on the executive board of an advertising firm is accidentally put in charge. Renaming the business \"Truth and Soul, Inc.\", he replaces the tight regime of monied white ad men with his militant brothers. Soon afterwards, however, the power that comes with its position takes its toll on Putney...', 'English', '2019-08-22 17:49:21'),
(487, 13377, 'tt0082596', 'Kagero-za (1981)', 'kagero-za-1981', 1981, 139, 'A 1920s playwright meets a beautiful woman who may be the ghost of his patron\'s deceased wife.', 'English', '2019-08-22 12:24:17'),
(488, 13376, 'tt3346224', 'Zipper (2015)', 'zipper-2015', 2015, 112, 'Sam Ellis is a man on the rise - a federal prosecutor on the cusp of a bright political future. But what was meant to be a one-time experience with a high-end escort instead turns into a growing addiction. His moral compass unraveling, his new demon threatens to destroy his life, family and career.', 'English', '2019-08-22 09:26:45'),
(489, 13375, 'tt0036104', 'The Leopard Man (1943)', 'the-leopard-man-1943', 1943, 66, 'At the encouragement of her manager, a nightclub performer in New Mexico (Kiki Walker) takes a leashed leopard into the club as a publicity gimmick. But her rival, angered by the attempt to upstage, scares the animal and it bolts. In the days that follow, people are mauled and the countryside is combed for the loose creature. But Kiki and her manager begin to wonder if maybe the leopard is not responsible for the killings.', 'English', '2019-08-22 15:37:41'),
(490, 13374, 'tt5361488', 'Magellan (2017)', 'magellan-2017', 2017, 103, 'After NASA picks up a trio of mysterious signals from within our own solar system, astronaut Roger Nelson is dispatched on a multi-year solo mission aboard the Magellan spacecraft to investigate the sources.', 'English', '2019-08-22 06:40:44'),
(491, 13373, 'tt7275822', 'Klassentreffen 1.0 (2018)', 'klassentreffen-1-0-2018', 2018, 127, 'Three former classmates reunite for their 30-year high school reunion.', 'English', '2019-08-22 03:55:53'),
(492, 13372, 'tt0103129', 'Truly Madly Deeply (1990)', 'truly-madly-deeply-1990', 1990, 106, 'Once upon a time there were two people in love, their names were Nina and Jamie. They were even happy enough to be able to live happily ever after, (not often the case) and then Jamie died. Nina is left with a house full of rats and handymen, a job teaching foreigners English and an ache that fills the night sky.', 'English', '2019-08-22 01:13:14'),
(493, 13371, 'tt4287348', 'Isolation (2015)', 'isolation-2015', 2015, 86, 'Inspired by the true events of a couple vacationing on a remote island in the Bahamas who are hunted by a group of modern-day pirates, after their identities and their lives.', 'English', '2019-08-22 10:48:18'),
(494, 13370, 'tt1937264', 'Now Is Good (2012)', 'now-is-good-2012', 2012, 103, 'A girl dying of leukemia compiles a list of things she\'d like to do before passing away. Topping the list is her desire to lose her virginity.', 'English', '2019-08-22 07:54:35'),
(495, 13369, 'tt0113703', 'Love Letter (1995)', 'love-letter-1995', 1995, 117, 'Hiroko Watanabe\'s fiancÃ© Itsuki died two years earlier in a mountain climbing accident. While looking through his high school yearbook, Hiroko in a fit of grief decides to write a letter to him using his old school address. Surprisingly she receives a reply, not from the dead Itsuki, but from a woman with the same name whom had known Hiroko\'s fiancÃ© in school. A relationship develops between the two women as they continue to exchange letters and share memories of the dead Itsuki.', 'English', '2019-08-22 04:33:08'),
(496, 13368, 'tt3276390', 'LasseMajas detektivbyrÃ¥ - Von Broms hemlighet (2013)', 'lassemajas-detektivbyra-von-broms-hemlighet-2013', 2013, 83, 'Lasse and Maja are two kids that runs a detective bureau. In this movies beginning the kids find a chest made by the composer Alexander von Broms in the crypt of the church with a cryptic message attached to it. The chest appears to solve the financial problems for the local church that is in urgent need of restoration. But when von Broms relatives appear and claim that the chest is theirs a conflict emerges. A few hours later the chest gets stolen and Lasse and Maja tries to find it. The Adventure begins in the City Valleby with its surreal surroundings. There are puzzles to be solved and mysteries to be revealed and the whole family can join in.', 'English', '2019-08-22 01:53:04'),
(497, 13367, 'tt7776838', 'The Most Beautiful Girl in the World (2018)', 'the-most-beautiful-girl-in-the-world-2018', 2018, 102, 'Cyril falls head over heel for the new girl in his class. Roxy is drop dead gorgeous and she is cool. But there is a problem. Cyril is terribly self conscious because he\'s got a rather large nose. And while he writes songs for and about his beloved, he is too shy to let her know they are his and pretends they were', 'English', '2019-08-21 22:44:26'),
(498, 13366, 'tt7158736', 'The Famous Five and the Valley of Dinosaurs (2018)', 'the-famous-five-and-the-valley-of-dinosaurs-2018', 2018, 102, 'En route to a party they are not keen on attending, the Famous Five are almost relieved when Aunt Fanny\'s car breaks down, stranding them in a small town. To pass the time, they visit the local natural history museum, where some newly-discovered dinosaur bones are being unveiled. Here they meet Marty, who tells them that his father, long dead, supposedly found a complete dinosaur skeleton and made a map of its whereabouts. Unfortunately the map has been stolen. Unable to let a good mystery go unsolved, George, Julian, Dick, Anne and Timmy, join a guided hike through the Valley of Dinosaurs. But their fact-finding mission soon turns into a race to find the dinosaur when they suspect that the thief is one of the group.', 'English', '2019-08-21 20:23:05'),
(499, 13365, 'tt1935940', 'Get Santa (2014)', 'get-santa-2014', 2014, 102, 'A father and son who team up to save Christmas once they discover Santa Claus sleeping in their garage after crashing his sleigh and finding himself on the run from the police.', 'English', '2019-08-21 18:12:50'),
(500, 13364, 'tt0089504', 'Lost in America (1985)', 'lost-in-america-1985', 1985, 91, 'David and Linda Howard are successful yuppies from LA. When he gets a job disappointment, David convinces Linda that they should quit their jobs, liquidate their assets, and emulate the movie Easy Rider, spending the rest of their lives travelling around America...in a Winnebago! (This is a kind of large, luxurious mobile home which suits a 1980\'s yuppie more than the counterculture dropout approach of Easy Rider.) His idealized, unrealistic plans soon begin to go spectacularly wrong.', 'English', '2019-08-21 15:41:08'),
(501, 13363, 'tt0086312', 'Silkwood (1983)', 'silkwood-1983', 1983, 131, 'Fairly accurate recounting of the story of Karen Silkwood, the Oklahoma nuclear-plant worker who blew the whistle on dangerous practices at the Kerr-McGee plant and who died under circumstances which are still under debate.', 'English', '2019-08-21 22:11:10'),
(502, 13362, 'tt7074092', 'Christmas Wedding Planner (2017)', 'christmas-wedding-planner-2017', 2017, 86, 'Wedding Planner, Kelsey Wilson, is about to have her big break: planning her beloved cousin\'s lavish and exclusive wedding. Everything is going smoothly until Connor McClane, a devilishly handsome private investigator, shows up and turns Kelsey\'s world upside-down. Hired by a secret source, Connor quickly disrupts the upcoming nuptials but wins Kelsey\'s heart in the process.', 'English', '2019-08-21 19:07:52'),
(503, 13361, 'tt0048452', 'Ordet (1955)', 'ordet-1955', 1955, 126, 'How do we understand faith and prayer, and what of miracles? August 1925 on a Danish farm. Widowed Patriarch Borgen, who\'s rather prominent in his community, has three sons: Mikkel, a good-hearted agnostic whose wife Inger is pregnant, Johannes, who believes he is Jesus, and Anders, young, slight, in love with the tailor\'s daughter. The fundamentalist sect of the girl\'s father is anathema to Borgen\'s traditional Lutheranism; he opposes the marriage until the tailor forbids it, then Borgen\'s pride demands that it happen. Unexpectedly, Inger, who is the family\'s sweetness and light, has problems with her pregnancy. The rational doctor arrives, and a long night brings sharp focus to at least four views of faith.', 'English', '2019-08-21 15:57:22'),
(504, 13360, 'tt0105217', 'Raising Cain (1992)', 'raising-cain-1992', 1992, 92, 'Jenny Nix, wife of eminent child psychologist Carter Nix, becomes increasingly concerned about her husband\'s seemingly obsessive concern over the upbringing of their daughter. Her own adulterous affair with an old flame, however, causes her to neglect her motherly duties until a spate of local kidnapings forces her to accept the possibility that he may be trying to recreate the twisted mind-control experiments of his discreditied psychologist father.', 'English', '2019-08-21 12:32:07'),
(505, 13359, 'tt1392197', 'Marmaduke (2010)', 'marmaduke-2010', 2010, 0, 'Marmaduke, the world\'s most lovable Great Dane, leaps from comic strip fame (appearing in six hundred newspapers in over twenty countries) to big screen stardom in this family comedy event. A suburban family moves to a new neighborhood in Orange County, California with their large, yet lovable Great Dane, who has a tendency to wreak havoc in his own oblivious way. But it\'s not all living large for the Duke, who finds that fitting in with his new four-legged friends, and a potential romantic interest, isn\'t always easy for a super-sized teenage dog. Owen Wilson gives the beloved Great Dane his voice in the film, which also features the voices of Fergie, George Lopez, Emma Stone, and Kiefer Sutherland.', 'English', '2019-08-21 09:14:49'),
(506, 13358, 'tt0146271', 'April Story (1998)', 'april-story-1998', 1998, 67, 'In spring, a girl leaves the island of Hokkaido to attend university in Tokyo. Once there, she\'s very lonely and finds out people aren\'t anywhere near as friendly like she\'d hoped.', 'English', '2019-08-21 11:26:09'),
(507, 13357, 'tt0048543', 'Razzia (1955)', 'razzia-1955', 1955, 0, '', 'English', '2019-08-21 09:13:51'),
(508, 13356, 'tt6354568', 'Camp Wedding (2019)', 'camp-wedding-2019', 2019, 97, 'Mia\'s destination wedding seems doomed when her bridal party is not too keen on doing all the work to transform a dilapidated summer camp into the venue of her dreams--when they begin to be killed off mysteriously, that doesn\'t help either.', 'English', '2019-08-21 04:04:02'),
(509, 13355, 'tt8769848', 'The Tomorrow Man (2019)', 'the-tomorrow-man-2019', 2019, 94, 'Ed Hemsler spends his life preparing for a disaster that may never come. Ronnie Meisner spends her life shopping for things she may never use. In a small town somewhere in America, these two people will try to find love while trying not to get lost in each other\'s stuff.', 'English', '2019-08-21 01:29:59'),
(510, 13354, 'tt8497794', 'Still Human (2018)', 'still-human-2018', 2018, 115, 'A paralyzed and hopeless Hong Kong man meets his new Filipino domestic worker who has put her dream on hold and came to the city to earn a living. These two strangers live under the same roof through different seasons, and as they learn more about each other, they also learn more about themselves. Together, they learn about how to face the different seasons of life.', 'English', '2019-08-21 06:31:33'),
(511, 13353, 'tt0070119', 'Godmonster of Indian Flats (1973)', 'godmonster-of-indian-flats-1973', 1973, 89, 'A Large mutated sheep Embryo is discovered by a rancher .The mutant is whisked away to the secret lab of Dr. Clemens and his faithful assistant Mariposa. Dr. Clemens discovers that the old mine gives off some strange Phosphorus vapors that may be the cause of the mutation, as well as being the origin for the old legend of a monster that once haunted the area. Clemens puts the Creature in an Incubation Chamber and it\'s not long before the mutant sheep has morphed into an 8-foot monstrosity, which escapes & terrifies the town.', 'English', '2019-08-21 04:10:35'),
(512, 13352, 'tt5580688', 'Hoax (2019)', 'hoax-2019', 2019, 0, 'An investigative team travels deep into the remote Colorado wilderness after a group of young campers are viciously murdered by what may be Bigfoot.', 'English', '2019-08-20 23:32:17'),
(513, 13351, 'tt7759626', 'Agent Mr Chan (2018)', 'agent-mr-chan-2018', 2018, 101, 'A disgraced agent is forced to come back for one last undercover assignment.', 'English', '2019-08-20 22:51:08'),
(514, 13350, 'tt6183104', 'Canal Street (2018)', 'canal-street-2018', 2018, 89, 'After being arrested for the murder of a white classmate, a young black man\'s father fights in court for his son\'s vindication. Against all odds, they embrace their undying trust in each other and find faith in God.', 'English', '2019-08-20 19:38:34'),
(515, 13349, 'tt2076897', 'My Brother the Devil (2012)', 'my-brother-the-devil-2012', 2012, 111, 'Mo is a young boy growing up in a traditional Egyptian household, but beyond the front door of the family\'s modest London flat is a completely different world - the streets of Hackney. The impressionable Mo idolizes his handsome older brother Rashid and wants to follow in his footsteps. However, Rashid, a charismatic and shrewd member of a local gang, wants a different life for his little brother and deals drugs hoping to put Mo through college. One eventful summer, Rashid\'s sexual awakening forces Mo to confront his own fears and phobias and threatens to tear the brothers apart.', 'English', '2019-08-20 20:52:49'),
(516, 13348, 'tt2082221', 'Nameless Gangster: Rules of the Time (2012)', 'nameless-gangster-rules-of-the-time-2012', 2012, 134, 'On the verge of being fired, a corrupt customs official finds a haul of drugs and teams up with a vicious gangster to become the most powerful crime partnership in Busan.', 'English', '2019-08-20 17:38:22'),
(517, 13347, 'tt0071544', 'General Idi Amin Dada: A Self Portrait (1974)', 'general-idi-amin-dada-a-self-portrait-1974', 1974, 92, 'Uganda\'s dictator, General Idi Amin Dada, accepts a foreign crew\'s request to interview and film him. He talks to the camera about his outreach to Arab nations, his goal of eradicating Israel, his views on economic policy, and his views of Nixon, Kissinger, and other world leaders. We also see him dressing down his ministers at a cabinet meeting (two weeks after this meeting, the foreign minister, whom Amin criticizes here, is murdered), supervising a war-game simulation of an invasion of Israel, visiting a village, and addressing a conclave of Ugandan physicians.', 'English', '2019-08-20 14:53:20'),
(518, 13346, 'tt2195548', 'Prince Avalanche (2013)', 'prince-avalanche-2013', 2013, 94, 'After a rough time working a night shift job in the city, Alvin is spending the summer on a remote two-man public works crew, painting lines on newly paved roads through what is a recently wildfire-ravaged region of Texas. He is camping along the way, living off the land, even doing so on his days off. He is what he considers a responsible man, earning and sending money to his girlfriend, Madison, a single mother, so that she need not concern herself with anything besides child rearing. The junior second that Alvin hires for his crew is Madison\'s brother, Lance. Alvin\'s controlling and judgmental nature comes to the surface in his dealings with more immature and irresponsible Lance, who goes back to the city on the weekends so that he can have \"his little man squeezed\", something he cannot understand in Alvin being without Madison or any woman for such a long stretch of time. Alvin prefers to stay in the burnt out woods on the weekends as being alone with his thoughts and his chores -...', 'English', '2019-08-20 12:45:27'),
(519, 13345, 'tt0082812', 'Night School (1981)', 'night-school-1981', 1981, 88, 'A Boston police detective investigates a series of gruesome decapitations of various college coeds commited by a helmeted, black-leather clad serial killer which leads him to suspect a well known anthropology professor as well as his female live-in assistant.', 'English', '2019-08-20 10:14:00'),
(520, 13344, 'tt0048158', 'Hell on Frisco Bay (1955)', 'hell-on-frisco-bay-1955', 1955, 99, 'When ex-cop Steve Rollins is released from San Quentin after five years, his only thoughts are of revenge on the men who framed him for manslaughter. Back in San Francisco, his quest for the truth brings him up against ruthless waterfront gang boss Victor Amato.', 'English', '2019-08-20 07:52:48'),
(521, 13343, 'tt2283336', 'Men in Black: International (2019)', 'men-in-black-international-2019', 2019, 114, 'After an eye-opening encounter of the third kind, the secret MiB organisation\'s newest recruit, Agent M, finds herself under the wing of the heroic Agent H in cosmopolitan London, when a shape-shifting duo of intergalactic assassins executes an alien aristocrat. Now, with a devastating super-weapon of mass destruction hidden somewhere on Earth, the Men in Black will leave no stone unturned to retrieve it; however, heavy clouds of mistrust and a scent of betrayal envelop the once-incorruptible agency. Is there a well-placed mole in their midst?', 'English', '2019-08-20 10:16:58'),
(522, 13342, 'tt0080569', 'Cruising (1980)', 'cruising-1980', 1980, 102, 'A serial killer brutally slays and dismembers several gay men in New York\'s S&M and leather districts. The young police officer Steve Burns is sent undercover onto the streets as decoy for the murderer. Working almost completely isolated from his department, he has to learn and practice the complex rules and signals of this little society. While barely seeing his girlfriend Nancy anymore, the work starts changing him.', 'English', '2019-08-20 16:19:21'),
(523, 13341, 'tt5982922', 'Hatchback (2019)', 'hatchback-2019', 2019, 86, 'Wyatt, a cynical narcoleptic who lives in a flop house-like apartment, wants to be a journalist. His career dreams are nearly dashed when he notices a mysterious girl named Fern living on his block in an 88\' Toyota Tercel hatchback. Fern\'s father went missing and assumed dead when she was a young child living in Montana. After receiving a cryptic letter from a stranger named Dr. Green, telling her that her father is alive and living in LA, she decides to go look for him herself. Together the two set off on a journey to find Fern\'s elusive dad among the derelict corners of the city, while developing a not so platonic interest for each other along the way.', 'English', '2019-08-20 13:21:56'),
(524, 13340, 'tt8922118', 'Low Low (2019)', 'low-low-2019', 2019, 92, 'On their last day of summer, four high-school girls confront sex, violence and their uncertain future as they struggle to reconcile a rebellious youth with impending adulthood.', 'English', '2019-08-21 13:16:08'),
(525, 13339, 'tt3495026', 'Fan (2016)', 'fan-2016', 2016, 138, 'Gaurav a boy from Delhi is a die hard fan of Bollywood superstar Aryan Khanna. He comes to Mumbai to wish his idol on his Birthday, but over there things got worst and Gaurav\'s obsession turned himself a man who wants to create chaos in Aryan Khanna\'s life.', 'English', '2019-08-20 02:50:48'),
(526, 13338, 'tt5575364', 'Take Me Out (2018)', 'take-me-out-2018', 2018, 83, 'Take Me Out is a dramatic, feature film with baseball at its center, about an upper class, black suburban, Chicago family. It will explore marriage, infidelity, education, and teenager relationships. Teenager, Nicholas Dupree, struggles with unwanted pressures of his over possessive father, Farris, while dealing with a sibling rivalry in his brother Ricky. With the help of his mother, Carol, and an old family friend, Mr. Johnson, a former major league baseball player, he finds his path in life. This film will display the major issues and a dramatic analysis of what goes on behind closed doors in the home of what seems to be the perfect all American family.', 'English', '2019-08-20 04:27:23'),
(527, 13337, 'tt5776928', 'Seaside (2018)', 'seaside-2018', 2018, 90, 'A dramatic thriller about Daphne, a young woman who moves to the Oregon Coast with her boyfriend, Roger, when he inherits his childhood beach house, only to discover that Roger hasn\'t been completely honest about his past.', 'English', '2019-08-20 01:56:51'),
(528, 13336, 'tt0297721', 'All About Lily Chou-Chou (2001)', 'all-about-lily-chou-chou-2001', 2001, 146, 'Life isn\'t easy for a group of high school kids growing up absurd in Japan\'s pervasive pop/cyber culture. As they negotiate teen badlands- school bullies, parents from another planet, lurid snapshots of sex and death- these everyday rebels without a cause seek sanctuary, even salvation, through pop star savior Lily Chou-Chou, embracing her sad, dreamy songs and sharing their fears and secrets in Lilyholic chat rooms. Immersed in the speed of everyday troubles, their lives inevitably climax in a fatal collision between real and virtual identities, a final logging-off from innocence.', 'English', '2019-08-19 21:58:00'),
(529, 13335, 'tt0048441', 'Oh... Rosalinda!! (1955)', 'oh-rosalinda-1955', 1955, 101, '\"Die Fledermaus\" (The Bat) is the pseudonym adopted by Dr. Falke (Anton Walbrook). Floating on the buoyant waltzes of Strauss, this Viennese romp is sure to please. Disguises, tricks, and every kind of deception combine to reveal a would-be cheat in hot pursuit of his own wife, much to his chagrin. Silly, charming, always entertaining, always fun. This is a movie version of \"Die Fledermaus\" set in post-war Vienna with the main protagonists of Dr. Falke represented by the three occupying powers. This is not just a movie of a staged production, but a truly filmic version of the operetta.', 'English', '2019-08-20 00:12:54'),
(530, 13334, 'tt5069564', 'John Mulaney: The Comeback Kid (2015)', 'john-mulaney-the-comeback-kid-2015', 2015, 62, 'Armed with boyish charm and a sharp wit, the former SNL writer offers sly takes on marriage, his beef with babies and the time he met Bill Clinton.', 'English', '2019-08-19 22:26:43'),
(531, 13333, 'tt5699154', 'C\'est la vie! (2017)', 'cest-la-vie-2017', 2017, 117, 'Pierre is marrying HÃ©lÃ©na and he wants his wedding party to be first rate. For that he has reserved the services of Max AngÃ©ly, a seasoned caterer, and his team. The reception is to take place in a sumptuous 17th century leisure castle and its beautiful park and the music to be supplied by an excellent DJ. The rich arrogant bridegroom demands that everything go according to plan. Max assures him that will be the case but what he fails to tell him is that his team is not absolutely above reproach. For instance, Etienne (as James), a second-rate entertainer, has replaced the top-level DJ; AdÃ¨le, Max\'s short-tempered assistant, keeps causing embroilment ; Guy, the wedding photographer is a free-loading has been; Josiane, Max\'s close collaborator and also lover, is on the verge of breaking up with him; Julien, a depressive ex-teacher turned waiter, once had a date with - the bride; Samy, an additional waiter, proves quite worthless. But Max, whose motto is \"Always adapt!\" is the ...', 'English', '2019-08-19 19:52:26'),
(532, 13332, 'tt2332573', 'Clownwise (2013)', 'clownwise-2013', 2013, 120, 'At the beginning of their careers Oskar, Max and Viktor created a superstar clown trio called The Busters. Their clownery personified little islands of freedom in the midst of a motionless swamp of resignation during the communist regime of the former Czechoslovakia. An explosive disagreement, however, led to the three clowns breaking up. As it turns out, the clowns, beloved by the nation, can\'t stand each other. Now, after thirty years in exile, Oskar (Didier Flamand) returns to end his artistic career in Prague. The meeting with his former friends leads to an unavoidable confrontation with now morbidly obese Viktor (JirÃ­ LÃ¡bus) and terminally ill Max (Oldrich Kaiser). Even after all this time the question remains the same: who will have the last laugh?', 'English', '2019-08-19 17:51:03'),
(533, 13331, 'tt0458438', 'Dorm Daze 2 (2006)', 'dorm-daze-2-2006', 2006, 100, 'The gang from Dorm Daze is back, but this time they\'re on a cruise ship on a tropical voyage through the high seas. The captain and crew of the Surveyor, a floating classroom for Billingsley University\'s Sea program, is about to make a voyage they\'ll never forget. The cruise makes an educational stop at the island of San Paradiso, where the students are supposed to explore an important archaeological site. Things go from normal to crazy as their visit coincides with every other college\'s spring break. The moment the boat docks, classes are over! For these Billingsley students, their Semester at Sea will be an adventure no one will ever forget.', 'English', '2019-08-19 14:45:14'),
(534, 13330, 'tt7033192', 'Pond Life (2018)', 'pond-life-2018', 2018, 100, 'Summertime, 1994. In a quiet mining village just outside Doncaster, a rumour stirs about the legend of a giant carp in the nearby decoy ponds. Trevor takes watch one night at the water\'s edge. The following night, he decides to lead a brigade of young friends and neighbours on a fishing expedition. In a world of broken families, cassette tapes and rumbling political fever, these friends, each with their own struggles to bear, share a moment of harmony as they witness the carp for themselves that they will never forget.', 'English', '2019-08-19 12:17:03'),
(535, 13329, 'tt8917964', 'Mari (2018)', 'mari-2018', 2018, 94, 'MARI is a moving dance-drama focused on a mother and her two daughters dealing with the devastating gradual decline and eventual passing of their mother and grandmother, Mari. Centered on the tensions that linger over the family\'s strained relationships, Mari\'s ill health brings them all together, forcing them to deal with their issues and find a way through a time of shared loss.', 'English', '2019-08-19 14:32:01'),
(536, 13328, 'tt5521550', 'Dirty 30 (2016)', 'dirty-30-2016', 2016, 86, 'Lifelong friends Kate, Evie and Charlie are in a rut. Kate spends her days at a middling job and her nights alone or on failed dates. Evie is married with the in-laws from hell, wandering from one charitable cause to the next. Charlie has the girl of her dreams but just can\'t seem to pull her business (or her act) together. On the eve of Kate\'s 30th birthday, she agrees to let Evie and Charlie throw her a party. But what\'s supposed to be a simple celebration becomes a wild who\'s who of past and present, and things quickly spiral out of control.', 'English', '2019-08-19 11:44:00'),
(537, 13327, 'tt6445922', 'Cleek (2017)', 'cleek-2017', 2017, 112, 'Jacob Cleek is a quiet well presented artist, who keeps himself to himself. But Jacob has a secret, and when it starts to break to the surface, he must do what he can to stop his world from crumbling.', 'English', '2019-08-19 08:33:30'),
(538, 13326, 'tt0105063', 'The Opposite Sex and How to Live with Them (1992)', 'the-opposite-sex-and-how-to-live-with-them-1992', 1992, 0, 'Jewish Jack-the-lad David seriously fancies smart, rich Anglo-Saxon Carrie as soon as he first offends her in a Boston bar. They run into each other again and though she still says she finds him appalling he works on it and they are soon together. His even more reprehensible best mate and her blousy best friend watch bemused as the two fall deeply in love and then apparently as fatally out again.', 'English', '2019-08-19 05:16:05'),
(539, 13325, 'tt0028358', 'Things to Come (1936)', 'things-to-come-1936', 1936, 100, 'A global war begins in 1940. This war drags out over many decades until most of the people still alive (mostly those born after the war started) do not even know who started it or why. Nothing is being manufactured at all any more and society has broken down into primitive localized communities. In 1966 a great plague wipes out most of what people are left but small numbers still survive. One day a strange aircraft lands at one of these communities and its pilot tells of an organization which is rebuilding civilization and slowly moving across the world re-civilizing these groups of survivors. Great reconstruction takes place over the next few decades and society is once again great and strong. The world\'s population is now living in underground cities. In the year 2035, on the eve of man\'s first flight to the moon, a popular uprising against progress (which some people claim has caused the wars of the past) gains support and becomes violent.', 'English', '2019-08-19 09:43:39'),
(540, 13324, 'tt5432712', 'Cinderella the Cat (2017)', 'cinderella-the-cat-2017', 2017, 86, 'Cenerentola struggles to escape the shadow and evil schemes of her stepmother and six stepsisters who all live aboard the Megaride, a ship stuck in the port of a decaying future Naples.', 'English', '2019-08-19 07:13:42'),
(541, 13323, 'tt5859882', 'Vita & Virginia (2018)', 'vita-virginia-2018', 2018, 110, 'Vita and Virginia is a love story of the affair and the friendship between writer Virginia Woolf \"Elizabeth Debicki\", and aristocrat Vita Sackville West \"Gemma Arterton\". In 1922, when Vita receives an invitation their paths crossed in Bloomsbury with Virginia. Their romance overcomes all social boundaries, Virginia\'s mental health struggles Vita\'s recklessness and neither will ever be the same without the other.', 'English', '2019-08-19 02:02:54'),
(542, 13322, 'tt5954556', 'The Flood (2019)', 'the-flood-2019', 2019, 99, 'The Flood sees Lena Headey alongside Game of Thrones co-star Iain Glen take on one of the most explosive topics in modern politics. See why critics are gripped by it and are calling it \"soul scraping\", a \"must see\", with a \"clever twist in the end\".', 'English', '2019-08-18 23:07:44'),
(543, 13321, 'tt7006938', 'A Gift to Remember (2017)', 'a-gift-to-remember-2017', 2017, 90, 'Based on the book by Melissa Hill, Darcy finds romance with a handsome stranger with amnesia.', 'English', '2019-08-19 05:10:35'),
(544, 13320, 'tt7830428', 'Trico Tri Happy Halloween (2018)', 'trico-tri-happy-halloween-2018', 2018, 89, 'A Hispanic middle-class family moves back to Miami after living in California to take care of their recently widowed Abuela. Little do they know their new house is the infamous Bradford house which is haunted by two mischievous ghosts. Hilarious situations ensue as the family settles in, romance unfolds, over-zealous ghost hunters stalk the house, Abuela becomes more and more superstitious all the while high schoolers plan to throw a big Halloween party at the Bradford house.', 'English', '2019-08-19 02:59:35'),
(545, 13319, 'tt1756489', 'Dreaming the Quiet Man (2010)', 'dreaming-the-quiet-man-2010', 2010, 0, 'This documentary delves into the psyche of John Ford and his twenty year struggle to bring his homage to his parents homeland to the screen.', 'English', '2019-08-19 00:45:21'),
(546, 13318, 'tt3227442', 'To Whom It May Concern (2015)', 'to-whom-it-may-concern-2015', 2015, 97, 'Anna, a 30 year old beautiful but emotionally dysfunctional bartender, is planning her own death. When Rachel, Anna\'s neighbor, kicks her boyfriend Sam out of the apartment, Anna, who has a secret crush on him rescues him and lets him stay on her couch. The two quickly fall for each other. Sam gently forces her out of her comfort zone and brings hope and trust back in her life. For the first time in years, Anna can open her heart and maybe let go of the past. But Sam moves back with Rachel and Anna decides to go on with her plan.', 'English', '2019-08-18 20:35:56'),
(547, 13317, 'tt0096380', 'Vice Versa (1988)', 'vice-versa-1988', 1988, 98, 'On returning from a buying trip abroad for the department store in which he works, Marshall finds he is in possession of a strange ornamental skull. Marshall is divorced and is looking after his son Charlie for a few days. The skull has special powers, and when Marshall and Charlie simultaneously wish they were each others age, father and son exchange bodies. Now Charlie has to go to work, and Marshall to school. Charlie also has to deal with Marshall\'s girlfriend. If that weren\'t enough a pair of smugglers are in pursuit of the skull.', 'English', '2019-08-18 19:35:07'),
(548, 13316, 'tt0079103', 'Elvis (1979)', 'elvis-1979', 1979, 150, 'Biographical movie about the famous rock singer Elvis Presley.', 'English', '2019-08-18 15:19:53'),
(549, 13315, 'tt0097719', 'Laurin (1989)', 'laurin-1989', 1989, 0, 'A small port at the turn of last century, embedded in a romantic river landscape with dense woods and a large castle ruin on a hill. Laurin, a pretty girl aged nine, lives together with her young mother Flora, her father Arne and her somewhat peculiar grandmother, Olga, in a remote, ivy-clad cottage in the middle of the forest. Laurin\'s father is a sailor and he often has to leave his family back for more than a couple of months. One evening Flora takes her husband for the long way down to the harbour. On her way back through night and storm she dies under mysterious circumstances, crashing through the rotten railing of a long, wooden bridge and drowning in the icy water of the river. Flora\'s death appears like a horrible accident, yet her little daughter feels that something evil is concealed in the village community. Two years later, Laurin\'s father has gone off to sea again and the girl stays alone with her grandmother. It is now, that Van Rees, the parson\'s son, returns from the ...', 'English', '2019-08-18 12:09:57'),
(550, 13314, 'tt3842614', 'The Intent (2016)', 'the-intent-2016', 2016, 104, 'Gunz (Dylan Duffus) is thrust into a world of excitement when he joins the TIC crew. The crew, led by the ruthless Hoodz (Scorcher), goes from low level weed peddling to full on armed robberies within a fortnight. Their new found infamy affords them a life of guns, drugs, and girls but they also catch the attention of the police and a rival gang. To make matters worse they have been infiltrated by an undercover police officer. Does he have \"THE INTENT\" to remain a criminal or abide by his oath to the force?', 'English', '2019-08-18 17:51:15'),
(551, 13313, 'tt0114609', 'Tales from the Hood (1995)', 'tales-from-the-hood-1995', 1995, 98, 'Four short, moralistic horror vignettes (a la EC Comics) that deal with mostly black characters. The framing story introduces three youths out to pick up a drug shipment at a funeral parlor from the strange director, Mr. Simms. As the three punks wind their way through the parlor, Mr. Simms tells them the last stories of some of his more interesting clients.', 'English', '2019-08-18 14:39:49'),
(552, 13312, 'tt0102216', 'King Ralph (1991)', 'king-ralph-1991', 1991, 97, 'When an accident obliterates the British royal family and most of its branches, a desperate geneological search discovers the next King: Ralph, a sleazy American lounge singer. Can Ralph measure up to the job, even with the help of loyal aristocrat Willingham?', 'English', '2019-08-18 11:25:29'),
(553, 13311, 'tt4228810', 'Kalinka (2016)', 'kalinka-2016', 2016, 87, 'Based on a true story, KALINKA is about the struggle of Andre Bamberski to bring justice to his daughter Kalinka who died in disturbing circumstances. After 27 years of investigation to hunt down her presumed murderer, Bamberski will finally get the killer kidnapped and brought to justice.', 'English', '2019-08-18 04:18:22'),
(554, 13310, 'tt3900796', 'Temps (2016)', 'temps-2016', 2016, 95, 'The comedy follows Jefferson (Rosenmeyer), a ski-bum temp worker, whose singular joy comes from an annual excursion to the slopes with fellow slacker Curtis (Ewing). But when Jefferson falls for Stephanie (Shaw), an ambitious go-getter, he is forced to re-evaluate his priorities.', 'English', '2019-08-18 08:50:56'),
(555, 13309, 'tt0032637', 'The Invisible Woman (1940)', 'the-invisible-woman-1940', 1940, 72, 'Eccentric Professor Gibbs, brilliant but impractical, invents an invisibility machine and advertises for a guinea pig. What he gets is Kitty Carroll, an attractive, adventurous model, who thinks being invisible would help her settle a few scores. Complications arise when three comic gangsters steal the machine to use on their boss. But they fail to reckon with the Revenge of the Invisible Woman!', 'English', '2019-08-18 02:24:09'),
(556, 13308, 'tt1345734', 'Rough Cut (2008)', 'rough-cut-2008', 2008, 113, 'A gangster who wants to be an actor; an actor more gangster than anything. Here their paths and lives begin to cross.', 'English', '2019-08-18 05:53:38'),
(557, 13307, 'tt6014556', 'Killer Bees (2017)', 'killer-bees-2017', 2017, 85, 'A championship high school basketball team provides pride, tradition and hope for an African American community struggling to survive in the middle of one of the wealthiest communities in America - The Hamptons.', 'English', '2019-08-18 02:53:27'),
(558, 13306, 'tt0022879', 'A Farewell to Arms (1932)', 'a-farewell-to-arms-1932', 1932, 80, 'A tale of the love between ambulance driver Lt. Henry and Nurse Catherine Barkley during World War I. The action takes place in Italy and the two fall in love during the war and will stop at nothing to be together. The film also analyses Lt. Henry\'s feelings on war and the purpose of fighting.', 'English', '2019-08-18 00:06:10'),
(559, 13305, 'tt1072755', 'Minutemen (2008)', 'minutemen-2008', 2008, 98, 'A comedy/sci-fi/adventure about three high school kids who invent a 10 minute time machine to spare others just like them from the humiliation they\'ve endured.', 'English', '2019-08-18 00:02:05'),
(560, 13304, 'tt0844794', 'Northanger Abbey (2007)', 'northanger-abbey-2007', 2007, 84, 'When Catherine Morland is given the opportunity to stay with the childless Allen family in Bath, she is hoping for an adventure of the type she has been reading in novels. Soon introduced to society, she meets Isabella Thorpe and her brother John, a good friend of her own brother, James. She also meets Henry Tilney, a handsome young man from a good family and his sister, Eleanor. Invited to visit the Tilney estate, Northanger Abbey, she has thoughts of romance but soon learns that status, class and money are all equally important when it comes to matters of the heart.', 'English', '2019-08-17 20:59:34'),
(561, 13303, 'tt3206074', 'Hashima Project (2013)', 'hashima-project-2013', 2013, 118, 'Hashima Island was once the most densely populated island but has been a ghost island since 1974. A group of teenagers will now step foot on this island to capture paranormal encounters on tape. On the island, the teenagers are thrilled as they explore. However, their excitement is short-lived. They realize something ominous is creeping up on them and the hair-raising truth unveils through the lens of the camera.', 'English', '2019-08-17 21:02:26'),
(562, 13302, 'tt2828884', 'Hoovey (2015)', 'hoovey-2015', 2015, 91, 'Life can change in an instant, and turn your whole world upside down. And that is exactly what happens to firefighter Jeff Elliott and his wife Ruth who are living their dream in the golden Midwest; high school sweethearts, married with two beautiful and healthy children, family farm, horses, sports, church groups, the whole American Dream come true. And one winters day, teenage son Eric \"Hoovey\" Elliott collapses at high school basketball practice, is rushed to the hospital, and the doctors find a tumor the size of an orange at the base of his brain. They\'re down to hours-if surgery that risks the boy\'s ability to walk, talk, and perhaps even survive is not performed immediately, Hoovey\'s young life will end before it truly even begins. In a grueling 8-hour procedure, the tumor is removed. And he survives. But for the Elliott family, life and dreams will never be the same. Hoovey has to teach himself to walk again, to read again, to even see straight with two unbalanced eyes, covered...', 'English', '2019-08-17 14:21:23'),
(563, 13301, 'tt6848624', 'Owaranai hito: Miyazaki Hayao (2016)', 'owaranai-hito-miyazaki-hayao-2016', 2016, 70, 'A look at famous Japanese animator Hayao Miyazaki following his retirement in 2013.', 'English', '2019-08-17 11:43:26'),
(564, 13300, 'tt0068310', 'Boxer from Shantung (1972)', 'boxer-from-shantung-1972', 1972, 94, 'Ma Yung Cheng leaves Shantung, trying to find better fortune in Shanghai, trusting his youth and physical valour. He meets friendship with Hsiai Chiang Pei, and love (CHING LI), and fate has him meet, and find employment with a local gangster. He defeats an undefeatable Foreign Champion, then three champions at once, only to fall into a trap set up by gangster arch-rival Yang Shuang...', 'English', '2019-08-17 08:26:31'),
(565, 13299, 'tt0119280', 'Mrs Brown (1997)', 'mrs-brown-1997', 1997, 101, 'Queen Victoria is deeply depressed after the death of her husband, disappearing from public. Her servant Brown, who adores her, through caress and admiration brings her back to life, but that relationship creates scandalous situation and is likely to lead to monarchy crisis.', 'English', '2019-08-17 04:59:28'),
(566, 13298, 'tt3198000', 'Beyond the Trek (2017)', 'beyond-the-trek-2017', 2017, 89, 'The crew of the ship Teleios, comprised of genetically modified humans, is sent to retrieve the cargo from a mining ship adrift in deep space. It is suspected the crew brutally killed each other, but the reasons unknown. However, when they investigate the crew of Teleios find there are two survivors, one member of the crew and an artificial life form unit. The memory of the AI unit appears to have been erased and Travis O\'Neill refuses to talk. The genetically modified humans are breaking down and learn that the only way to reduce the symptoms is to drink the blood of an unmodified human. The crew discuss the possibility of drinking the blood of the man they believe maybe a serial killer, or may be completely innocent.', 'English', '2019-08-17 13:22:08');
INSERT INTO `imdbinfo` (`id`, `movie_id`, `imdb_code`, `title_long`, `slug`, `year`, `movie_runtime`, `description_full`, `language`, `date_uploaded`) VALUES
(567, 13297, 'tt0828103', 'Taking Chances (2009)', 'taking-chances-2009', 2009, 99, 'When he discovers that an Indian casino is about to be built over the town\'s historic battlefield, Chase Revere, the self-appointed protector of a small town\'s rather meager place in American history, joins forces with sexy but dangerous town siren Lucy Shanks to launch an all-out offensive against the project - earning the wrath of the entire town, who believe that the casino will save their decaying local community.', 'English', '2019-08-17 11:01:06'),
(568, 13296, 'tt6739094', 'Invader ZIM: Enter the Florpus (2019)', 'invader-zim-enter-the-florpus-2019', 2019, 71, 'ZIM discovers his almighty leaders never had any intention of coming to Earth and he loses confidence in himself for the first time in his life, which is the big break his human nemesis, Dib has been waiting for.', 'English', '2019-08-17 09:14:42'),
(569, 13295, 'tt4978710', 'Marjorie Prime (2017)', 'marjorie-prime-2017', 2017, 99, 'In the near future, a time of artificial intelligence: 86-year-old Marjorie has a handsome new companion who looks like her deceased husband and is programmed to feed the story of her life back to her. What would we remember, and what would we forget, if given the chance?', 'English', '2019-08-17 01:18:57'),
(570, 13294, 'tt0114887', 'A Walk in the Clouds (1995)', 'a-walk-in-the-clouds-1995', 1995, 102, 'A young married US military soldier, Paul, returns home after World War II and meets a girl, Victoria, along the way. Victoria is pregnant and terrified of returning home to her Mexican family where her strict over protective father will surely disapprove of her out of wedlock pregnancy. Wanting to help, Paul offers to pose as her husband to calm things over until such time he is free to leave again but as they spend time together, they start falling in love with each other. However, Paul is still married and they have to hold themselves back before fate would intervene and tragedy would ensue and they would finally be together.', 'English', '2019-08-17 06:42:16'),
(571, 13293, 'tt0061696', 'Games (1967)', 'games-1967', 1967, 97, 'A young hip New York couple, Jennifer and Paul Montgomery, love to play games. Jennifer is a wealthy heiress and inherited their New York brownstone from her mother. Paul for his part likes to spend her money and indulges his interests in modern art. They hold frequent parties and play their games. Into their lives appears Lisa Schindler, a door to door saleswoman. They decide to play one of their practical jokes on the grocery delivery man, Norman, where a supposedly jealous Paul accuses him of making advances to Jennifer, He shoots him twice - with blanks - and everyone has a laugh but the third shot kills him. In the days following his death Jennifer begins to hear noises in the house and seeing shadowy figures at the end of dark hallways. Is it all a game?', 'English', '2019-08-17 01:56:37'),
(572, 13292, 'tt5592796', 'Driven (2018)', 'driven-2018', 2018, 108, 'After he\'s busted for smuggling coke on his plane, Jim Hoffman has a chance to start over in a lush, affluent suburb of San Diego. Jim and his wife, Ellen are surprised to find maverick auto mogul John DeLorean lives in a glamorous house down the street. Soon an unexpected friendship forms between the two men, just as John\'s new venture--the DeLorean Motor Company--is taking off. But with the FBI pushing Jim to inform on his flashy former dealer, Morgan Hetrick and John\'s financing falling through the cracks, things are far from idyllic...and about to take a dark turn. Based on the real events that would become the celebrity scandal of its generation.', 'English', '2019-08-16 20:26:06'),
(573, 13291, 'tt9100028', 'The Little Switzerland (2019)', 'the-little-switzerland-2019', 2019, 86, 'TellerÃ­a is a fictional 700 years old town that politically belongs to the Automous Community of Castilla-LeÃ³n despite to be located in the Basque Country (north to Spain), which inhabitants want unsuccessfully to change of community from Castilla-LeÃ³n to Basque Country from much time ago. In the same day that AntolÃ­n, town\'s mayor, makes a new attempt just to learn that it was rejected again, his son Gorka back to the town with his job partner and love interest Yolanda to investigate town\'s church past, managed by town\'s priest Don Anselmo. When by chance Yolanda falls to the under ground due to the unfinished works made by well-known historian and archaeologist Peio, she finds a medieval sepulcher, discovering that it\'s the tomb of Walter Tell, son of legendary Swiss hero William Tell. Finding an ancient documents that prove the creation of TellerÃ­a (Tellstadt in English and rest of languages) as a gift given to Walter Tell after his help to the King of Castile Alfonso XI in a ...', 'English', '2019-08-16 18:02:14'),
(574, 13290, 'tt8976710', 'Sextuplets (2019)', 'sextuplets-2019', 2019, 97, 'The comedy SEXTUPLETS tells the story of Alan, an expectant father who grew up believing he was an only child. While searching for his birth mother, Alan comes face-to-face with a brother he never knew existed, Russell, who helps him uncover their secret status as sextuplets (all played by Marlon Wayans). Soon they begin a spontaneous road trip to track down their additional siblings, but not before Alan wonders whether exploring his roots was a huge mistake.', 'English', '2019-08-16 23:31:40'),
(575, 13289, 'tt6085412', 'Alien Invasion (2018)', 'alien-invasion-2018', 2018, 82, 'Sara travels to the hot spot in which supposedly one of the most extraordinary contact episodes with extraterrestrials in history took place. The forest ranger and a sinister villager, accompany her, helping her to overcome the dangers that nature entails. However, despite good intentions, they will soon be attacked by a creature that lives in the depths of the forest, being forced to take refuge in an old abandoned military barracks.', 'English', '2019-08-16 15:34:37'),
(576, 13288, 'tt7089628', 'Already Gone (2019)', 'already-gone-2019', 2019, 0, 'Robinson \"Tyler Dean Flores\" is a lonely, teenager who uses his graffiti to escape from his abusive stepfather Martin \"Seann William Scott\", who he lives with in Coney Island. Robinson is in love with Martin\'s girlfriend Keesha \"Justine Skye\", an exotic dancer. When Martin attempts to pimp Keesha out Robinson rescues her and the two flee Brooklyn, stealing a car and a bag filled with Martin\'s drug money. On the road they experience a new world and Robinson\'s love for Keesha grows. They break down in rural Colorado and are taken in by Edwin \"Shiloh Fernandez\", a handsome aspiring artist and his family. When Keesha falls for Edwin, Robinson feels betrayed and heartbroken. All this while Martin grows ever closer to tracking them down.', 'English', '2019-08-16 21:13:55'),
(577, 13287, 'tt0098086', 'Peter och Petra (1989)', 'peter-och-petra-1989', 1989, 76, 'Peter and Petra are two young children. Two small, small children. No bigger than two little dolls. They belong to the Little People, but their mother and father also think that the Little People need to learn to read and write.', 'English', '2019-08-16 10:23:53'),
(578, 13286, 'tt0105622', 'Tokyo Decadence (1992)', 'tokyo-decadence-1992', 1992, 135, 'A submissive hooker goes about her trade, suffering abuse at the hands of Japanese salarymen and Yakuza types. She\'s unhappy about her work, and is apparently trying to find some sort of appeasement for the fact that her lover has married.', 'English', '2019-08-16 08:38:09'),
(579, 13285, 'tt0049446', 'Lisbon (1956)', 'lisbon-1956', 1956, 90, 'High stakes battle of wits and morals between gentlemen crooks, set in beautiful Portugal. A smuggler is hired to kidnap the rich husband of an American woman who\'s just arrived in Lisbon, Portugal.', 'English', '2019-08-16 12:55:21'),
(580, 13284, 'tt8247470', 'Rosie (2018)', 'rosie-2018', 2018, 86, 'ROSIE tells the story of a mother trying to protect her family after their landlord sells their rented home and they become homeless.', 'English', '2019-08-16 06:32:19'),
(581, 13283, 'tt0380736', 'The 7th Day (2004)', 'the-7th-day-2004', 2004, 96, 'In an isolated village in Extremadura (Spain), the JimÃ©nez and Fuentes families have a violent history of land disputes, jealousy, envy, and violence.', 'English', '2019-08-16 18:36:08'),
(582, 13282, 'tt5101956', 'Golden Orchestra! (2016)', 'golden-orchestra-2016', 2016, 119, 'When the new teacher at the high school, who has played violin since her school days, hears a local amateur orchestra her interest is rekindled and she determines to join. Being new and unfamiliar with the town she accidentally enrolls in an orchestra comprised of the elderly who nonetheless are delighted to have the younger blood. The teacher does not have the heart to backtrack and disappoint them. She is the permanent new conductor.', 'English', '2019-08-16 15:38:31'),
(583, 13281, 'tt8983294', 'Wicked Witches (2018)', 'wicked-witches-2018', 2018, 0, 'After being thrown out of his home by his wife for being promiscuous, Mark finds himself back at Dumpling Farm, a place of youthful memories and parties, but things aren\'t quite right. His old buddy Ian, who has never left the place, is possessed by a group of demonic, flesh-eating Witches. Using Ian and his farm, these beautiful Witches honey trap Mark and his friends to consume their souls.', 'English', '2019-08-16 13:22:15'),
(584, 13280, 'tt4117094', 'Vengeance of an Assassin (2014)', 'vengeance-of-an-assassin-2014', 2014, 90, 'The Assassins\' Code - Stick to the mission. Never take your eyes off the target. Show no mercy. Natee (Dan Chupong) became a killer for one reason- to discover who killed his parents. As he gets closer to uncovering a secret network of power and corruption, he\'s double-crossed on a job, making him a target and putting everyone he loves in danger. Betrayed, exposed, and hunted by the deadliest killers in the business, now Natee has a new code. Be faster. Stronger. Hit harder. Survive. Director, fight choreographer of ONG BAK and mentor to action star Tony Jaa, Panna Rittikrai reunites with Dan Chupong of BORN TO FIGHT (2004) in his final film.', 'English', '2019-08-16 07:37:49'),
(585, 13279, 'tt2297031', 'TimeScapes (2012)', 'timescapes-2012', 2012, 52, 'TimeScapes is the debut film from award-winning cinematographer and director Tom Lowe. The non-narrative film features stunning slow-motion and timelapse cinematography of the landscapes, people, and wildlife of the American South West.', 'English', '2019-08-16 05:57:31'),
(586, 13278, 'tt0092576', 'StageFright (1987)', 'stagefright-1987', 1987, 90, 'A troupe of struggling stage actors is rehearsing for a small-town production of a play. Everything seems to be as it should until one of the cast members turns up dead. In a panic, the others try to get out, only to find they are now locked in the theater with the killer! Which one of them committed the murder, and who will get out alive?', 'English', '2019-08-16 03:51:08'),
(587, 13277, 'tt5798432', 'Sequence Break (2017)', 'sequence-break-2017', 2017, 80, 'A reclusive video arcade repair technician experiences bizarre biomechanical mutations and Cronenbergian hallucinations when a mysterious new arcade machine appears in his shop. Reality itself threatens to fracture as he works to solve its mystery and the new chaos that has entered his life.', 'English', '2019-08-16 01:50:51'),
(588, 13276, 'tt5845440', 'Darker Than Night (2018)', 'darker-than-night-2018', 2018, 0, 'Sloan Carter is a young girl who has recently been blinded. Her father leaves for the weekend and her two best friends, returning home from University, keep her company. A protege of her father\'s, passing through town, also spends the night. The peaceful weekend is interrupted by a shadowy threat and the safe country getaway turns into a fight for survival.', 'English', '2019-08-15 23:44:13'),
(589, 13275, 'tt5947416', 'The Last Princess (2016)', 'the-last-princess-2016', 2016, 127, '\"The Last Princess\" is both a drama and an action film that is based upon the life of Princess Deok-hye (1912-1989) who was born into Korea\'s last royal family in 1912 as the youngest and only daughter of the last King of Jo-seon, ex-Emperor Gojong and his concubine Yang Gui-in. In truth, her sad and tragic life was shaped at the highest levels of the Japanese Imperial family and its government, and carried out by their Korean collaborators - a path that led to Japanese political ends at the expense of her personal happiness. Two years before her birth, the Japanese Imperial Army surrounded Gwang-bok-gong Palace with artillery batteries with orders to shoot while Japanese officials inside the Palace coerced Emperor Su-jong\'s (King Go-jong\'s son) cabinet to approve Korea\'s annexation to the Japan Empire. After her beloved father suddenly died from poisoning in 1919 - allegedly by the occupying Japanese - the Japanese forced Princess Deokye to leave Korea and her family for an education...', 'English', '2019-08-16 03:33:20'),
(590, 13274, 'tt7493808', 'What a Wonderful Family! 3: My Wife, My Life (2018)', 'what-a-wonderful-family-3-my-wife-my-life-2018', 2018, 123, 'Not everyone values the housewife enough. When the local friendly neighbourhood burglar hits their house, the husband and wife descend into a quarrel that ends up with the woman departing the house for her hometown. A series of household mishaps, missteps and mistakes follow. Will she and her pet bird return or is this the end of a twenty-year-old marriage? Whatever the case, the household has already ordered delivery eel and rice for dinner.', 'English', '2019-08-15 21:10:08'),
(591, 13273, 'tt5396646', 'The Martyr Maker (2018)', 'the-martyr-maker-2018', 2018, 90, 'Zahid, \"an American born Muslim who, after struggling with his Islamic roots, explores different aspects of the religion, leading to a deadly calling.\"', 'English', '2019-08-15 17:50:44'),
(592, 13272, 'tt6533240', 'Night Hunter (2018)', 'night-hunter-2018', 2018, 98, 'A weathered Lieutenant, his police force, and a local vigilante are all caught up in a dangerous scheme involving a recently arrested, troubled man who\'s linked to years of female abductions and murders.', 'English', '2019-08-15 18:46:01'),
(593, 13271, 'tt0075177', 'Sebastiane (1976)', 'sebastiane-1976', 1976, 86, '300 A.D. : the Roman Sebastianus is exiled to a remote outpost populated exclusively by men. Weakened by their desires, these men turn to homosexual activities to satisfy their needs. However, Sebastianus becomes the target of lust for a homosexual centurion, but he rejects the man\'s advances.', 'English', '2019-08-15 16:29:42'),
(594, 13270, 'tt6890376', 'A Day (2017)', 'a-day-2017', 2017, 90, 'Kim Joon Young is a famous surgeon, but he is not a good father to his daughter Eun Jung. One day he sees his daughter die in front of his eyes. From that moment the day repeats itself and he fights to find the secret of what happens together with the driver of the ambulance Lee Min Chul.', 'English', '2019-08-15 09:28:45'),
(595, 13269, 'tt0064158', 'Che! (1969)', 'che-1969', 1969, 96, 'Biography of Argentinian revolutionary Ernesto \"Che\" Guevara, who helped Fidel Castro in his struggle against the corrupt Batista regime, eventually resulting in the overthrow of that government and Castro\'s taking over of Cuba. The film covers Guevara\'s life from when he first landed in Cuba in 1956 to his death in an ambush by government troops in the mountains of Bolivia in 1967.', 'English', '2019-08-15 07:02:51'),
(596, 13268, 'tt0097211', 'Disorganized Crime (1989)', 'disorganized-crime-1989', 1989, 98, 'This movie places some top thiefs, looking to steal money from a bank. The All-Star cast has many blunders on the way. Meanwhile a member of their group is missing and two cops chase after him.', 'English', '2019-08-15 04:14:11'),
(597, 13267, 'tt0091653', 'Nothing in Common (1986)', 'nothing-in-common-1986', 1986, 118, 'David Basner is a successful advertising executive who has it all: Money, happiness, and women who want him. Then one day his world falls apart when his mother leaves his father. Now, he must balance his life between his mother, who is happy with her newfound independence, and his father, a recently laid off salesman who is hard-headed, stubborn, and hides a lot from David. Now David must cope with the downfall of his family and his life.', 'English', '2019-08-15 01:11:11'),
(598, 13266, 'tt0102898', 'Shakes the Clown (1991)', 'shakes-the-clown-1991', 1991, 87, 'Shakes plods about his duties as party clown, and uses all of his free time getting seriously drunk. Binky, another clown, wins the spot on a local kiddie show, which depresses Shakes even more, and his boss threatens him with unemployment if he can\'t get his act under control. When someone murders Shakes\' boss and makes it look like Shakes did it, he goes undercover, posing as a hated mime, and tries to find information that will clear his name.', 'English', '2019-08-15 07:25:12'),
(599, 13265, 'tt0047892', 'Bob le Flambeur (1956)', 'bob-le-flambeur-1956', 1956, 98, 'Bob, an old gangster and gambler is almost broke, so he decides in spite of the warnings of a friend, a high official from the police, to rob a gambling casino in Deauville. Everything is planned exactly, but the police is informed about the planned coup. Meanwhile in the Casino Bob starts to gamble.', 'English', '2019-08-15 04:23:44'),
(600, 13264, 'tt7958736', 'Ma (2019)', 'ma-2019', 2019, 99, 'In this new psychological horror-thriller from Tate Taylor and Blumhouse, a lonely woman befriends a group of teenagers and decides to let them party at her house. Just when the kids think their luck couldn\'t get any better, things start happening that make them question the intention of their crazy host.', 'English', '2019-08-14 22:39:19');
